INSERT INTO `guide` (`id`, `avatar`, `date_of_birth`, `description`, `email`, `evaluate`, `full_name`, `phone`, `sex`) VALUES
('HDV25001', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854590/saoviet/fuxmzmqducnkt95gxexp.jpg', '1996-12-25', '<h1><strong>🌍 ĐẶNG THỊ THU &ndash; HƯỚNG DẪN VI&Ecirc;N DU LỊCH TẬN T&Acirc;M &amp; S&Aacute;NG TẠO 🌟</strong></h1>\n\n<p>&nbsp; &nbsp; &nbsp;Bạn đang t&igrave;m kiếm một hướng dẫn vi&ecirc;n kh&ocirc;ng chỉ đưa bạn đến những miền đất mới m&agrave; c&ograve;n gi&uacute;p bạn cảm nhận trọn vẹn vẻ đẹp của từng h&agrave;nh tr&igrave;nh? H&atilde;y để <strong>Đặng Thị Thu</strong> đồng h&agrave;nh c&ugrave;ng bạn! Với sự nhiệt huyết, tận t&acirc;m v&agrave; phong c&aacute;ch dẫn dắt cuốn h&uacute;t, c&ocirc; sẽ biến chuyến đi của bạn th&agrave;nh một trải nghiệm kh&oacute; qu&ecirc;n!</p>\n\n<p>&nbsp;</p>\n\n<h3>✨ 1. Đam M&ecirc; Du Lịch V&agrave; Kh&aacute;m Ph&aacute; 🚀</h3>\n\n<p>&nbsp; &nbsp; &nbsp;Kh&ocirc;ng chỉ l&agrave; một c&ocirc;ng việc, với Đặng Thị Thu, du lịch l&agrave; niềm đam m&ecirc; m&atilde;nh liệt. C&ocirc; lu&ocirc;n kh&ocirc;ng ngừng t&igrave;m t&ograve;i, kh&aacute;m ph&aacute; những điểm đến mới lạ, từ những danh lam thắng cảnh nổi tiếng đến những g&oacute;c nhỏ &iacute;t người biết nhưng chứa đựng v&ocirc; v&agrave;n điều th&uacute; vị.</p>\n\n<p>🔍 <strong>T&igrave;m kiếm những địa điểm độc đ&aacute;o</strong> &ndash; Kh&ocirc;ng chỉ dừng lại ở c&aacute;c điểm tham quan phổ biến, Thu lu&ocirc;n cố gắng mang đến cho du kh&aacute;ch những trải nghiệm mới mẻ, từ những con phố nhỏ b&igrave;nh y&ecirc;n đến những khung cảnh thi&ecirc;n nhi&ecirc;n h&ugrave;ng vĩ.</p>\n\n<p>📚 <strong>Nghi&ecirc;n cứu kỹ lưỡng</strong> &ndash; C&ocirc; d&agrave;nh nhiều thời gian để hiểu s&acirc;u về từng điểm đến, từ lịch sử, văn h&oacute;a đến phong tục, gi&uacute;p chuyến đi trở n&ecirc;n &yacute; nghĩa hơn.</p>\n\n<p>&nbsp;</p>\n\n<h3>🎭 2. Kiến Thức S&acirc;u Rộng Về Văn H&oacute;a &amp; Lịch Sử 🏛️</h3>\n\n<p>&nbsp; &nbsp; &nbsp;Với nền tảng kiến thức vững chắc, Thu kh&ocirc;ng chỉ l&agrave; một hướng dẫn vi&ecirc;n m&agrave; c&ograve;n l&agrave; một người kể chuyện t&agrave;i ba.</p>\n\n<p>📖 <strong>Lịch sử v&agrave; truyền thống</strong> &ndash; C&ocirc; gi&uacute;p du kh&aacute;ch hiểu r&otilde; về nguồn gốc v&agrave; &yacute; nghĩa của từng di t&iacute;ch, từng v&ugrave;ng đất.</p>\n\n<p>🎤 <strong>C&aacute;ch kể chuyện l&ocirc;i cuốn</strong> &ndash; Kh&ocirc;ng phải những b&agrave;i giảng kh&ocirc; khan, Thu biến lịch sử th&agrave;nh những c&acirc;u chuyện hấp dẫn, sống động, khiến du kh&aacute;ch cảm thấy như đang sống trong những thời khắc lịch sử quan trọng.</p>\n\n<p>&nbsp;</p>\n\n<h3>🛤️ 3. Tổ Chức Tour Chuy&ecirc;n Nghiệp &amp; S&aacute;ng Tạo 🌟</h3>\n\n<p>&nbsp; &nbsp; &nbsp;<strong>Một chuyến đi ho&agrave;n hảo kh&ocirc;ng chỉ nằm ở điểm đến, m&agrave; c&ograve;n ở c&aacute;ch tổ chức!</strong> Thu lu&ocirc;n biết c&aacute;ch l&ecirc;n kế hoạch một c&aacute;ch khoa học, gi&uacute;p du kh&aacute;ch tận hưởng trọn vẹn m&agrave; kh&ocirc;ng cảm thấy mệt mỏi.</p>\n\n<p>📅 <strong>Lịch tr&igrave;nh linh hoạt</strong> &ndash; Kết hợp h&agrave;i h&ograve;a giữa kh&aacute;m ph&aacute;, nghỉ ngơi v&agrave; trải nghiệm thực tế.</p>\n\n<p>💡 <strong>Những &yacute; tưởng s&aacute;ng tạo</strong> &ndash; Lu&ocirc;n đổi mới, cập nhật xu hướng du lịch để mang lại những h&agrave;nh tr&igrave;nh độc đ&aacute;o, kh&aacute;c biệt.</p>\n\n<p>🎭 <strong>Hoạt động th&uacute; vị</strong> &ndash; Kh&ocirc;ng chỉ tham quan, m&agrave; c&ograve;n c&oacute; những tr&ograve; chơi, thử th&aacute;ch v&agrave; trải nghiệm thực tế để du kh&aacute;ch tham gia.</p>\n\n<p>&nbsp;</p>\n\n<h3>❤️ 4. Tận T&acirc;m, Chu Đ&aacute;o &amp; Thấu Hiểu Du Kh&aacute;ch 🌈</h3>\n\n<p>&nbsp; &nbsp; &nbsp;Sự kh&aacute;c biệt của một hướng dẫn vi&ecirc;n giỏi kh&ocirc;ng chỉ nằm ở kiến thức, m&agrave; c&ograve;n ở c&aacute;ch họ quan t&acirc;m đến du kh&aacute;ch.</p>\n\n<p>🤝 <strong>Lu&ocirc;n sẵn s&agrave;ng hỗ trợ</strong> &ndash; Bất kỳ l&uacute;c n&agrave;o du kh&aacute;ch cần, Thu đều c&oacute; mặt để gi&uacute;p đỡ.</p>\n\n<p>👂 <strong>Lắng nghe v&agrave; thấu hiểu</strong> &ndash; Đ&aacute;p ứng nhu cầu, sở th&iacute;ch của từng c&aacute; nh&acirc;n, gi&uacute;p mỗi người c&oacute; được trải nghiệm ph&ugrave; hợp nhất.</p>\n\n<p>🏡 <strong>Cảm gi&aacute;c như ở nh&agrave;</strong> &ndash; Sự chu đ&aacute;o của Thu khiến mọi người cảm thấy an to&agrave;n, thoải m&aacute;i v&agrave; tận hưởng chuyến đi một c&aacute;ch trọn vẹn nhất.</p>\n\n<p>&nbsp;</p>\n\n<h3>🎤 5. Phong C&aacute;ch Dẫn Dắt L&ocirc;i Cuốn &amp; Truyền Cảm Hứng 🌟</h3>\n\n<p>&nbsp; &nbsp; &nbsp;Một chuyến đi kh&ocirc;ng chỉ l&agrave; h&agrave;nh tr&igrave;nh kh&aacute;m ph&aacute;, m&agrave; c&ograve;n l&agrave; cơ hội để học hỏi, kết nối v&agrave; tận hưởng những điều tuyệt vời trong cuộc sống.</p>\n\n<p>😂 <strong>H&agrave;i hước &amp; gần gũi</strong> &ndash; Với sự duy&ecirc;n d&aacute;ng của m&igrave;nh, Thu lu&ocirc;n tạo ra kh&ocirc;ng kh&iacute; vui vẻ, khiến mọi người cười sảng kho&aacute;i suốt h&agrave;nh tr&igrave;nh.</p>\n\n<p>💡 <strong>Khơi dậy niềm đam m&ecirc; kh&aacute;m ph&aacute;</strong> &ndash; Kh&ocirc;ng chỉ l&agrave; một người dẫn đường, Thu c&ograve;n l&agrave; một người truyền cảm hứng, gi&uacute;p du kh&aacute;ch y&ecirc;u hơn mỗi v&ugrave;ng đất họ đặt ch&acirc;n đến.</p>\n\n<p>🎶 <strong>Tạo kh&ocirc;ng kh&iacute; s&ocirc;i động</strong> &ndash; C&aacute;c chuyến đi c&ugrave;ng Thu kh&ocirc;ng bao giờ nh&agrave;m ch&aacute;n, lu&ocirc;n c&oacute; những c&acirc;u chuyện th&uacute; vị, những b&agrave;i h&aacute;t, những tr&ograve; chơi để gắn kết mọi người.</p>\n\n<p>&nbsp;</p>\n\n<h3>🌟 6. Hướng Dẫn Vi&ecirc;n L&yacute; Tưởng Cho Mọi H&agrave;nh Tr&igrave;nh 🚀</h3>\n\n<p>&nbsp; &nbsp; &nbsp;D&ugrave; bạn đang t&igrave;m kiếm một chuyến <strong>du lịch nghỉ dưỡng</strong>, <strong>kh&aacute;m ph&aacute; thi&ecirc;n nhi&ecirc;n</strong>, hay <strong>trải nghiệm văn h&oacute;a</strong>, Đặng Thị Thu lu&ocirc;n biết c&aacute;ch biến từng h&agrave;nh tr&igrave;nh th&agrave;nh một <strong>c&acirc;u chuyện đẹp đẽ v&agrave; đ&aacute;ng nhớ</strong>.</p>\n\n<p>💼 <strong>Chuy&ecirc;n nghiệp &amp; tr&aacute;ch nhiệm</strong> &ndash; Lu&ocirc;n đảm bảo chuyến đi diễn ra su&ocirc;n sẻ v&agrave; mang lại sự h&agrave;i l&ograve;ng cao nhất cho du kh&aacute;ch.</p>\n\n<p>🌈 <strong>Linh hoạt &amp; s&aacute;ng tạo</strong> &ndash; Lu&ocirc;n t&igrave;m ra những c&aacute;ch mới để mang đến trải nghiệm phong ph&uacute; hơn cho mọi h&agrave;nh kh&aacute;ch.</p>\n\n<p>📸 <strong>Gi&uacute;p bạn lưu giữ kỷ niệm</strong> &ndash; Kh&ocirc;ng chỉ l&agrave; người hướng dẫn, Thu c&ograve;n l&agrave; &quot;nhiếp ảnh gia&quot; tận t&acirc;m, gi&uacute;p du kh&aacute;ch ghi lại những khoảnh khắc đẹp nhất.</p>\n\n<p>&nbsp;</p>\n\n<h1>🎉 <strong>C&ugrave;ng Đặng Thị Thu &ndash; Biến Mỗi Chuyến Đi Th&agrave;nh Một Kỷ Niệm Đ&aacute;ng Nhớ!</strong> 🎉</h1>\n\n<p>📌 <strong>Bạn đ&atilde; sẵn s&agrave;ng cho một h&agrave;nh tr&igrave;nh đầy sắc m&agrave;u, cảm x&uacute;c v&agrave; niềm vui?</strong><br />\n🚀 <strong>H&atilde;y để Đặng Thị Thu đồng h&agrave;nh c&ugrave;ng bạn tr&ecirc;n từng bước ch&acirc;n kh&aacute;m ph&aacute; thế giới!</strong> 🌏💫</p>\n', 'dangthithu@gmail.com', 5, 'Đặng Thị Thu', '0354823671', 'Nữ'),
('HDV25002', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854685/saoviet/ykcqrzvzi97cbx7ej0ku.jpg', '1990-02-09', '<h1><strong>✌️Dương Văn Kh&aacute;nh &ndash; Hướng Dẫn Vi&ecirc;n Du Lịch Nhiệt Huyết, Vui Vẻ v&agrave; Tr&agrave;n Đầy Cảm Hứng</strong></h1>\n\n<p>&nbsp;</p>\n\n<p>🌍 <strong>Bạn muốn c&oacute; một chuyến du lịch đầy ắp niềm vui, tr&agrave;n ngập tiếng cười v&agrave; những trải nghiệm kh&oacute; qu&ecirc;n?</strong> H&atilde;y đồng h&agrave;nh c&ugrave;ng <strong>Dương Văn Kh&aacute;nh</strong>, hướng dẫn vi&ecirc;n du lịch trẻ trung, năng động v&agrave; lu&ocirc;n mang đến nguồn năng lượng t&iacute;ch cực trong mỗi h&agrave;nh tr&igrave;nh!</p>\n\n<p>&nbsp;</p>\n\n<p><strong>🎯 Trẻ Trung &ndash; Nhiệt Huyết &ndash; Tr&agrave;n Đầy Năng Lượng</strong></p>\n\n<p>&nbsp; &nbsp; &nbsp;Ngay từ những ph&uacute;t đầu ti&ecirc;n của chuyến đi, du kh&aacute;ch sẽ cảm nhận được sự s&ocirc;i động v&agrave; tinh thần hứng khởi m&agrave; Kh&aacute;nh mang lại. Kh&ocirc;ng chỉ đơn thuần l&agrave; một người hướng dẫn, anh c&ograve;n l&agrave; người bạn đồng h&agrave;nh, gi&uacute;p chuyến đi của bạn trở n&ecirc;n th&uacute; vị v&agrave; đầy cảm hứng.</p>\n\n<p>🧭 <strong>Dẫn dắt chuy&ecirc;n nghiệp</strong> &ndash; Kh&aacute;nh lu&ocirc;n l&ecirc;n kế hoạch chi tiết, sắp xếp lịch tr&igrave;nh hợp l&yacute; để du kh&aacute;ch c&oacute; thể tận hưởng từng khoảnh khắc một c&aacute;ch trọn vẹn nhất.</p>\n\n<p>🎤 <strong>Lối dẫn chuyện hấp dẫn</strong> &ndash; Kh&ocirc;ng chỉ giới thiệu điểm đến một c&aacute;ch đơn thuần, Kh&aacute;nh c&ograve;n mang đến những c&acirc;u chuyện th&uacute; vị, g&oacute;c nh&igrave;n mới lạ, gi&uacute;p du kh&aacute;ch hiểu v&agrave; cảm nhận được vẻ đẹp thực sự của từng v&ugrave;ng đất.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>🗣️ Khả Năng Giao Tiếp Xuất Sắc &ndash; Kết Nối Mọi Người</strong></p>\n\n<p>&nbsp; &nbsp; &nbsp;Với phong c&aacute;ch th&acirc;n thiện, h&agrave;i hước, Kh&aacute;nh lu&ocirc;n biết c&aacute;ch tạo ra sự gắn kết giữa c&aacute;c th&agrave;nh vi&ecirc;n trong đo&agrave;n. Anh l&agrave; người c&oacute; thể ph&aacute; tan sự xa lạ ban đầu, gi&uacute;p mọi người nhanh ch&oacute;ng h&ograve;a nhập v&agrave; tận hưởng chuyến đi một c&aacute;ch thoải m&aacute;i nhất.</p>\n\n<p>💬 <strong>Dễ d&agrave;ng bắt chuyện</strong> &ndash; D&ugrave; l&agrave; du kh&aacute;ch trong nước hay quốc tế, Kh&aacute;nh đều biết c&aacute;ch tương t&aacute;c, mang đến những cuộc tr&ograve; chuyện vui vẻ, th&uacute; vị.</p>\n\n<p>🎭 <strong>Tổ chức hoạt động giao lưu</strong> &ndash; Những tr&ograve; chơi, hoạt động nh&oacute;m do Kh&aacute;nh dẫn dắt lu&ocirc;n mang lại kh&ocirc;ng kh&iacute; s&ocirc;i động, khiến chuyến đi trở n&ecirc;n đ&aacute;ng nhớ hơn bao giờ hết!&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>😍 Kh&ocirc;ng Chỉ L&agrave; Hướng Dẫn Vi&ecirc;n, M&agrave; C&ograve;n L&agrave; Người Bạn Đồng H&agrave;nh Đ&aacute;ng Tin Cậy</strong></p>\n\n<p>✨ <strong>Chu đ&aacute;o &ndash; Quan t&acirc;m &ndash; Linh hoạt</strong> ✨<br />\n&nbsp; &nbsp; &nbsp;Kh&aacute;nh kh&ocirc;ng chỉ đưa du kh&aacute;ch đến những điểm tham quan nổi tiếng m&agrave; c&ograve;n quan t&acirc;m đến từng chi tiết nhỏ trong chuyến đi.</p>\n\n<p>🚑 <strong>Hỗ trợ tận t&igrave;nh</strong> &ndash; Lu&ocirc;n sẵn s&agrave;ng gi&uacute;p đỡ khi du kh&aacute;ch cần.<br />\n📸 <strong>Chụp ảnh &quot;c&oacute; t&acirc;m&quot;</strong> &ndash; Gi&uacute;p du kh&aacute;ch lưu giữ những khoảnh khắc đẹp nhất.<br />\n⚡ <strong>Xử l&yacute; t&igrave;nh huống nhanh ch&oacute;ng</strong> &ndash; Lu&ocirc;n c&oacute; phương &aacute;n dự ph&ograve;ng để đảm bảo chuyến đi diễn ra su&ocirc;n sẻ.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>🌟 C&ugrave;ng Dương Văn Kh&aacute;nh &ndash; Biến Mỗi Chuyến Đi Th&agrave;nh Một Kỷ Niệm Đ&aacute;ng Nhớ! </strong><strong>🌟</strong></p>\n\n<p>&nbsp; &nbsp; &nbsp;D&ugrave; bạn đang t&igrave;m kiếm một chuyến du lịch thư gi&atilde;n, kh&aacute;m ph&aacute; thi&ecirc;n nhi&ecirc;n h&ugrave;ng vĩ hay trải nghiệm văn h&oacute;a đặc sắc, <strong>Dương Văn Kh&aacute;nh</strong> chắc chắn sẽ l&agrave; người hướng dẫn l&yacute; tưởng, gi&uacute;p bạn c&oacute; một h&agrave;nh tr&igrave;nh đầy cảm x&uacute;c v&agrave; &yacute; nghĩa!</p>\n\n<p>&nbsp;</p>\n\n<p>🚀 <strong>H&atilde;y sẵn s&agrave;ng cho một chuyến đi tr&agrave;n ngập niềm vui, tiếng cười v&agrave; những khoảnh khắc tuyệt vời c&ugrave;ng Dương Văn Kh&aacute;nh!</strong> 🎉</p>\n', 'duongvankhanhk@gmail.com', 5, 'Dương Văn Khánh', '0990123456', 'Nam'),
('HDV25003', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854744/saoviet/h9wjaujwyetsxjdgynwi.jpg', '1988-12-11', '<h1><strong>🌍 B&Ugrave;I TUẤN PHONG &ndash; HƯỚNG DẪN VI&Ecirc;N DU LỊCH KINH NGHIỆM, TẬN T&Acirc;M &amp; HIỂU BIẾT S&Acirc;U RỘNG</strong></h1>\n\n<p>&nbsp; &nbsp; &nbsp;<strong>Bạn muốn c&oacute; một h&agrave;nh tr&igrave;nh kh&ocirc;ng chỉ để tham quan m&agrave; c&ograve;n để hiểu s&acirc;u về văn h&oacute;a, lịch sử v&agrave; con người?</strong><br />\nH&atilde;y đồng h&agrave;nh c&ugrave;ng <strong>B&ugrave;i Tuấn Phong</strong>, một hướng dẫn vi&ecirc;n du lịch d&agrave;y dạn kinh nghiệm, với kiến thức s&acirc;u rộng v&agrave; c&aacute;ch truyền tải cuốn h&uacute;t, gi&uacute;p bạn c&oacute; những trải nghiệm đ&aacute;ng nhớ nhất!</p>\n\n<p>&nbsp;</p>\n\n<h3>🎓 <strong>Chuy&ecirc;n Gia Về Văn H&oacute;a &amp; Lịch Sử &ndash; H&agrave;nh Tr&igrave;nh Của Kiến Thức</strong> 📜</h3>\n\n<p>&nbsp; &nbsp; &nbsp;Với <strong>nhiều năm kinh nghiệm</strong> trong ng&agrave;nh du lịch, B&ugrave;i Tuấn Phong kh&ocirc;ng chỉ đưa du kh&aacute;ch đến c&aacute;c điểm đến nổi tiếng m&agrave; c&ograve;n mang lại những c&acirc;u chuyện đầy m&agrave;u sắc về <strong>lịch sử, văn h&oacute;a v&agrave; phong tục tập qu&aacute;n</strong> của từng v&ugrave;ng đất.</p>\n\n<p>🏛️ <strong>Hiểu s&acirc;u về di t&iacute;ch &amp; danh thắng</strong> &ndash; Kh&ocirc;ng chỉ đơn thuần giới thiệu, Phong gi&uacute;p du kh&aacute;ch <strong>cảm nhận v&agrave; kết nối</strong> với từng địa danh, hiểu r&otilde; &yacute; nghĩa v&agrave; gi&aacute; trị của ch&uacute;ng.</p>\n\n<p>🎤 <strong>C&aacute;ch kể chuyện hấp dẫn</strong> &ndash; Thay v&igrave; chỉ cung cấp th&ocirc;ng tin kh&ocirc; khan, anh biến lịch sử th&agrave;nh những c&acirc;u chuyện l&ocirc;i cuốn, sống động, gi&uacute;p du kh&aacute;ch nhớ l&acirc;u v&agrave; th&iacute;ch th&uacute; hơn.</p>\n\n<p>📖 <strong>Cập nhật kiến thức li&ecirc;n tục</strong> &ndash; Lu&ocirc;n học hỏi, t&igrave;m hiểu những th&ocirc;ng tin mới nhất để mang đến những chuyến đi gi&agrave;u &yacute; nghĩa v&agrave; chiều s&acirc;u.</p>\n\n<p>&nbsp;</p>\n\n<h3>🎯 <strong>Dẫn Dắt Chuy&ecirc;n Nghiệp &ndash; Đ&aacute;p Ứng Mọi Nhu Cầu Du Kh&aacute;ch</strong></h3>\n\n<p>&nbsp; &nbsp; &nbsp;Kh&ocirc;ng chỉ c&oacute; kiến thức vững chắc, Phong c&ograve;n sở hữu phong c&aacute;ch l&agrave;m việc chuy&ecirc;n nghiệp, linh hoạt v&agrave; sẵn s&agrave;ng th&iacute;ch ứng với mọi t&igrave;nh huống.</p>\n\n<p>📅 <strong>Lịch tr&igrave;nh hợp l&yacute; &amp; khoa học</strong> &ndash; Đảm bảo chuyến đi vừa th&uacute; vị vừa thoải m&aacute;i, c&acirc;n bằng giữa tham quan, trải nghiệm v&agrave; nghỉ ngơi.</p>\n\n<p>🗺️ <strong>Gợi &yacute; những điểm đến ph&ugrave; hợp</strong> &ndash; Dựa tr&ecirc;n sở th&iacute;ch v&agrave; nhu cầu của từng đo&agrave;n kh&aacute;ch, Phong lu&ocirc;n c&oacute; những đề xuất hợp l&yacute; để tối ưu h&oacute;a trải nghiệm.</p>\n\n<p>⚡ <strong>Xử l&yacute; t&igrave;nh huống nhanh nhạy</strong> &ndash; Từ thay đổi lịch tr&igrave;nh đến hỗ trợ kh&aacute;ch h&agrave;ng trong c&aacute;c t&igrave;nh huống đặc biệt, anh lu&ocirc;n c&oacute; phương &aacute;n dự ph&ograve;ng để chuyến đi diễn ra su&ocirc;n sẻ.</p>\n\n<p>&nbsp;</p>\n\n<h3>😊 <strong>Mang Đến Sự H&agrave;i L&ograve;ng &amp; Tin Tưởng Tuyệt Đối</strong></h3>\n\n<p>&nbsp; &nbsp; &nbsp;Một trong những điều khiến du kh&aacute;ch y&ecirc;u mến v&agrave; tin tưởng B&ugrave;i Tuấn Phong ch&iacute;nh l&agrave; sự <strong>tận t&acirc;m, tr&aacute;ch nhiệm</strong> v&agrave; <strong>sự ch&acirc;n th&agrave;nh trong từng chuyến đi</strong>.</p>\n\n<p>🤝 <strong>Tận t&igrave;nh, chu đ&aacute;o</strong> &ndash; Lu&ocirc;n quan t&acirc;m đến từng chi tiết nhỏ để đảm bảo du kh&aacute;ch c&oacute; trải nghiệm tốt nhất.</p>\n\n<p>📸 <strong>Gi&uacute;p bạn lưu giữ khoảnh khắc đẹp</strong> &ndash; Kh&ocirc;ng chỉ l&agrave; một hướng dẫn vi&ecirc;n, Phong c&ograve;n l&agrave; một &quot;nhiếp ảnh gia&quot; tận t&acirc;m, gi&uacute;p bạn c&oacute; những bức ảnh kỷ niệm ấn tượng.</p>\n\n<p>🎭 <strong>Kh&ocirc;ng kh&iacute; vui vẻ, th&acirc;n thiện</strong> &ndash; Với phong c&aacute;ch h&agrave;i hước v&agrave; gần gũi, Phong lu&ocirc;n biết c&aacute;ch tạo kh&ocirc;ng kh&iacute; s&ocirc;i động, gi&uacute;p du kh&aacute;ch thoải m&aacute;i v&agrave; tận hưởng trọn vẹn h&agrave;nh tr&igrave;nh.</p>\n\n<h1>&nbsp;</h1>\n\n<h1>🌟 <strong>C&ugrave;ng B&ugrave;i Tuấn Phong &ndash; Kh&aacute;m Ph&aacute;, Cảm Nhận V&agrave; Y&ecirc;u Hơn Mỗi Chuyến Đi!</strong> 🌟</h1>\n\n<p>🚀 <strong>Bạn đ&atilde; sẵn s&agrave;ng cho một chuyến h&agrave;nh tr&igrave;nh đầy trải nghiệm, kiến thức v&agrave; cảm x&uacute;c chưa?</strong><br />\n📌 <strong>H&atilde;y để B&ugrave;i Tuấn Phong đồng h&agrave;nh c&ugrave;ng bạn, biến mỗi chuyến đi th&agrave;nh một kỷ niệm đ&aacute;ng nhớ!</strong> 💫</p>\n', 'tphong@gmail.com', 4, 'Bùi Tuấn Phong', '0925856214', 'Nam'),
('HDV25004', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854801/saoviet/ddeok18y6b1px4qrbpmy.jpg', '1998-07-25', '<h1><strong>🌍 MAI &ndash; CHUY&Ecirc;N GIA DẪN TOUR MIỀN TRUNG, TH&Ocirc;NG THẠO TIẾNG ANH &amp; TIẾNG PH&Aacute;P 🇬🇧🇫🇷</strong></h1>\n\n<p>&nbsp; &nbsp; &nbsp;Bạn đang t&igrave;m kiếm một hướng dẫn vi&ecirc;n du lịch kh&ocirc;ng chỉ am hiểu s&acirc;u sắc về miền Trung m&agrave; c&ograve;n c&oacute; khả năng giao tiếp xuất sắc bằng <strong>tiếng Anh v&agrave; tiếng Ph&aacute;p</strong>?<br />\nH&atilde;y đồng h&agrave;nh c&ugrave;ng <strong>Mai</strong>, một chuy&ecirc;n gia tổ chức tour chuy&ecirc;n nghiệp, người sẽ mang đến cho bạn những h&agrave;nh tr&igrave;nh kh&aacute;m ph&aacute; <strong>di sản văn h&oacute;a độc đ&aacute;o</strong> v&agrave; trải nghiệm địa phương ch&acirc;n thực nhất!</p>\n\n<p>&nbsp;</p>\n\n<h3>🏛 <strong>Chuy&ecirc;n Gia Về Di Sản Văn H&oacute;a &ndash; H&agrave;nh Tr&igrave;nh Xuy&ecirc;n Thời Gian</strong></h3>\n\n<p>&nbsp; &nbsp; &nbsp;Miền Trung Việt Nam kh&ocirc;ng chỉ sở hữu những cảnh quan thi&ecirc;n nhi&ecirc;n h&ugrave;ng vĩ m&agrave; c&ograve;n l&agrave; v&ugrave;ng đất của những <strong>di sản văn h&oacute;a thế giới</strong>. Với <strong>kiến thức s&acirc;u rộng</strong> về lịch sử v&agrave; văn h&oacute;a, Mai sẽ đưa bạn v&agrave;o <strong>một chuyến h&agrave;nh tr&igrave;nh đầy cảm x&uacute;c</strong>, gi&uacute;p bạn hiểu r&otilde; hơn về gi&aacute; trị v&agrave; &yacute; nghĩa của từng điểm đến.</p>\n\n<p>📍 <strong>Kh&aacute;m ph&aacute; cố đ&ocirc; Huế</strong> &ndash; Ho&agrave;ng th&agrave;nh, lăng tẩm vua ch&uacute;a v&agrave; những c&acirc;u chuyện th&uacute; vị về triều Nguyễn.</p>\n\n<p>📍 <strong>Hội An cổ k&iacute;nh</strong> &ndash; Những ng&ocirc;i nh&agrave; h&agrave;ng trăm năm tuổi, đ&egrave;n lồng rực rỡ v&agrave; n&eacute;t đẹp giao thoa văn h&oacute;a Đ&ocirc;ng &ndash; T&acirc;y.</p>\n\n<p>📍 <strong>Th&aacute;nh địa Mỹ Sơn</strong> &ndash; Tận mắt chi&ecirc;m ngưỡng những đền th&aacute;p Chăm b&iacute; ẩn giữa thi&ecirc;n nhi&ecirc;n kỳ vĩ.</p>\n\n<p>📍 <strong>Đ&agrave; Nẵng hiện đại</strong> &ndash; Những c&acirc;y cầu biểu tượng v&agrave; b&atilde;i biển trong xanh quyến rũ.</p>\n\n<h3>&nbsp;</h3>\n\n<h3>🌍 <strong>Th&ocirc;ng Thạo Tiếng Anh &amp; Tiếng Ph&aacute;p &ndash; Dẫn Tour Quốc Tế Chuy&ecirc;n Nghiệp</strong></h3>\n\n<p>&nbsp; &nbsp; &nbsp;Với khả năng <strong>giao tiếp th&agrave;nh thạo tiếng Anh v&agrave; tiếng Ph&aacute;p</strong>, Mai c&oacute; thể kết nối với du kh&aacute;ch từ khắp nơi tr&ecirc;n thế giới, gi&uacute;p họ hiểu s&acirc;u hơn về lịch sử, văn h&oacute;a v&agrave; con người Việt Nam.</p>\n\n<p>🎙 <strong>Giải th&iacute;ch chi tiết, dễ hiểu</strong> &ndash; Cung cấp th&ocirc;ng tin r&otilde; r&agrave;ng, đầy đủ m&agrave; vẫn cuốn h&uacute;t.</p>\n\n<p>🤝 <strong>Kết nối du kh&aacute;ch với địa phương</strong> &ndash; Gi&uacute;p du kh&aacute;ch trải nghiệm ch&acirc;n thực nhất về ẩm thực, phong tục, đời sống của người d&acirc;n bản địa.</p>\n\n<p>🎭 <strong>Giao tiếp linh hoạt, th&acirc;n thiện</strong> &ndash; Lu&ocirc;n tạo cảm gi&aacute;c gần gũi, cởi mở v&agrave; gi&uacute;p du kh&aacute;ch cảm thấy thoải m&aacute;i trong suốt h&agrave;nh tr&igrave;nh.</p>\n\n<p>&nbsp;</p>\n\n<h3>🎯 <strong>Tổ Chức Tour Khoa Học &amp; Trải Nghiệm Độc Đ&aacute;o</strong></h3>\n\n<p>&nbsp; &nbsp; &nbsp;Mai kh&ocirc;ng chỉ dẫn tour m&agrave; c&ograve;n l&agrave; người l&ecirc;n kế hoạch <strong>tỉ mỉ, linh hoạt</strong>, đảm bảo chuyến đi <strong>được tối ưu về thời gian</strong> m&agrave; vẫn giữ được sự thoải m&aacute;i, th&uacute; vị.</p>\n\n<p>📅 <strong>Lịch tr&igrave;nh hợp l&yacute;</strong> &ndash; C&acirc;n bằng giữa tham quan, nghỉ ngơi v&agrave; kh&aacute;m ph&aacute; văn h&oacute;a địa phương.</p>\n\n<p>🎭 <strong>Trải nghiệm đặc biệt</strong> &ndash; Tổ chức c&aacute;c hoạt động <strong>l&agrave;m đ&egrave;n lồng ở Hội An, học nấu m&oacute;n Huế, kh&aacute;m ph&aacute; l&agrave;ng nghề truyền thống</strong>...</p>\n\n<p>🍽 <strong>Ẩm thực địa phương</strong> &ndash; Gợi &yacute; những m&oacute;n ăn đặc sản, từ <strong>b&uacute;n b&ograve; Huế, cao lầu, b&aacute;nh x&egrave;o miền Trung</strong> đến những m&oacute;n ăn đường phố hấp dẫn.</p>\n\n<p>&nbsp;</p>\n\n<h3>💖 <strong>Hướng Dẫn Vi&ecirc;n Tận T&acirc;m, Chuy&ecirc;n Nghiệp &amp; Đ&aacute;ng Tin Cậy</strong></h3>\n\n<p>&nbsp; &nbsp; &nbsp;Sự tận t&acirc;m của Mai kh&ocirc;ng chỉ thể hiện qua việc hướng dẫn m&agrave; c&ograve;n ở <strong>c&aacute;ch c&ocirc; quan t&acirc;m đến từng du kh&aacute;ch</strong>.</p>\n\n<p>🤗 <strong>Lu&ocirc;n sẵn s&agrave;ng hỗ trợ</strong> &ndash; Đảm bảo du kh&aacute;ch lu&ocirc;n cảm thấy an to&agrave;n, thoải m&aacute;i trong suốt h&agrave;nh tr&igrave;nh.</p>\n\n<p>📸 <strong>Gi&uacute;p bạn lưu giữ kỷ niệm đẹp</strong> &ndash; Lu&ocirc;n sẵn l&ograve;ng hỗ trợ chụp ảnh, ghi lại những khoảnh khắc đ&aacute;ng nhớ nhất.</p>\n\n<p>🎉 <strong>Kh&ocirc;ng kh&iacute; vui vẻ, th&acirc;n thiện</strong> &ndash; Mai kh&ocirc;ng chỉ l&agrave; hướng dẫn vi&ecirc;n m&agrave; c&ograve;n l&agrave; <strong>một người bạn đồng h&agrave;nh</strong>, gi&uacute;p chuyến đi trở n&ecirc;n th&uacute; vị v&agrave; đ&aacute;ng nhớ hơn.</p>\n\n<h1>&nbsp;</h1>\n\n<h1>✨ <strong>C&Ugrave;NG MAI &ndash; KH&Aacute;M PH&Aacute; MIỀN TRUNG THEO C&Aacute;CH ĐẶC BIỆT NHẤT!</strong> ✨</h1>\n\n<p>🚀 <strong>Bạn đ&atilde; sẵn s&agrave;ng trải nghiệm những h&agrave;nh tr&igrave;nh đậm chất văn h&oacute;a, lịch sử v&agrave; bản sắc địa phương chưa?</strong><br />\n📌 <strong>H&atilde;y để Mai đồng h&agrave;nh c&ugrave;ng bạn, mang đến những chuyến đi tuyệt vời v&agrave; những kỷ niệm kh&ocirc;ng thể n&agrave;o qu&ecirc;n!</strong> 💫</p>\n', 'mai.touristguide@yahoo.com', 5, 'Trần Thị Mai', '0987654321', 'Nữ'),
('HDV25005', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854853/saoviet/syol07ystigdwqm23qlb.jpg', '1995-08-20', '<h1><strong>😍HO&Agrave;I THƯƠNG &ndash; CHUY&Ecirc;N GIA TOUR KH&Aacute;M PH&Aacute; VIỆT NAM 🍜</strong></h1>\n\n<p>&nbsp; &nbsp; &nbsp;Bạn muốn <strong>kh&ocirc;ng chỉ tham quan</strong> m&agrave; c&ograve;n <strong>hiểu s&acirc;u sắc về văn h&oacute;a, ẩm thực v&agrave; đời sống bản địa</strong> trong mỗi chuyến đi?<br />\nH&atilde;y đồng h&agrave;nh c&ugrave;ng <strong>Ho&agrave;i Thương</strong>, hướng dẫn vi&ecirc;n du lịch <strong>tận t&acirc;m, am hiểu s&acirc;u sắc về văn h&oacute;a Việt Nam</strong>, người sẽ mang đến cho bạn những h&agrave;nh tr&igrave;nh <strong>độc đ&aacute;o v&agrave; đầy cảm x&uacute;c!</strong></p>\n\n<h3>&nbsp;</h3>\n\n<h3>🏛 <strong>Chuy&ecirc;n Gia Tour Văn H&oacute;a &ndash; C&acirc;u Chuyện Đằng Sau Mỗi Điểm Đến</strong></h3>\n\n<p>&nbsp; &nbsp; &nbsp;Với kiến thức s&acirc;u rộng v&agrave; niềm đam m&ecirc; kh&aacute;m ph&aacute;, Ho&agrave;i Thương gi&uacute;p du kh&aacute;ch <strong>kết nối với những gi&aacute; trị truyền thống</strong>, đưa họ v&agrave;o một h&agrave;nh tr&igrave;nh kh&ocirc;ng chỉ nh&igrave;n m&agrave; c&ograve;n <strong>cảm nhận v&agrave; hiểu s&acirc;u</strong> về con người, phong tục tập qu&aacute;n Việt Nam.</p>\n\n<p>📍 <strong>Kh&aacute;m ph&aacute; l&agrave;ng nghề truyền thống</strong> &ndash; Tận mắt chứng kiến c&aacute;ch l&agrave;m gốm B&aacute;t Tr&agrave;ng, tranh Đ&ocirc;ng Hồ, lụa Vạn Ph&uacute;c&hellip;</p>\n\n<p>📍 <strong>Trải nghiệm cuộc sống địa phương</strong> &ndash; Tham gia v&agrave;o <strong>c&aacute;c lễ hội, phong tục cổ truyền</strong> v&agrave; h&ograve;a m&igrave;nh v&agrave;o nhịp sống của từng v&ugrave;ng miền.</p>\n\n<p>📍 <strong>Lịch sử v&agrave; kiến tr&uacute;c độc đ&aacute;o</strong> &ndash; Từ Ho&agrave;ng Th&agrave;nh Thăng Long, cố đ&ocirc; Huế, phố cổ Hội An đến những ng&ocirc;i nh&agrave; rường, đ&igrave;nh l&agrave;ng mang đậm n&eacute;t văn h&oacute;a d&acirc;n gian.</p>\n\n<p>📍 <strong>Tr&ograve; chuyện với người d&acirc;n bản địa</strong> &ndash; Gi&uacute;p du kh&aacute;ch <strong>hiểu r&otilde; hơn về lối sống, tư duy v&agrave; truyền thống của người Việt</strong> qua những c&acirc;u chuyện ch&acirc;n thực v&agrave; th&uacute; vị.</p>\n\n<p>&nbsp;</p>\n\n<h3>&nbsp;</h3>\n\n<h3>🍜 <strong>Trải Nghiệm Ẩm Thực Độc Đ&aacute;o &ndash; H&agrave;nh Tr&igrave;nh Vị Gi&aacute;c</strong></h3>\n\n<p>&nbsp; &nbsp; &nbsp;Kh&ocirc;ng chỉ hướng dẫn, Ho&agrave;i Thương c&ograve;n l&agrave; một <strong>&quot;foodie&quot; ch&iacute;nh hiệu</strong>, lu&ocirc;n sẵn s&agrave;ng dẫn dắt du kh&aacute;ch kh&aacute;m ph&aacute; <strong>những m&oacute;n ăn đặc sản, qu&aacute;n ăn địa phương ngon v&agrave; &iacute;t du kh&aacute;ch biết đến</strong>.</p>\n\n<p>🥢 <strong>Dẫn tour ẩm thực đường phố</strong> &ndash; Thưởng thức những m&oacute;n ngon tại <strong>c&aacute;c qu&aacute;n ăn gia truyền, chợ đ&ecirc;m, khu phố ẩm thực nổi tiếng</strong>.</p>\n\n<p>🔥 <strong>Trải nghiệm nấu ăn c&ugrave;ng người d&acirc;n</strong> &ndash; Học c&aacute;ch l&agrave;m phở, b&aacute;nh x&egrave;o, nem r&aacute;n hay gỏi cuốn từ ch&iacute;nh những người đầu bếp địa phương.</p>\n\n<p>🍷 <strong>Kh&aacute;m ph&aacute; ẩm thực v&ugrave;ng miền</strong> &ndash; Từ <strong>cơm lam T&acirc;y Bắc, b&uacute;n b&ograve; Huế, cao lầu Hội An đến b&aacute;nh canh Nam Bộ</strong>, mỗi m&oacute;n ăn đều gắn liền với một c&acirc;u chuyện văn h&oacute;a th&uacute; vị.</p>\n\n<p>☕ <strong>Thưởng thức c&agrave; ph&ecirc; &amp; đồ uống đặc trưng</strong> &ndash; Từ c&agrave; ph&ecirc; trứng H&agrave; Nội, bia hơi vỉa h&egrave; đến rượu cần T&acirc;y Nguy&ecirc;n &ndash; mỗi hương vị l&agrave; một phần của di sản ẩm thực Việt Nam.</p>\n\n<h3>&nbsp;</h3>\n\n<h3>🎤 <strong>Phong C&aacute;ch Dẫn Tour Cuốn H&uacute;t, H&agrave;i Hước &amp; Dễ Hiểu</strong></h3>\n\n<p>&nbsp; &nbsp; &nbsp;Điều khiến du kh&aacute;ch y&ecirc;u th&iacute;ch v&agrave; nhớ m&atilde;i Ho&agrave;i Thương kh&ocirc;ng chỉ l&agrave; kiến thức s&acirc;u rộng m&agrave; c&ograve;n l&agrave; <strong>c&aacute;ch c&ocirc; dẫn dắt c&acirc;u chuyện</strong> &ndash; <strong>vui vẻ, gần gũi, truyền cảm hứng</strong> v&agrave; kh&ocirc;ng bao giờ nh&agrave;m ch&aacute;n.</p>\n\n<p>🎭 <strong>Kể chuyện sinh động</strong> &ndash; Kh&ocirc;ng chỉ l&agrave; hướng dẫn vi&ecirc;n, c&ocirc; c&ograve;n l&agrave; một <strong>người kể chuyện t&agrave;i ba</strong>, gi&uacute;p lịch sử v&agrave; văn h&oacute;a trở n&ecirc;n dễ hiểu v&agrave; th&uacute; vị hơn.</p>\n\n<p>🤝 <strong>Tạo sự kết nối giữa c&aacute;c du kh&aacute;ch</strong> &ndash; Gi&uacute;p mọi người cảm thấy thoải m&aacute;i, gắn kết v&agrave; c&oacute; th&ecirc;m những người bạn mới trong chuyến đi.</p>\n\n<p>😂 <strong>Pha tr&ograve; duy&ecirc;n d&aacute;ng</strong> &ndash; Với lối n&oacute;i chuyện <strong>h&agrave;i hước, duy&ecirc;n d&aacute;ng</strong>, c&ocirc; lu&ocirc;n mang lại bầu kh&ocirc;ng kh&iacute; vui vẻ v&agrave; thoải m&aacute;i trong mỗi h&agrave;nh tr&igrave;nh.</p>\n\n<h3>&nbsp;</h3>\n\n<h3>💖 <strong>Hướng Dẫn Vi&ecirc;n Tận T&acirc;m &ndash; Người Bạn Đồng H&agrave;nh Đ&aacute;ng Tin Cậy</strong></h3>\n\n<p>&nbsp; &nbsp; &nbsp;Kh&ocirc;ng chỉ đơn thuần l&agrave; người hướng dẫn, Ho&agrave;i Thương lu&ocirc;n quan t&acirc;m đến từng chi tiết nhỏ để đảm bảo <strong>du kh&aacute;ch c&oacute; trải nghiệm tốt nhất</strong>.</p>\n\n<p>✔ <strong>Lu&ocirc;n sẵn s&agrave;ng hỗ trợ</strong> &ndash; Từ tư vấn lịch tr&igrave;nh, địa điểm check-in đẹp đến gi&uacute;p du kh&aacute;ch th&iacute;ch nghi với văn h&oacute;a địa phương.</p>\n\n<p>📸 <strong>Gi&uacute;p bạn lưu giữ những khoảnh khắc đẹp</strong> &ndash; Kh&ocirc;ng chỉ am hiểu địa điểm m&agrave; c&ograve;n biết <strong>g&oacute;c chụp ảnh &quot;sống ảo&quot; l&yacute; tưởng</strong>.</p>\n\n<p>🚀 <strong>Linh hoạt &amp; chuy&ecirc;n nghiệp</strong> &ndash; Lu&ocirc;n c&oacute; phương &aacute;n dự ph&ograve;ng để đảm bảo chuyến đi diễn ra su&ocirc;n sẻ, ngay cả khi c&oacute; thay đổi bất ngờ.</p>\n\n<h1>&nbsp;</h1>\n\n<h1>✨ <strong>KH&Aacute;M PH&Aacute; VIỆT NAM C&Ugrave;NG HO&Agrave;I THƯƠNG &ndash; TRẢI NGHIỆM THẬT, CẢM X&Uacute;C THẬT!</strong> ✨</h1>\n\n<p>🌏 <strong>Bạn đ&atilde; sẵn s&agrave;ng bước v&agrave;o một h&agrave;nh tr&igrave;nh vừa kh&aacute;m ph&aacute;, vừa trải nghiệm v&agrave; cảm nhận văn h&oacute;a bản địa theo c&aacute;ch ch&acirc;n thực nhất chưa?</strong><br />\n📌 <strong>H&atilde;y để Ho&agrave;i Thương đồng h&agrave;nh c&ugrave;ng bạn, mang đến những kỷ niệm kh&oacute; qu&ecirc;n trong mỗi chuyến đi!</strong> 💫</p>\n', 'thuong.culturetours@outlook.com', 5, 'Nguyễn Hoài Thương', '0923456789', 'Nữ'),
('HDV25006', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854922/saoviet/ollydkqr310oxsipzqqb.jpg', '1997-01-10', '<h1><strong>🌍 V&Otilde; DUY ANH &ndash; HƯỚNG DẪN VI&Ecirc;N DU LỊCH QUỐC TẾ &amp; TRONG NƯỚC ✈️</strong></h1>\n\n<p>&nbsp; &nbsp; &nbsp;Với hơn <strong>10 năm kinh nghiệm</strong> trong ng&agrave;nh du lịch, <strong>V&otilde; Duy Anh</strong> kh&ocirc;ng chỉ l&agrave; một hướng dẫn vi&ecirc;n m&agrave; c&ograve;n l&agrave; một <strong>người kể chuyện</strong>, một <strong>người truyền cảm hứng</strong> v&agrave; một <strong>người đồng h&agrave;nh đ&aacute;ng tin cậy</strong> trong mỗi chuyến đi.</p>\n\n<p>Duy Anh sở hữu <strong>kiến thức s&acirc;u rộng về lịch sử, văn h&oacute;a</strong>, khả năng giao tiếp linh hoạt v&agrave; phong c&aacute;ch l&agrave;m việc <strong>chuy&ecirc;n nghiệp, tận t&acirc;m</strong>, lu&ocirc;n mang đến cho du kh&aacute;ch những h&agrave;nh tr&igrave;nh kh&ocirc;ng chỉ th&uacute; vị m&agrave; c&ograve;n <strong>&yacute; nghĩa, đ&aacute;ng nhớ v&agrave; gi&agrave;u cảm x&uacute;c</strong>.</p>\n\n<p>&nbsp;</p>\n\n<h3>🌟 <strong>HƠN 10 NĂM KINH NGHIỆM &ndash; KIẾN THỨC S&Acirc;U RỘNG VỀ DU LỊCH QUỐC TẾ &amp; TRONG NƯỚC</strong></h3>\n\n<p>📍 <strong>Chuy&ecirc;n dẫn tour trong v&agrave; ngo&agrave;i nước</strong> &ndash; Từ những <strong>di sản văn h&oacute;a thế giới tại Việt Nam</strong> đến những <strong>địa danh nổi tiếng quốc tế</strong>.</p>\n\n<p>📍 <strong>Am hiểu lịch sử, văn h&oacute;a, địa l&yacute;</strong> &ndash; Gi&uacute;p du kh&aacute;ch <strong>kh&ocirc;ng chỉ đi m&agrave; c&ograve;n hiểu</strong> về nơi m&igrave;nh đến, từ <strong>c&acirc;u chuyện lịch sử, phong tục tập qu&aacute;n đến ẩm thực đặc trưng</strong>.</p>\n\n<p>📍 <strong>Kinh nghiệm tổ chức tour chuy&ecirc;n nghiệp</strong> &ndash; Linh hoạt trong việc x&acirc;y dựng lịch tr&igrave;nh, đảm bảo <strong>sự kết hợp h&agrave;i h&ograve;a giữa kh&aacute;m ph&aacute;, nghỉ dưỡng v&agrave; trải nghiệm thực tế</strong>.</p>\n\n<p>📍 <strong>Th&agrave;nh thạo ngoại ngữ</strong> &ndash; Giao tiếp tr&ocirc;i chảy với <strong>du kh&aacute;ch quốc tế</strong>, gi&uacute;p họ cảm nhận trọn vẹn vẻ đẹp v&agrave; gi&aacute; trị của từng điểm đến.</p>\n\n<p>&nbsp;</p>\n\n<h3>🎤 <strong>PHONG C&Aacute;CH DẪN DẮT L&Ocirc;I CUỐN, TRUYỀN CẢM HỨNG &amp; TH&Acirc;N THIỆN</strong></h3>\n\n<p>🗣 <strong>Kể chuyện hấp dẫn, dễ hiểu</strong> &ndash; Gi&uacute;p du kh&aacute;ch cảm nhận được <strong>bản sắc địa phương qua từng c&acirc;u chuyện sinh động</strong>.</p>\n\n<p>😄 <strong>Kh&ocirc;ng kh&iacute; vui vẻ, gắn kết đo&agrave;n</strong> &ndash; Với sự duy&ecirc;n d&aacute;ng v&agrave; h&agrave;i hước, Duy Anh lu&ocirc;n biết c&aacute;ch <strong>tạo ra những khoảnh khắc đ&aacute;ng nhớ v&agrave; gi&uacute;p mọi người cảm thấy thoải m&aacute;i như gia đ&igrave;nh</strong>.</p>\n\n<p>👨&zwj;👩&zwj;👧&zwj;👦 <strong>Linh hoạt trong mọi t&igrave;nh huống</strong> &ndash; Xử l&yacute; t&igrave;nh huống chuy&ecirc;n nghiệp, nhanh ch&oacute;ng đảm bảo <strong>chuyến đi lu&ocirc;n diễn ra su&ocirc;n sẻ v&agrave; trọn vẹn</strong>.</p>\n\n<p>📸 <strong>Tư vấn check-in &amp; chụp ảnh đẹp</strong> &ndash; Gi&uacute;p du kh&aacute;ch <strong>t&igrave;m được những g&oacute;c ảnh ho&agrave;n hảo</strong> để lưu giữ kỷ niệm tuyệt vời trong h&agrave;nh tr&igrave;nh.</p>\n\n<p>&nbsp;</p>\n\n<h3>🔥 <strong>LU&Ocirc;N ĐẶT TRẢI NGHIỆM CỦA DU KH&Aacute;CH L&Ecirc;N H&Agrave;NG ĐẦU</strong></h3>\n\n<p>✔ <strong>Hỗ trợ tận t&igrave;nh từ A-Z</strong> &ndash; Lu&ocirc;n sẵn s&agrave;ng gi&uacute;p đỡ du kh&aacute;ch từ <strong>l&ecirc;n lịch tr&igrave;nh, tư vấn điểm đến đến chăm s&oacute;c trong suốt chuyến đi</strong>.</p>\n\n<p>✔ <strong>Tận t&acirc;m, tr&aacute;ch nhiệm &amp; chuy&ecirc;n nghiệp</strong> &ndash; Đảm bảo mỗi chuyến đi kh&ocirc;ng chỉ đơn thuần l&agrave; một cuộc h&agrave;nh tr&igrave;nh m&agrave; c&ograve;n l&agrave; <strong>một trải nghiệm đ&aacute;ng nhớ</strong>.</p>\n\n<p>✔ <strong>Đ&aacute;p ứng đa dạng nhu cầu du lịch</strong> &ndash; Dẫn tour <strong>nghỉ dưỡng, kh&aacute;m ph&aacute;, du lịch mạo hiểm, du lịch t&acirc;m linh, tour doanh nghiệp&hellip;</strong></p>\n\n<h1>&nbsp;</h1>\n\n<h1><strong>🌍 V&Otilde; DUY ANH &ndash; NGƯỜI DẪN ĐƯỜNG CHO NHỮNG CHUYẾN ĐI Đ&Aacute;NG NHỚ!</strong></h1>\n\n<p>📌 <strong>Bạn muốn c&oacute; một chuyến đi kh&ocirc;ng chỉ th&uacute; vị m&agrave; c&ograve;n đầy &yacute; nghĩa?</strong><br />\n🚀 <strong>H&atilde;y để V&otilde; Duy Anh đồng h&agrave;nh c&ugrave;ng bạn tr&ecirc;n những cung đường tuyệt vời!</strong> 🌏✨</p>\n', 'duyanh@gmail.com', 5, 'Võ Duy Anh', '0981234987', 'Nam'),
('HDV25007', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854973/saoviet/hj7a962tpdmxbctahw7k.jpg', '1995-02-15', '<h1><strong>🌟 THU HƯƠNG &ndash; HƯỚNG DẪN VI&Ecirc;N DU LỊCH TRẺ TRUNG, NĂNG ĐỘNG &amp; TH&Acirc;N THIỆN 🎉</strong></h1>\n\n<p>&nbsp;</p>\n\n<p>💛 Với phong c&aacute;ch <strong>trẻ trung, vui vẻ v&agrave; đầy năng lượng</strong>, <strong>Thu Hương</strong> kh&ocirc;ng chỉ l&agrave; một hướng dẫn vi&ecirc;n du lịch m&agrave; c&ograve;n l&agrave; <strong>một người đồng h&agrave;nh th&acirc;n thiện</strong>, gi&uacute;p mỗi chuyến đi trở n&ecirc;n <strong>thoải m&aacute;i, th&uacute; vị v&agrave; tr&agrave;n ngập tiếng cười</strong>.</p>\n\n<p>💡 <strong>Đặc biệt ph&ugrave; hợp với c&aacute;c tour gia đ&igrave;nh, nh&oacute;m bạn v&agrave; trẻ nhỏ</strong>, Hương lu&ocirc;n biết c&aacute;ch tạo kh&ocirc;ng kh&iacute; vui tươi, kết nối mọi người v&agrave; biến chuyến đi th&agrave;nh <strong>những kỷ niệm đ&aacute;ng nhớ cho cả gia đ&igrave;nh</strong>.</p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3>🎈 <strong>TẠI SAO CHỌN THU HƯƠNG L&Agrave;M HƯỚNG DẪN VI&Ecirc;N?</strong></h3>\n\n<p>🎤 <strong>Giao tiếp th&acirc;n thiện, dễ gần</strong> &ndash; Lu&ocirc;n tạo được sự kết nối với du kh&aacute;ch, gi&uacute;p họ cảm thấy <strong>thoải m&aacute;i như đi du lịch c&ugrave;ng một người bạn</strong>.</p>\n\n<p>😄 <strong>Kh&ocirc;ng kh&iacute; vui vẻ, gắn kết đo&agrave;n</strong> &ndash; Dẫn dắt tour với phong c&aacute;ch <strong>h&agrave;i hước, s&ocirc;i động v&agrave; đầy nhiệt huyết</strong>, gi&uacute;p h&agrave;nh tr&igrave;nh <strong>trở n&ecirc;n th&uacute; vị từ đầu đến cuối</strong>.</p>\n\n<p>📚 <strong>Hiểu t&acirc;m l&yacute; trẻ nhỏ &amp; gia đ&igrave;nh</strong> &ndash; Biết c&aacute;ch <strong>tổ chức tr&ograve; chơi, hoạt động tương t&aacute;c</strong>, gi&uacute;p c&aacute;c b&eacute; <strong>vừa vui chơi vừa học hỏi</strong>, mang đến trải nghiệm đ&aacute;ng nhớ cho cả bố mẹ v&agrave; con c&aacute;i.</p>\n\n<p>📸 <strong>Tư vấn check-in &amp; chụp ảnh đẹp</strong> &ndash; Lu&ocirc;n sẵn s&agrave;ng hỗ trợ du kh&aacute;ch t&igrave;m <strong>những g&oacute;c ảnh đẹp</strong> để lưu giữ khoảnh khắc tuyệt vời.</p>\n\n<p>🛠 <strong>Linh hoạt xử l&yacute; t&igrave;nh huống</strong> &ndash; Lu&ocirc;n <strong>chăm s&oacute;c tận t&igrave;nh, hỗ trợ nhanh ch&oacute;ng</strong>, gi&uacute;p chuyến đi diễn ra su&ocirc;n sẻ, thoải m&aacute;i v&agrave; kh&ocirc;ng lo lắng.</p>\n\n<h1>&nbsp;</h1>\n\n<h1>🎉 <strong>H&Atilde;Y ĐỂ THU HƯƠNG BIẾN CHUYẾN ĐI CỦA BẠN TH&Agrave;NH NHỮNG KHOẢNH KHẮC Đ&Aacute;NG NHỚ!</strong></h1>\n\n<p>📌 Nếu bạn muốn một chuyến du lịch <strong>vui vẻ, &yacute; nghĩa &amp; tr&agrave;n ngập kỷ niệm</strong>, h&atilde;y để <strong>Thu Hương đồng h&agrave;nh c&ugrave;ng bạn!</strong> 🚀✨</p>\n', 'huong.familytours@gmail.com', 4, 'Phạm Thu Hương', '0971234567', 'Nữ'),
('HDV25008', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740855045/saoviet/ojwmg00wcb81xnyv0zyh.jpg', '1993-12-11', '<h1><strong>🔥 V&Otilde; THANH TUẤN &ndash; HƯỚNG DẪN VI&Ecirc;N TẬN T&Acirc;M, CHUY&Ecirc;N NGHIỆP &amp; TR&Aacute;CH NHIỆM</strong></h1>\n\n<p>&nbsp;</p>\n\n<p>💼 <strong>V&otilde; Thanh Tuấn</strong> l&agrave; một hướng dẫn vi&ecirc;n du lịch đầy <strong>nhiệt huyết, tr&aacute;ch nhiệm v&agrave; tận t&acirc;m</strong>. Với sự <strong>đam m&ecirc; m&atilde;nh liệt với nghề</strong>, anh lu&ocirc;n mang đến những trải nghiệm <strong>đ&aacute;ng nhớ v&agrave; trọn vẹn</strong> cho du kh&aacute;ch trong mỗi h&agrave;nh tr&igrave;nh.</p>\n\n<p>💡 Kh&ocirc;ng chỉ c&oacute; <strong>kiến thức chuy&ecirc;n s&acirc;u về du lịch</strong>, Tuấn c&ograve;n sở hữu <strong>khả năng l&agrave;m việc nh&oacute;m xuất sắc</strong>, lu&ocirc;n biết c&aacute;ch kết nối v&agrave; tạo kh&ocirc;ng kh&iacute; <strong>th&acirc;n thiện, thoải m&aacute;i</strong> cho mọi người. Ch&iacute;nh điều n&agrave;y gi&uacute;p anh <strong>ghi điểm trong l&ograve;ng du kh&aacute;ch v&agrave; đồng nghiệp</strong>.</p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3>🎯 <strong>L&Yacute; DO N&Ecirc;N CHỌN V&Otilde; THANH TUẤN L&Agrave; NGƯỜI ĐỒNG H&Agrave;NH CỦA BẠN?</strong></h3>\n\n<p>✔ <strong>L&agrave;m việc với tinh thần tr&aacute;ch nhiệm cao</strong> &ndash; Lu&ocirc;n đảm bảo <strong>lịch tr&igrave;nh hợp l&yacute;, an to&agrave;n v&agrave; trải nghiệm tốt nhất</strong> cho du kh&aacute;ch.</p>\n\n<p>✔ <strong>Phong c&aacute;ch chuy&ecirc;n nghiệp, tận t&acirc;m</strong> &ndash; Sẵn s&agrave;ng hỗ trợ du kh&aacute;ch trong mọi t&igrave;nh huống, gi&uacute;p họ cảm thấy <strong>thoải m&aacute;i v&agrave; an t&acirc;m</strong> trong suốt h&agrave;nh tr&igrave;nh.</p>\n\n<p>✔ <strong>Kỹ năng l&agrave;m việc nh&oacute;m xuất sắc</strong> &ndash; Khả năng kết nối, phối hợp với đo&agrave;n v&agrave; tạo kh&ocirc;ng kh&iacute; <strong>vui vẻ, h&agrave;i h&ograve;a</strong>.</p>\n\n<p>✔ <strong>Giao tiếp th&acirc;n thiện &amp; linh hoạt</strong> &ndash; Biết c&aacute;ch <strong>lắng nghe, chia sẻ</strong> v&agrave; mang lại những ph&uacute;t gi&acirc;y <strong>thoải m&aacute;i, &yacute; nghĩa</strong> cho du kh&aacute;ch.</p>\n\n<p>✔ <strong>Am hiểu về văn h&oacute;a, lịch sử &amp; địa danh</strong> &ndash; Kh&ocirc;ng chỉ dẫn đo&agrave;n m&agrave; c&ograve;n l&agrave; <strong>người kể chuyện</strong>, gi&uacute;p du kh&aacute;ch <strong>hiểu s&acirc;u sắc hơn về từng điểm đến</strong>.</p>\n\n<p>&nbsp;</p>\n\n<h1>&nbsp;</h1>\n\n<h1>🌍 <strong>V&Otilde; THANH TUẤN &ndash; NGƯỜI ĐỒNG H&Agrave;NH L&Yacute; TƯỞNG TR&Ecirc;N MỌI H&Agrave;NH TR&Igrave;NH!</strong></h1>\n\n<p>📌 Bạn muốn c&oacute; một chuyến đi <strong>thoải m&aacute;i, &yacute; nghĩa v&agrave; đầy ắp kỷ niệm</strong>?<br />\n🚀 H&atilde;y để <strong>V&otilde; Thanh Tuấn</strong> đồng h&agrave;nh c&ugrave;ng bạn tr&ecirc;n mọi nẻo đường! ✨</p>\n', 'thanhtuan15@gmail.com', 5, 'Võ Thanh Tuấn', '0351815687', 'Nam'),
('HDV25009', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740855096/saoviet/fcolll2kksbato9oukbn.jpg', '1994-03-18', '<h1><strong>🏛 ANH DŨNG &ndash; HƯỚNG DẪN VI&Ecirc;N DU LỊCH CHUY&Ecirc;N S&Acirc;U VỀ LỊCH SỬ 🏰</strong></h1>\n\n<p>&nbsp;</p>\n\n<p>📜 <strong>Anh Dũng</strong> l&agrave; một hướng dẫn vi&ecirc;n đầy <strong>t&acirc;m huyết v&agrave; am hiểu s&acirc;u sắc</strong> về lịch sử Việt Nam. Với niềm đam m&ecirc; đặc biệt d&agrave;nh cho <strong>c&aacute;c bảo t&agrave;ng, di t&iacute;ch lịch sử v&agrave; những c&acirc;u chuyện h&agrave;o h&ugrave;ng</strong>, anh chuy&ecirc;n dẫn dắt <strong>c&aacute;c tour tham quan tại H&agrave; Nội, Huế v&agrave; TP.HCM</strong>, gi&uacute;p du kh&aacute;ch kh&ocirc;ng chỉ nh&igrave;n ngắm m&agrave; c&ograve;n <strong>cảm nhận được linh hồn của từng địa danh</strong>.</p>\n\n<p>💡 <strong>Điểm mạnh của Anh Dũng ch&iacute;nh l&agrave; khả năng kể chuyện l&ocirc;i cuốn</strong>, biến những sự kiện lịch sử kh&ocirc; khan th&agrave;nh <strong>những c&acirc;u chuyện sống động, th&uacute; vị v&agrave; dễ hiểu</strong>, gi&uacute;p du kh&aacute;ch c&oacute; được <strong>c&aacute;i nh&igrave;n s&acirc;u sắc về lịch sử v&agrave; văn h&oacute;a Việt Nam</strong>.</p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3>🎯 <strong>TẠI SAO ANH DŨNG L&Agrave; HƯỚNG DẪN VI&Ecirc;N L&Yacute; TƯỞNG CHO C&Aacute;C TOUR LỊCH SỬ?</strong></h3>\n\n<p>🏛 <strong>Kiến thức lịch sử uy&ecirc;n th&acirc;m</strong> &ndash; Am hiểu chi tiết về <strong>c&aacute;c thời kỳ lịch sử, nh&acirc;n vật nổi tiếng v&agrave; sự kiện quan trọng</strong> của Việt Nam.</p>\n\n<p>🎤 <strong>Khả năng kể chuyện hấp dẫn</strong> &ndash; Kh&ocirc;ng đơn thuần l&agrave; một hướng dẫn vi&ecirc;n, Anh Dũng <strong>khiến lịch sử trở n&ecirc;n sống động</strong>, gi&uacute;p du kh&aacute;ch <strong>h&igrave;nh dung r&otilde; n&eacute;t về từng giai đoạn ph&aacute;t triển của đất nước</strong>.</p>\n\n<p>📌 <strong>Dẫn dắt tour chuy&ecirc;n s&acirc;u tại c&aacute;c di t&iacute;ch nổi bật</strong> &ndash; C&aacute;c điểm đến như <strong>Ho&agrave;ng th&agrave;nh Thăng Long, Bảo t&agrave;ng Lịch sử Quốc gia, Cố đ&ocirc; Huế, Dinh Độc Lập</strong>,... trở th&agrave;nh <strong>b&agrave;i học lịch sử thực tế</strong> đầy th&uacute; vị.</p>\n\n<p>🤝 <strong>Giao tiếp th&acirc;n thiện, dễ hiểu</strong> &ndash; Lu&ocirc;n cởi mở, sẵn s&agrave;ng giải đ&aacute;p mọi thắc mắc, gi&uacute;p du kh&aacute;ch <strong>hiểu s&acirc;u hơn về bối cảnh lịch sử của từng địa danh</strong>.</p>\n\n<p>📸 <strong>Hướng dẫn check-in &amp; chia sẻ g&oacute;c chụp đẹp</strong> &ndash; Gi&uacute;p du kh&aacute;ch c&oacute; những bức ảnh <strong>đầy &yacute; nghĩa tại c&aacute;c địa điểm mang đậm dấu ấn lịch sử</strong>.</p>\n\n<h1>&nbsp;</h1>\n\n<h1><strong>🚀 C&Ugrave;NG ANH DŨNG KH&Aacute;M PH&Aacute; LỊCH SỬ VIỆT NAM MỘT C&Aacute;CH ĐẦY TH&Uacute; VỊ!</strong></h1>\n\n<p>📌 Nếu bạn muốn một h&agrave;nh tr&igrave;nh <strong>kh&ocirc;ng chỉ tham quan m&agrave; c&ograve;n đắm ch&igrave;m trong những c&acirc;u chuyện lịch sử gi&agrave;u cảm x&uacute;c</strong>, h&atilde;y đồng h&agrave;nh c&ugrave;ng <strong>Anh Dũng</strong>! 💫</p>\n', 'dung.historytours@gmail.com', 4, 'Võ Anh Dũng', '0967890123', 'Nam'),
('HDV25010', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740855141/saoviet/z8iz5dqbdmyvther0ibk.jpg', '2000-12-31', '<h1><strong>🌟 NGUYỄN HO&Agrave;NG ANH &ndash; HƯỚNG DẪN VI&Ecirc;N NĂNG ĐỘNG &amp; S&Aacute;NG TẠO 🎉</strong></h1>\n\n<p>&nbsp;</p>\n\n<p>✨ <strong>Nguyễn Ho&agrave;ng Anh</strong> l&agrave; một hướng dẫn vi&ecirc;n <strong>tr&agrave;n đầy năng lượng, s&aacute;ng tạo v&agrave; tận t&acirc;m</strong>. Với phong c&aacute;ch l&agrave;m việc <strong>chuy&ecirc;n nghiệp, linh hoạt v&agrave; lu&ocirc;n đổi mới</strong>, anh kh&ocirc;ng ngừng t&igrave;m kiếm những c&aacute;ch <strong>mang đến trải nghiệm mới lạ v&agrave; th&uacute; vị nhất</strong> cho du kh&aacute;ch trong mỗi h&agrave;nh tr&igrave;nh.</p>\n\n<p>💡 Với khả năng <strong>giao tiếp xuất sắc v&agrave; sự am hiểu s&acirc;u rộng</strong> về c&aacute;c điểm du lịch trong v&agrave; ngo&agrave;i nước, Ho&agrave;ng Anh kh&ocirc;ng chỉ l&agrave; người dẫn đường m&agrave; c&ograve;n l&agrave; <strong>người kể chuyện</strong>, gi&uacute;p du kh&aacute;ch <strong>kh&aacute;m ph&aacute; v&agrave; cảm nhận trọn vẹn vẻ đẹp của mỗi điểm đến</strong>. Ch&iacute;nh v&igrave; thế, anh lu&ocirc;n nhận được <strong>sự tin tưởng v&agrave; y&ecirc;u mến từ kh&aacute;ch h&agrave;ng</strong>.</p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3>🎯 <strong>V&Igrave; SAO CHỌN NGUYỄN HO&Agrave;NG ANH L&Agrave; NGƯỜI ĐỒNG H&Agrave;NH?</strong></h3>\n\n<p>🚀 <strong>Lu&ocirc;n s&aacute;ng tạo v&agrave; đổi mới</strong> &ndash; Kh&ocirc;ng đi theo lối m&ograve;n, anh lu&ocirc;n cập nhật <strong>những xu hướng du lịch mới nhất</strong>, mang đến <strong>những trải nghiệm kh&aacute;c biệt v&agrave; đ&aacute;ng nhớ</strong>.</p>\n\n<p>🎤 <strong>Giao tiếp l&ocirc;i cuốn, gần gũi</strong> &ndash; Với sự <strong>th&acirc;n thiện v&agrave; hoạt ng&ocirc;n</strong>, Ho&agrave;ng Anh lu&ocirc;n tạo kh&ocirc;ng kh&iacute; <strong>vui vẻ, h&agrave;i hước</strong>, gi&uacute;p chuyến đi trở n&ecirc;n <strong>th&uacute; vị từ đầu đến cuối</strong>.</p>\n\n<p>🌍 <strong>Am hiểu s&acirc;u rộng về c&aacute;c điểm đến</strong> &ndash; Từ những danh lam thắng cảnh nổi tiếng đến <strong>c&aacute;c điểm du lịch &iacute;t người biết nhưng đầy th&uacute; vị</strong>, anh đều c&oacute; thể <strong>chia sẻ những c&acirc;u chuyện độc đ&aacute;o</strong>.</p>\n\n<p>📸 <strong>Hỗ trợ chụp ảnh &amp; check-in đẹp</strong> &ndash; Lu&ocirc;n sẵn s&agrave;ng tư vấn <strong>những g&oacute;c chụp ấn tượng</strong>, gi&uacute;p du kh&aacute;ch lưu giữ <strong>những khoảnh khắc tuyệt vời nhất</strong>.</p>\n\n<p>🤝 <strong>Tận t&acirc;m &amp; chuy&ecirc;n nghiệp</strong> &ndash; Lu&ocirc;n đặt sự <strong>h&agrave;i l&ograve;ng của kh&aacute;ch h&agrave;ng l&ecirc;n h&agrave;ng đầu</strong>, sẵn s&agrave;ng hỗ trợ v&agrave; giải quyết mọi vấn đề một c&aacute;ch linh hoạt, gi&uacute;p du kh&aacute;ch <strong>c&oacute; trải nghiệm thoải m&aacute;i v&agrave; an to&agrave;n</strong>.</p>\n\n<h1>&nbsp;</h1>\n\n<h1><strong>🔥 C&Ugrave;NG NGUYỄN HO&Agrave;NG ANH KH&Aacute;M PH&Aacute; NHỮNG H&Agrave;NH TR&Igrave;NH ĐỘC Đ&Aacute;O &amp; Đ&Aacute;NG NHỚ! 🚀</strong></h1>\n\n<p>📌 Nếu bạn muốn chuyến du lịch của m&igrave;nh <strong>kh&ocirc;ng chỉ l&agrave; một chuyến đi m&agrave; c&ograve;n l&agrave; một h&agrave;nh tr&igrave;nh trải nghiệm đầy mới mẻ</strong>, h&atilde;y để <strong>Nguyễn Ho&agrave;ng Anh đồng h&agrave;nh c&ugrave;ng bạn!</strong> ✨</p>\n', 'hoanganh@gmail.com', 3, 'Nguyễn Hoàng Anh', '0967890123', 'Nam'),
('HDV25011', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740855311/saoviet/lx058pzrwopk6rxjqvxp.jpg', '1999-03-12', '<h1><strong>🏔 H&Ugrave;NG &ndash; CHUY&Ecirc;N GIA DẪN TOUR KH&Aacute;M PH&Aacute; T&Acirc;Y BẮC 🏕</strong></h1>\n\n<p>&nbsp;</p>\n\n<p>🌄 <strong>Với hơn 10 năm kinh nghiệm</strong> trong việc <strong>tổ chức v&agrave; dẫn dắt c&aacute;c tour kh&aacute;m ph&aacute; v&ugrave;ng n&uacute;i ph&iacute;a Bắc Việt Nam</strong>, đặc biệt l&agrave; <strong>T&acirc;y Bắc</strong>, H&ugrave;ng l&agrave; một hướng dẫn vi&ecirc;n <strong>tận t&acirc;m, am hiểu s&acirc;u sắc về thi&ecirc;n nhi&ecirc;n v&agrave; văn h&oacute;a bản địa</strong>.</p>\n\n<p>⛰ <strong>T&acirc;y Bắc kh&ocirc;ng chỉ l&agrave; một điểm đến</strong>, m&agrave; c&ograve;n l&agrave; nơi lưu giữ <strong>những gi&aacute; trị văn h&oacute;a đặc sắc của c&aacute;c d&acirc;n tộc thiểu số</strong>. Với <strong>kiến thức phong ph&uacute; v&agrave; sự trải nghiệm thực tế</strong>, H&ugrave;ng kh&ocirc;ng chỉ đưa du kh&aacute;ch <strong>đến với cảnh quan h&ugrave;ng vĩ</strong> m&agrave; c&ograve;n gi&uacute;p họ <strong>hiểu s&acirc;u hơn về đời sống, phong tục v&agrave; tập qu&aacute;n của đồng b&agrave;o v&ugrave;ng cao</strong>.</p>\n\n<p>🚵&zwj;♂️ <strong>Dẫn dắt nhiều h&agrave;nh tr&igrave;nh trekking, leo n&uacute;i, kh&aacute;m ph&aacute; bản l&agrave;ng</strong> tại c&aacute;c địa danh nổi tiếng như <strong>M&ugrave; Cang Chải, Sapa, H&agrave; Giang, P&ugrave; Lu&ocirc;ng, Mộc Ch&acirc;u</strong>,... H&ugrave;ng <strong>kh&ocirc;ng chỉ l&agrave; người hướng dẫn</strong> m&agrave; c&ograve;n l&agrave; <strong>người bạn đồng h&agrave;nh đ&aacute;ng tin cậy</strong>, lu&ocirc;n mang đến <strong>cảm gi&aacute;c an to&agrave;n v&agrave; sự h&agrave;i l&ograve;ng</strong> cho du kh&aacute;ch.</p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3>🎯 <strong>V&Igrave; SAO N&Ecirc;N ĐỒNG H&Agrave;NH C&Ugrave;NG H&Ugrave;NG?</strong></h3>\n\n<p>🏔 <strong>Chuy&ecirc;n gia trekking &amp; kh&aacute;m ph&aacute; thi&ecirc;n nhi&ecirc;n</strong> &ndash; Hỗ trợ du kh&aacute;ch <strong>từ người mới bắt đầu đến những người đam m&ecirc; chinh phục n&uacute;i rừng</strong>.</p>\n\n<p>🎭 <strong>Am hiểu s&acirc;u sắc văn h&oacute;a d&acirc;n tộc thiểu số</strong> &ndash; Cung cấp <strong>c&acirc;u chuyện th&uacute; vị về phong tục, tập qu&aacute;n, ẩm thực v&agrave; lễ hội của người H&rsquo;M&ocirc;ng, Dao, Th&aacute;i, T&agrave;y...</strong></p>\n\n<p>🏕 <strong>Dẫn dắt c&aacute;c tour trải nghiệm thực tế</strong> &ndash; Nghỉ đ&ecirc;m tại homestay, tham gia <strong>c&aacute;c hoạt động n&ocirc;ng nghiệp v&agrave; sinh hoạt c&ugrave;ng người d&acirc;n bản địa</strong>.</p>\n\n<p>📍 <strong>Hướng dẫn tận t&igrave;nh, an to&agrave;n tuyệt đối</strong> &ndash; Lu&ocirc;n đặt <strong>sự an to&agrave;n v&agrave; trải nghiệm của kh&aacute;ch l&ecirc;n h&agrave;ng đầu</strong>, đảm bảo h&agrave;nh tr&igrave;nh diễn ra <strong>su&ocirc;n sẻ v&agrave; đ&aacute;ng nhớ</strong>.</p>\n\n<p>📸 <strong>Chia sẻ g&oacute;c check-in đẹp nhất</strong> &ndash; Hỗ trợ du kh&aacute;ch lưu lại <strong>những khoảnh khắc tuyệt vời giữa n&uacute;i rừng hoang sơ</strong>.</p>\n\n<p>&nbsp;</p>\n\n<h1><strong>🔥 C&Ugrave;NG H&Ugrave;NG CHINH PHỤC T&Acirc;Y BẮC &ndash; KH&Aacute;M PH&Aacute; THI&Ecirc;N NHI&Ecirc;N &amp; VĂN H&Oacute;A ĐỘC Đ&Aacute;O! 🚀</strong></h1>\n\n<p>📌 Nếu bạn muốn c&oacute; <strong>một h&agrave;nh tr&igrave;nh đ&aacute;ng nhớ giữa n&uacute;i rừng T&acirc;y Bắc</strong>, h&atilde;y để <strong>H&ugrave;ng dẫn đường v&agrave; đồng h&agrave;nh c&ugrave;ng bạn!</strong> 🌿💫</p>\n', 'hung.travelguide@gmail.com', 3, 'Nguyễn Văn Hùng', '0912345678', 'Nam');

