INSERT INTO `tour` (`id`, `category_id`, `description`, `image`, `introduce`, `name`, `price`, `time_created`, `orders`) VALUES
('T25001', 2, '<p>&nbsp;</p>\n\n<h1><strong>📍 TOUR THAM QUAN L&Agrave;NG VĂN H&Oacute;A C&Aacute;C D&Acirc;N TỘC VIỆT NAM &ndash; ĐỒNG M&Ocirc;</strong></h1>\n\n<p>⏳ <strong>Thời gian:</strong> 1 ng&agrave;y | 🚍 <strong>Phương tiện:</strong> &Ocirc; t&ocirc; | 👥 <strong>Đối tượng:</strong> Đo&agrave;n kh&aacute;ch, c&ocirc;ng ty, trường học</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h2><strong>📅 CHI TIẾT LỊCH TR&Igrave;NH</strong></h2>\n\n<h3><strong>🔹 07h00: Đ&oacute;n kh&aacute;ch &ndash; Khởi h&agrave;nh chuyến tham quan</strong></h3>\n\n<ul>\n	<li>Xe v&agrave; hướng dẫn vi&ecirc;n <strong>đ&oacute;n qu&yacute; kh&aacute;ch tại điểm hẹn</strong>, kiểm tra qu&acirc;n số v&agrave; ổn định chỗ ngồi.</li>\n	<li>Đo&agrave;n khởi h&agrave;nh đi <strong>Khu du lịch L&agrave;ng Văn H&oacute;a C&aacute;c D&acirc;n Tộc Việt Nam &ndash; Đồng M&ocirc;</strong>.</li>\n	<li>Tr&ecirc;n xe, hướng dẫn vi&ecirc;n <strong>giới thiệu về điểm đến</strong>, tổ chức c&aacute;c hoạt động giao lưu vui nhộn gi&uacute;p qu&yacute; kh&aacute;ch khởi động ng&agrave;y mới đầy hứng khởi.</li>\n</ul>\n\n<h3><strong>🔹 08h00: Tham quan L&agrave;ng Văn H&oacute;a C&aacute;c D&acirc;n Tộc Việt Nam</strong></h3>\n\n<ul>\n	<li>Đến nơi, qu&yacute; kh&aacute;ch sẽ kh&aacute;m ph&aacute; <strong>quần thể văn h&oacute;a rộng lớn</strong>, nơi t&aacute;i hiện sinh động đời sống v&agrave; kiến tr&uacute;c <strong>54 d&acirc;n tộc anh em</strong> của Việt Nam.</li>\n	<li>C&aacute;c điểm tham quan nổi bật:<br />\n	✅ <strong>Khu nh&agrave; s&agrave;n, nh&agrave; r&ocirc;ng, nh&agrave; d&agrave;i</strong> &ndash; Trải nghiệm kh&ocirc;ng gian sinh hoạt đặc trưng của c&aacute;c d&acirc;n tộc T&acirc;y Nguy&ecirc;n, Th&aacute;i, T&agrave;y...<br />\n	✅ <strong>C&aacute;c nghi lễ truyền thống</strong> &ndash; T&igrave;m hiểu c&aacute;c phong tục cưới hỏi, ma chay, lễ hội đặc sắc.<br />\n	✅ <strong>Giao lưu văn h&oacute;a</strong> &ndash; Chụp ảnh c&ugrave;ng trang phục truyền thống, thưởng thức biểu diễn nghệ thuật d&acirc;n gian.</li>\n</ul>\n\n<p>📷 <em>Gợi &yacute; check-in:</em> Nh&agrave; r&ocirc;ng T&acirc;y Nguy&ecirc;n, hồ Đồng M&ocirc;, cổng ch&agrave;o l&agrave;ng văn h&oacute;a.</p>\n\n<p><img alt=\"Image result for Làng Văn Hóa Các Dân Tộc Việt Nam Đồng Mô\" src=\"https://th.bing.com/th/id/OIP.ozWaDUlAGz4m61TVAQkTtgHaFj?w=237&amp;h=180&amp;c=7&amp;r=0&amp;o=5&amp;dpr=1.3&amp;pid=1.7\" style=\"height:380px; width:500px\" /></p>\n\n<h3><strong>🔹 11h00: Thưởng thức ẩm thực địa phương</strong></h3>\n\n<ul>\n	<li>Qu&yacute; kh&aacute;ch d&ugrave;ng bữa trưa tại nh&agrave; h&agrave;ng với <strong>c&aacute;c m&oacute;n đặc sản v&ugrave;ng miền</strong>, mang đậm hương vị truyền thống.</li>\n	<li>Một số m&oacute;n ăn ti&ecirc;u biểu c&oacute; thể bao gồm:<br />\n	🍽 G&agrave; nướng l&aacute; mắc mật<br />\n	🍽 Lợn m&aacute;n nướng/ hấp<br />\n	🍽 Cơm lam T&acirc;y Bắc<br />\n	🍽 Nộm hoa chuối rừng<br />\n	🍽 Canh chua c&aacute; lăng s&ocirc;ng Đ&agrave;</li>\n</ul>\n\n<h3><strong>🔹 14h00: Team Building &ndash; Gắn kết đồng đội</strong> <em>(&Aacute;p dụng cho đo&agrave;n từ 40 kh&aacute;ch trở l&ecirc;n)</em></h3>\n\n<ul>\n	<li>Tham gia chương tr&igrave;nh <strong>Team Building chuy&ecirc;n nghiệp</strong>, với c&aacute;c tr&ograve; chơi tập thể s&ocirc;i động, gi&uacute;p tăng cường sự gắn kết giữa c&aacute;c th&agrave;nh vi&ecirc;n.</li>\n	<li><strong>Chủ đề &amp; kịch bản chương tr&igrave;nh</strong> sẽ được điều chỉnh ph&ugrave; hợp theo y&ecirc;u cầu đo&agrave;n kh&aacute;ch.</li>\n	<li>Hoạt động nổi bật:<br />\n	🎯 Tr&ograve; chơi teamwork: K&eacute;o co, dẫn nước về nguồn, đua thuyền tr&ecirc;n cạn,...<br />\n	🎯 Nhảy d&acirc;n vũ s&ocirc;i động<br />\n	🎯 Thử th&aacute;ch &ldquo;Chinh phục văn h&oacute;a d&acirc;n gian&rdquo;</li>\n</ul>\n\n<p><img alt=\"Image result for Team Building ngoài trời\" src=\"https://th.bing.com/th/id/OIP.1aUKLWYSmOYyBN8ckZ20rgHaE8?w=269&amp;h=180&amp;c=7&amp;r=0&amp;o=5&amp;dpr=1.3&amp;pid=1.7\" style=\"height:335px; width:500px\" /></p>\n\n<h3><strong>🔹 16h00: Khởi h&agrave;nh về H&agrave; Nội &ndash; Dừng ch&acirc;n mua sắm đặc sản</strong></h3>\n\n<ul>\n	<li>Qu&yacute; kh&aacute;ch <strong>tự do tham quan v&agrave; mua sắm</strong> đặc sản địa phương tại c&aacute;c điểm dừng ch&acirc;n.</li>\n	<li>Gợi &yacute; mua qu&agrave; về cho gia đ&igrave;nh:<br />\n	🥛 <strong>Sữa d&ecirc; Ba V&igrave;</strong> &ndash; Đặc sản nổi tiếng của v&ugrave;ng Ba V&igrave;.<br />\n	🎂 <strong>B&aacute;nh sữa Ba V&igrave;</strong> &ndash; Thơm ngon, b&eacute;o ngậy, th&iacute;ch hợp l&agrave;m qu&agrave; biếu.</li>\n</ul>\n\n<h3><strong>🔹 17h30: Kết th&uacute;c h&agrave;nh tr&igrave;nh &ndash; Chia tay v&agrave; hẹn gặp lại</strong></h3>\n\n<ul>\n	<li>Xe đưa qu&yacute; kh&aacute;ch về lại điểm đ&oacute;n ban đầu tại H&agrave; Nội.</li>\n	<li>Hướng dẫn vi&ecirc;n <strong>gửi lời cảm ơn</strong>, tạm biệt v&agrave; hẹn gặp lại qu&yacute; kh&aacute;ch trong c&aacute;c chương tr&igrave;nh tiếp theo.</li>\n</ul>\n\n<hr />\n<h2>&nbsp;</h2>\n\n<h2><strong>💼 DỊCH VỤ BAO GỒM:</strong></h2>\n\n<p>✅ Xe du lịch đời mới, điều h&ograve;a, đưa đ&oacute;n theo chương tr&igrave;nh.<br />\n✅ Hướng dẫn vi&ecirc;n chuy&ecirc;n nghiệp, nhiệt t&igrave;nh.<br />\n✅ V&eacute; tham quan L&agrave;ng Văn H&oacute;a C&aacute;c D&acirc;n Tộc Việt Nam.<br />\n✅ Chương tr&igrave;nh Team Building (nếu c&oacute;).<br />\n✅ 01 bữa ăn trưa theo chương tr&igrave;nh.<br />\n✅ Bảo hiểm du lịch.<br />\n✅ Nước uống ti&ecirc;u chuẩn tr&ecirc;n xe.</p>\n\n<h2><strong>🚫 DỊCH VỤ KH&Ocirc;NG BAO GỒM:</strong></h2>\n\n<p>❌ Chi ph&iacute; c&aacute; nh&acirc;n ngo&agrave;i chương tr&igrave;nh.<br />\n❌ Đồ uống trong bữa ăn.<br />\n❌ Thuế VAT (nếu c&oacute; nhu cầu xuất h&oacute;a đơn).</p>\n\n<hr />\n<p>&nbsp;</p>\n\n<p>📍 <strong>🔔 ĐẶT TOUR NGAY H&Ocirc;M NAY!</strong><br />\n📞 Hotline: <strong>0399 999 999</strong> | 📩 Email: <strong><a href=\"mailto:booking@dulichtaybac.com\">booking@saoviet.com</a></strong></p>\n\n<p>🎯 <strong>L&agrave;ng Văn H&oacute;a C&aacute;c D&acirc;n Tộc &ndash; Nơi hội tụ bản sắc Việt Nam!</strong> 🚀🌿</p>\n', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740853584/saoviet/awvf8iefn2wvldkbhuxv.webp', '<p>&nbsp; &nbsp; &nbsp;Đất nước Việt Nam ta lu&ocirc;n tự h&agrave;o l&agrave; một quốc gia với bản sắc d&acirc;n tộc phong ph&uacute;, đa dạng l&agrave; nơi chung sống của 54 d&acirc;n tộc với những đặc trưng ri&ecirc;ng, c&ugrave;ng nhau tạo n&ecirc;n một bức tranh đa sắc m&agrave;u về truyền thống, văn h&oacute;a của d&acirc;n tộc. Để lưu giữ bản sắc ấy, <em><strong>L&agrave;ng văn h&oacute;a du lịch c&aacute;c d&acirc;n tộc Việt Nam</strong></em> được x&acirc;y dựng quy m&ocirc;, ho&agrave;nh tr&aacute;ng, c&ugrave;ng với đ&oacute; l&agrave; kh&ocirc;ng gian rộng r&atilde;i, tho&aacute;ng m&aacute;t đ&atilde; trở th&agrave;nh điểm tham quan du lịch thu h&uacute;t được lượng lớn du kh&aacute;ch.</p>\n', 'Tour làng Văn Hóa Các Dân Tộc Việt Nam', 750000, '2025-03-02 03:31:00.899121', 8);
INSERT INTO `tour` (`id`, `category_id`, `description`, `image`, `introduce`, `name`, `price`, `time_created`, `orders`) VALUES
('T25002', 2, '<h1><strong>Tour Ninh B&igrave;nh &ndash; Tr&agrave;ng An &amp; Ch&ugrave;a B&aacute;i Đ&iacute;nh</strong></h1>\n\n<p>⏳ <strong>Thời gian:</strong> 1 ng&agrave;y<br />\n📍 <strong>Điểm đến:</strong> Tr&agrave;ng An &ndash; Ch&ugrave;a B&aacute;i Đ&iacute;nh &ndash; Đặc sản Ninh B&igrave;nh<br />\n🚐 <strong>Khởi h&agrave;nh:</strong> H&agrave; Nội</p>\n\n<h2>&nbsp;</h2>\n\n<h2><strong>✨ LỊCH TR&Igrave;NH CHI TIẾT ✨</strong></h2>\n\n<h3><strong>🚗 07h00 | Khởi h&agrave;nh từ H&agrave; Nội</strong></h3>\n\n<p>Xe v&agrave; hướng dẫn vi&ecirc;n <strong>đ&oacute;n qu&yacute; kh&aacute;ch tại điểm hẹn</strong>. Sau khi điểm danh đo&agrave;n, xe khởi h&agrave;nh đi <strong>Ninh B&igrave;nh</strong> &ndash; v&ugrave;ng đất <strong>Cố đ&ocirc; Hoa Lư</strong> với bề d&agrave;y lịch sử hơn <strong>1.000 năm</strong> v&agrave; cảnh quan thi&ecirc;n nhi&ecirc;n h&ugrave;ng vĩ.<br />\nTr&ecirc;n xe, hướng dẫn vi&ecirc;n sẽ <strong>thuyết minh về h&agrave;nh tr&igrave;nh</strong>, chia sẻ những c&acirc;u chuyện th&uacute; vị về lịch sử &ndash; văn h&oacute;a &ndash; con người Ninh B&igrave;nh, đồng thời tổ chức <strong>c&aacute;c tr&ograve; chơi giao lưu</strong> gi&uacute;p kh&ocirc;ng kh&iacute; tr&ecirc;n xe th&ecirc;m s&ocirc;i động.</p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>⛵ 09h00 | Kh&aacute;m ph&aacute; Tr&agrave;ng An &ndash; &ldquo;Vịnh Hạ Long tr&ecirc;n cạn&rdquo;</strong></h3>\n\n<p>Qu&yacute; kh&aacute;ch đến <strong>Khu du lịch sinh th&aacute;i Tr&agrave;ng An</strong>, di sản thế giới được UNESCO c&ocirc;ng nhận. Tại đ&acirc;y, qu&yacute; kh&aacute;ch sẽ:<br />\n✅ <strong>Ngồi thuyền</strong> xu&ocirc;i theo d&ograve;ng <strong>s&ocirc;ng S&agrave;o Kh&ecirc;</strong> hiền h&ograve;a, len lỏi qua những d&atilde;y n&uacute;i đ&aacute; v&ocirc;i h&ugrave;ng vĩ.<br />\n✅ <strong>Chi&ecirc;m ngưỡng hệ thống hang động độc đ&aacute;o</strong> như <strong>Hang Địa Linh, Hang Tối, Hang S&aacute;ng, Hang Nấu Rượu</strong>&hellip; mỗi hang động mang một vẻ đẹp huyền b&iacute;, kỳ vĩ.<br />\n✅ <strong>Tham quan đền Trần</strong> &ndash; nơi thờ vị tướng Trần Qu&yacute; Minh, vị thần bảo hộ v&ugrave;ng đất Tr&agrave;ng An.<br />\n✅ <strong>Check-in giữa thi&ecirc;n nhi&ecirc;n thơ mộng</strong>, h&ograve;a m&igrave;nh v&agrave;o bức tranh sơn thủy hữu t&igrave;nh của Tr&agrave;ng An.</p>\n\n<p><img alt=\"Image result for  TRANG AN\" src=\"data:image/jpeg;base64,\" style=\"height:298px; width:500px\" /></p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>🍽 11h30 | Thưởng thức đặc sản Ninh B&igrave;nh</strong></h3>\n\n<p>Qu&yacute; kh&aacute;ch di chuyển đến nh&agrave; h&agrave;ng, thưởng thức <strong>bữa trưa với những m&oacute;n ăn đặc sản đậm đ&agrave; hương vị v&ugrave;ng đất Cố đ&ocirc;</strong>:<br />\n🍖 <strong>D&ecirc; n&uacute;i t&aacute;i chanh, d&ecirc; nướng, lẩu d&ecirc;</strong> &ndash; m&oacute;n đặc sản trứ danh của Ninh B&igrave;nh.<br />\n🍚 <strong>Cơm ch&aacute;y gi&ograve;n rụm</strong> ăn k&egrave;m sốt chấm đặc biệt.<br />\n🥦 <strong>Canh rau rừng, nem Y&ecirc;n Mạc, rượu Kim Sơn</strong>&hellip;</p>\n\n<p>🎵 Sau bữa trưa, qu&yacute; kh&aacute;ch nghỉ ngơi thư gi&atilde;n trước khi tiếp tục h&agrave;nh tr&igrave;nh.</p>\n\n<p><img alt=\"Image result for  Bàn ăn không gian nhà hàng ấm cúng \" src=\"https://th.bing.com/th/id/OIP.3-NsLJl_QrDkQkBSaXP1kQHaEz?w=294&amp;h=191&amp;c=7&amp;r=0&amp;o=5&amp;dpr=1.3&amp;pid=1.7\" style=\"height:325px; width:500px\" /></p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>🛕 13h30 | Tham quan Ch&ugrave;a B&aacute;i Đ&iacute;nh &ndash; Ng&ocirc;i ch&ugrave;a lớn nhất Đ&ocirc;ng Nam &Aacute;</strong></h3>\n\n<p>Buổi chiều, qu&yacute; kh&aacute;ch đến <strong>Ch&ugrave;a B&aacute;i Đ&iacute;nh</strong>, một trong những c&ocirc;ng tr&igrave;nh <strong>Phật gi&aacute;o vĩ đại nhất Việt Nam</strong>.<br />\n🏯 <strong>Kh&aacute;m ph&aacute; kiến tr&uacute;c ho&agrave;nh tr&aacute;ng</strong> của ng&ocirc;i ch&ugrave;a, nơi kết hợp h&agrave;i h&ograve;a giữa truyền thống v&agrave; hiện đại.<br />\n🌟 <strong>Chi&ecirc;m b&aacute;i Đại tượng Phật Th&iacute;ch Ca M&acirc;u Ni bằng đồng lớn nhất Đ&ocirc;ng Nam &Aacute;</strong>.<br />\n🏮 <strong>Dạo bước tr&ecirc;n H&agrave;nh lang La H&aacute;n d&agrave;i nhất ch&acirc;u &Aacute;</strong> với 500 bức tượng La H&aacute;n độc đ&aacute;o.<br />\n🛕 <strong>Th&aacute;p X&aacute; Lợi 13 tầng</strong>, nơi lưu giữ x&aacute; lợi Phật qu&yacute; gi&aacute;.</p>\n\n<p>Kh&ocirc;ng gian thanh tịnh, linh thi&ecirc;ng của B&aacute;i Đ&iacute;nh mang lại cho du kh&aacute;ch cảm gi&aacute;c b&igrave;nh an v&agrave; thư th&aacute;i.</p>\n\n<p><img alt=\"Image result for 📸 Gợi ý ảnh: Cổng Tam Quan chùa Bái Đính, tượng Phật khổng lồ, hành lang La Hán\" src=\"data:image/jpeg;base64,\" style=\"height:354px; width:500px\" /></p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>🛍 16h00 | Khởi h&agrave;nh về H&agrave; Nội &ndash; Dừng ch&acirc;n mua sắm đặc sản</strong></h3>\n\n<p>Xe đ&oacute;n qu&yacute; kh&aacute;ch khởi h&agrave;nh về H&agrave; Nội. Tr&ecirc;n đường về, đo&agrave;n dừng ch&acirc;n tại <strong>cửa h&agrave;ng đặc sản Ninh B&igrave;nh</strong>, nơi qu&yacute; kh&aacute;ch c&oacute; thể mua về những m&oacute;n qu&agrave; &yacute; nghĩa như:<br />\n✔ <strong>Cơm ch&aacute;y Ninh B&igrave;nh</strong> &ndash; M&oacute;n ăn nổi tiếng với vị gi&ograve;n tan, thơm ngon.<br />\n✔ <strong>Rượu Kim Sơn</strong> &ndash; Hương vị nồng đượm của v&ugrave;ng qu&ecirc; chi&ecirc;m trũng.<br />\n✔ <strong>Nem Y&ecirc;n Mạc, mắm t&eacute;p Gia Viễn</strong>&hellip;</p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>🏙 18h00 | Kết th&uacute;c h&agrave;nh tr&igrave;nh</strong></h3>\n\n<p>Xe đưa qu&yacute; kh&aacute;ch trở về điểm hẹn ban đầu tại H&agrave; Nội. <strong>Hướng dẫn vi&ecirc;n cảm ơn, chia tay v&agrave; hẹn gặp lại qu&yacute; kh&aacute;ch</strong> trong những h&agrave;nh tr&igrave;nh tiếp theo.</p>\n\n<p>🎉 <strong>Tour kết th&uacute;c với những kỷ niệm đ&aacute;ng nhớ!</strong> 🎉</p>\n\n<hr />\n<h2>&nbsp;</h2>\n\n<h2><strong>💡 Tại sao n&ecirc;n chọn tour Ninh B&igrave;nh c&ugrave;ng ch&uacute;ng t&ocirc;i?</strong></h2>\n\n<p>✅ <strong>Lịch tr&igrave;nh hợp l&yacute;</strong>, kh&aacute;m ph&aacute; trọn vẹn những địa điểm đẹp nhất.<br />\n✅ <strong>Hướng dẫn vi&ecirc;n chuy&ecirc;n nghiệp</strong>, gi&agrave;u kinh nghiệm v&agrave; tận t&acirc;m.<br />\n✅ <strong>Dịch vụ chất lượng</strong>, xe đời mới, nh&agrave; h&agrave;ng ngon, đảm bảo an to&agrave;n.</p>\n\n<p>📞 <strong>Li&ecirc;n hệ ngay để đặt tour</strong>: <strong>0399999999</strong></p>\n', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854102/saoviet/jwel4yzvsnkhpodz1pab.jpg', '<p><strong>&nbsp; &nbsp; &nbsp;Tr&agrave;ng An -</strong>&nbsp;<strong>B&aacute;i Đ&iacute;nh</strong> l&agrave; hai điểm đến nổi tiếng của tỉnh Ninh B&igrave;nh, nổi bật với cảnh quan thi&ecirc;n nhi&ecirc;n tuyệt đẹp v&agrave; gi&aacute; trị văn h&oacute;a, lịch sử s&acirc;u sắc. Quần thể danh thắng Tr&agrave;ng An được UNESCO c&ocirc;ng nhận l&agrave; Di sản Văn h&oacute;a v&agrave; Thi&ecirc;n nhi&ecirc;n Thế giới. Khu du lịch B&aacute;i Đ&iacute;nh l&agrave; nơi c&oacute; ng&ocirc;i ch&ugrave;a lớn nhất Đ&ocirc;ng Nam &Aacute;, với nhiều kỷ lục về tượng Phật v&agrave; kiến tr&uacute;c độc đ&aacute;o.</p>\n', 'Tour Văn Hóa Tràng An - Bái Đính', 1500000, '2025-03-02 03:30:11.414739', 0);
INSERT INTO `tour` (`id`, `category_id`, `description`, `image`, `introduce`, `name`, `price`, `time_created`, `orders`) VALUES
('T25003', 1, '<p>&nbsp;</p>\n\n<h1><strong>Tour C&ocirc; T&ocirc; &ndash; H&ograve;n đảo thi&ecirc;n đường</strong></h1>\n\n<p>⏳ <strong>Thời gian:</strong> 3 ng&agrave;y 2 đ&ecirc;m<br />\n📍 <strong>Điểm đến:</strong> C&ocirc; T&ocirc; &ndash; V&acirc;n Đồn &ndash; Ao Ti&ecirc;n<br />\n🚐 <strong>Khởi h&agrave;nh:</strong> H&agrave; Nội</p>\n\n<hr />\n<h2>&nbsp;</h2>\n\n<h2><strong>🛶 NG&Agrave;Y 1 | H&Agrave; NỘI &ndash; V&Acirc;N ĐỒN &ndash; ĐẢO C&Ocirc; T&Ocirc;</strong> <em>(Ăn trưa, tối)</em></h2>\n\n<h3><strong>🚗 06h30 | Khởi h&agrave;nh từ H&agrave; Nội</strong></h3>\n\n<p>Xe v&agrave; hướng dẫn vi&ecirc;n <strong>đ&oacute;n Qu&yacute; kh&aacute;ch tại điểm hẹn</strong>, khởi h&agrave;nh theo tuyến đường <strong>cao tốc Hạ Long &ndash; V&acirc;n Đồn</strong> hiện đại v&agrave; đẹp nhất miền Bắc. Tr&ecirc;n đường đi, đo&agrave;n dừng ch&acirc;n nghỉ ngơi v&agrave; tự do d&ugrave;ng bữa s&aacute;ng (<em>chi ph&iacute; tự t&uacute;c</em>).</p>\n\n<p><img alt=\"Image result for Đường cao tốc Hạ Long – Vân Đồn uốn lượn giữa thiên nhiên\" src=\"https://th.bing.com/th/id/OIP.CRsQu2nSyNLopG6zHhd3gwHaE7?w=238&amp;h=180&amp;c=7&amp;r=0&amp;o=5&amp;dpr=1.3&amp;pid=1.7\" style=\"height:379px; width:500px\" /></p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>⚓ 10h30 | Đến cảng Ao Ti&ecirc;n &ndash; V&acirc;n Đồn</strong></h3>\n\n<p>Sau h&agrave;nh tr&igrave;nh ngắm cảnh hai b&ecirc;n đường cao tốc h&ugrave;ng vĩ, đo&agrave;n dừng ch&acirc;n tại <strong>Cảng t&agrave;u du lịch quốc tế Ao Ti&ecirc;n</strong> &ndash; điểm trung chuyển quan trọng kết nối đất liền với C&ocirc; T&ocirc;.</p>\n\n<p>🚤 <strong>13h00 | L&ecirc;n t&agrave;u cao tốc khởi h&agrave;nh ra đảo C&ocirc; T&ocirc;</strong><br />\nThời gian di chuyển <strong>khoảng 1 giờ 20 ph&uacute;t</strong>, qu&yacute; kh&aacute;ch tận hưởng kh&ocirc;ng gian biển khơi m&ecirc;nh m&ocirc;ng với gi&oacute; biển dịu m&aacute;t v&agrave; những con s&oacute;ng vỗ nhẹ.</p>\n\n<p><img alt=\"Image result for Cảng Ao Tiên, hình ảnh tàu cao tốc lướt trên mặt biển\" src=\"data:image/jpeg;base64,\" style=\"height:375px; width:500px\" /></p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>🏝 14h20 | Đến đảo C&ocirc; T&ocirc; &ndash; Nhận ph&ograve;ng kh&aacute;ch sạn</strong></h3>\n\n<p>Xe điện đ&oacute;n đo&agrave;n tại <strong>bến cảng C&ocirc; T&ocirc;</strong>, đưa qu&yacute; kh&aacute;ch về kh&aacute;ch sạn nhận ph&ograve;ng v&agrave; nghỉ ngơi.</p>\n\n<p>🚙 <strong>15h00 | Tham quan Tượng đ&agrave;i B&aacute;c Hồ &amp; Tắm biển Hồng V&agrave;n</strong></p>\n\n<ul>\n	<li>Qu&yacute; kh&aacute;ch gh&eacute; thăm <strong>khu tượng đ&agrave;i B&aacute;c Hồ</strong>, nơi lưu giữ những kỷ niệm của Người với v&ugrave;ng đảo tiền ti&ecirc;u.</li>\n	<li>Sau đ&oacute;, di chuyển đến <strong>b&atilde;i biển Hồng V&agrave;n</strong> &ndash; nơi được mệnh danh l&agrave; b&atilde;i biển <strong>đẹp nhất đảo C&ocirc; T&ocirc;</strong>, với <strong>bờ c&aacute;t trắng mịn, nước biển xanh trong, s&oacute;ng lặng &ecirc;m đềm</strong>.</li>\n</ul>\n\n<p><img alt=\"Image result for Biển Hồng Vàn với làn nước xanh ngọc bích, du khách vui chơi trên bãi cát\" src=\"data:image/jpeg;base64,\" /></p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>🍽 18h30 | Thưởng thức đặc sản biển đảo C&ocirc; T&ocirc;</strong></h3>\n\n<p>Qu&yacute; kh&aacute;ch thưởng thức <strong>bữa tối tại nh&agrave; h&agrave;ng</strong> với c&aacute;c m&oacute;n hải sản tươi ngon:<br />\n🐟 <strong>C&aacute; thu một nắng, mực nhảy, h&agrave;u nướng mỡ h&agrave;nh</strong><br />\n🦐 <strong>T&ocirc;m h&ugrave;m, ghẹ hấp, nộm sứa C&ocirc; T&ocirc;</strong><br />\n🍚 <strong>Cơm gạo lứt nấu bằng nước biển</strong></p>\n\n<p>Sau bữa tối, đo&agrave;n tự do <strong>tản bộ thị trấn, thưởng thức caf&eacute; ven biển hoặc thu&ecirc; xe đạp đ&ocirc;i</strong> để kh&aacute;m ph&aacute; đảo về đ&ecirc;m.</p>\n\n<p><img alt=\"Image result for Đêm Cô Tô \" src=\"https://th.bing.com/th/id/OIP.Wqj5VycKGVPCMuZSXhhXbwHaEi?w=269&amp;h=180&amp;c=7&amp;r=0&amp;o=5&amp;dpr=1.3&amp;pid=1.7\" style=\"height:335px; width:500px\" /></p>\n\n<hr />\n<h2>&nbsp;</h2>\n\n<h2><strong>🌊 NG&Agrave;Y 2 | KH&Aacute;M PH&Aacute; ĐẢO XANH C&Ocirc; T&Ocirc;</strong> <em>(Ăn s&aacute;ng, trưa, tối)</em></h2>\n\n<h3><strong>🌅 06h00 | Đ&oacute;n b&igrave;nh minh &ndash; Tận hưởng kh&ocirc;ng kh&iacute; trong l&agrave;nh</strong></h3>\n\n<p>Qu&yacute; kh&aacute;ch dậy sớm đ&oacute;n b&igrave;nh minh tuyệt đẹp tr&ecirc;n đảo, d&ugrave;ng bữa s&aacute;ng tại kh&aacute;ch sạn.</p>\n\n<p>🌊 <strong>07h30 | Tham quan B&atilde;i đ&aacute; Cầu Mỵ &ndash; Ngọn Hải Đăng C&ocirc; T&ocirc;</strong></p>\n\n<ul>\n	<li><strong>B&atilde;i đ&aacute; Cầu Mỵ (B&atilde;i đ&aacute; M&oacute;ng Rồng)</strong> &ndash; tuyệt t&aacute;c thi&ecirc;n nhi&ecirc;n với những <strong>mỏm đ&aacute; trầm t&iacute;ch h&agrave;ng triệu năm tuổi</strong> v&agrave; s&oacute;ng biển vỗ về suốt ng&agrave;y đ&ecirc;m.</li>\n	<li><strong>Ngọn Hải Đăng C&ocirc; T&ocirc;</strong> &ndash; điểm đến kh&ocirc;ng thể bỏ lỡ, nơi du kh&aacute;ch c&oacute; thể ngắm <strong>to&agrave;n cảnh biển đảo C&ocirc; T&ocirc;</strong> từ tr&ecirc;n cao.</li>\n</ul>\n\n<p><img src=\"https://img.tripi.vn/cdn-cgi/image/width=700,height=700/https://gcs.tripi.vn/public-tripi/tripi-feed/img/473918voE/image-kham-pha-ve-dep-con-duong-tinh-yeu-co-to-chi-tiet-nhat-2023-168304481338309.jpg\" /></p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>🏖 14h00 | Vui chơi tại B&atilde;i tắm V&agrave;n Chảy &amp; Bắc V&agrave;n</strong></h3>\n\n<p>Buổi chiều, đo&agrave;n di chuyển đến <strong>B&atilde;i tắm V&agrave;n Chảy</strong> &ndash; b&atilde;i biển rộng lớn với <strong>s&oacute;ng vỗ mạnh, nước biển xanh trong, b&atilde;i c&aacute;t mịn trải d&agrave;i 1,5 km</strong>. Qu&yacute; kh&aacute;ch tự do tắm biển, chụp ảnh hoặc tham gia c&aacute;c hoạt động như:<br />\n🏄&zwj;♂️ <strong>Lướt v&aacute;n, đi cano, b&oacute;ng chuyền b&atilde;i biển</strong></p>\n\n<p><img alt=\"Image result for Du khách tắm biển, lướt ván tại bãi Vàn Chảy\" src=\"https://th.bing.com/th/id/OIP.vG-PnbOHNizxsddQVM4YrAHaEM?w=310&amp;h=180&amp;c=7&amp;r=0&amp;o=5&amp;dpr=1.3&amp;pid=1.7\" style=\"height:290px; width:500px\" /></p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>🍽 18h30 | Thưởng thức bữa tối &ndash; Dạo chơi tự do</strong></h3>\n\n<p>Sau bữa tối, qu&yacute; kh&aacute;ch c&oacute; thể:<br />\n✨ <strong>Đi dạo biển, tận hưởng kh&ocirc;ng gian y&ecirc;n b&igrave;nh</strong><br />\n🎶 <strong>Thưởng thức caf&eacute; ven biển, tham gia tiệc BBQ hải sản</strong></p>\n\n<hr />\n<h2>&nbsp;</h2>\n\n<h2><strong>🚢 NG&Agrave;Y 3 | C&Ocirc; T&Ocirc; &ndash; CẢNG AO TI&Ecirc;N &ndash; H&Agrave; NỘI</strong> <em>(Ăn s&aacute;ng, trưa)</em></h2>\n\n<h3><strong>🌤 06h00 | Tản bộ tr&ecirc;n &ldquo;Con đường t&igrave;nh y&ecirc;u&rdquo;</strong></h3>\n\n<p>Qu&yacute; kh&aacute;ch tự do dạo chơi tr&ecirc;n <strong>Con đường t&igrave;nh y&ecirc;u</strong> &ndash; con đường l&aacute;t gạch men thơ mộng ven biển, điểm l&yacute; tưởng để ngắm b&igrave;nh minh.</p>\n\n<p><img src=\"https://img.tripi.vn/cdn-cgi/image/width=700,height=700/https://gcs.tripi.vn/public-tripi/tripi-feed/img/473918xGy/image-kham-pha-ve-dep-con-duong-tinh-yeu-co-to-chi-tiet-nhat-2023-168304481295906.png\" /></p>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>🛳 12h45 | L&ecirc;n t&agrave;u cao tốc trở về đất liền</strong></h3>\n\n<p>Sau bữa trưa, đo&agrave;n l&agrave;m thủ tục trả ph&ograve;ng v&agrave; l&ecirc;n t&agrave;u cao tốc chuyến <strong>13h30</strong> về lại <strong>Cảng Ao Ti&ecirc;n &ndash; V&acirc;n Đồn</strong>.</p>\n\n<p>🚗 <strong>Xe đ&oacute;n qu&yacute; kh&aacute;ch về H&agrave; Nội</strong>, tr&ecirc;n đường gh&eacute; mua <strong>đặc sản Quảng Ninh</strong>:<br />\n🥮 <strong>Chả mực Hạ Long, s&aacute; s&ugrave;ng kh&ocirc;, ruốc t&ocirc;m, mực một nắng</strong></p>\n\n<p>18h00 | <strong>Về đến H&agrave; Nội, kết th&uacute;c h&agrave;nh tr&igrave;nh tốt đẹp</strong>. Hướng dẫn vi&ecirc;n <strong>chia tay v&agrave; hẹn gặp lại qu&yacute; kh&aacute;ch trong những chuyến đi tiếp theo</strong>.</p>\n\n<hr />\n<h2>&nbsp;</h2>\n\n<h2><strong>💡 TẠI SAO N&Ecirc;N CHỌN TOUR C&Ocirc; T&Ocirc; C&Ugrave;NG CH&Uacute;NG T&Ocirc;I?</strong></h2>\n\n<p>✅ <strong>H&agrave;nh tr&igrave;nh trọn vẹn</strong>, kh&aacute;m ph&aacute; vẻ đẹp hoang sơ của C&ocirc; T&ocirc;.<br />\n✅ <strong>Hướng dẫn vi&ecirc;n chuy&ecirc;n nghiệp</strong>, tận t&acirc;m đồng h&agrave;nh.<br />\n✅ <strong>Dịch vụ chất lượng cao</strong>, kh&aacute;ch sạn sang trọng, hải sản tươi ngon.</p>\n\n<p>📞 <strong>Li&ecirc;n hệ đặt tour ngay:</strong>&nbsp;<strong>0399999999</strong></p>\n\n<p>💬 <strong>Bạn thấy lịch tr&igrave;nh n&agrave;y thế n&agrave;o?</strong> Nếu cần th&ecirc;m h&igrave;nh ảnh hoặc chỉnh sửa chi tiết, h&atilde;y cho m&igrave;nh biết nh&eacute;! 🚀</p>\n', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854199/saoviet/o3tufqj6ama66vekmdpy.jpg', '<p><strong><em>&nbsp; &nbsp; &nbsp;Du lịch H&agrave; Nội - C&ocirc; T&ocirc;</em></strong><em>: Quảng Ninh nổi tiếng với điểm du lịch Vịnh Hạ Long, ngo&agrave;i ra ở nơi đ&acirc;y c&ograve;n c&oacute; một điểm du lịch rất hấp dẫn cho h&egrave; n&agrave;y đ&oacute; ch&iacute;nh l&agrave; Thi&ecirc;n đường biển đảo C&ocirc; T&ocirc;, với b&atilde;i biển c&aacute;t trắng, biển xanh v&agrave; những hoạt động du lịch v&ocirc; c&ugrave;ng hấp dẫn. C&ocirc; T&ocirc; c&ograve;n l&agrave; điểm du lịch th&uacute; vị cho những cặp đ&ocirc;i, vợ chồng , gia đ&igrave;nh v&agrave; c&aacute;c kh&aacute;ch du lịch kh&aacute;c v&igrave; nơi đ&acirc;y ch&iacute;nh l&agrave; điểm l&atilde;ng mạn tuyệt vời.</em></p>\n', 'Du lịch Hà Nội Hè - Vân Đồn - Đảo Cô Tô', 2000000, '2025-03-03 18:44:54.598739', 4);
INSERT INTO `tour` (`id`, `category_id`, `description`, `image`, `introduce`, `name`, `price`, `time_created`, `orders`) VALUES
('T25004', 1, '<p>&nbsp;</p>\n\n<h1><strong>CHƯƠNG TR&Igrave;NH TOUR DU LỊCH</strong></h1>\n\n<h2><strong>H&Agrave; NỘI &ndash; V&Acirc;N ĐỒN &ndash; MINH CH&Acirc;U &ndash; QUAN LẠN</strong></h2>\n\n<p><em>(Thời gian: 3 ng&agrave;y 2 đ&ecirc;m | Phương tiện: &Ocirc; t&ocirc; &amp; T&agrave;u cao tốc)</em></p>\n\n<hr />\n<h2>&nbsp;</h2>\n\n<h2><strong>NG&Agrave;Y 1 | H&Agrave; NỘI &ndash; V&Acirc;N ĐỒN &ndash; MINH CH&Acirc;U (Ăn s&aacute;ng, trưa, tối)</strong></h2>\n\n<h3><strong>06h00:</strong></h3>\n\n<p>Xe v&agrave; hướng dẫn vi&ecirc;n đ&oacute;n Qu&yacute; kh&aacute;ch tại điểm hẹn <strong>cổng Rạp Xiếc Trung Ương</strong>, khởi h&agrave;nh đi <strong>Cảng quốc tế Ao Ti&ecirc;n &ndash; V&acirc;n Đồn</strong>. Tr&ecirc;n đường đi, đo&agrave;n dừng ch&acirc;n nghỉ ngơi v&agrave; d&ugrave;ng bữa s&aacute;ng tự t&uacute;c tại nh&agrave; h&agrave;ng V52.</p>\n\n<p>📍 <strong>Cảng quốc tế Ao Ti&ecirc;n &ndash; V&acirc;n Đồn</strong></p>\n\n<h3><strong>09h30:</strong></h3>\n\n<p>Đến V&acirc;n Đồn, Qu&yacute; kh&aacute;ch l&agrave;m thủ tục l&ecirc;n t&agrave;u cao tốc chuyến <strong>10h00</strong> khởi h&agrave;nh đi <strong>Minh Ch&acirc;u &ndash; Quan Lạn</strong>. Tr&ecirc;n h&agrave;nh tr&igrave;nh, Qu&yacute; kh&aacute;ch sẽ được chi&ecirc;m ngưỡng vẻ đẹp tuyệt mỹ của <strong>Vịnh B&aacute;i Tử Long</strong> với những d&atilde;y n&uacute;i đ&aacute; v&ocirc;i h&ugrave;ng vĩ v&agrave; l&agrave;n nước trong xanh.</p>\n\n<p><img alt=\"Image result for Cảng quốc tế Ao Tiên – Vân Đồn\" src=\"https://th.bing.com/th/id/OIP.WwPu5e3oBbu_QF0ZMuF2fwHaFb?w=274&amp;h=180&amp;c=7&amp;r=0&amp;o=5&amp;dpr=1.3&amp;pid=1.7\" style=\"height:329px; width:500px\" /></p>\n\n<p>📍 <strong>Vịnh B&aacute;i Tử Long</strong></p>\n\n<h3><strong>11h00:</strong></h3>\n\n<p>T&agrave;u cập cảng Minh Ch&acirc;u, xe đ&oacute;n Qu&yacute; kh&aacute;ch về kh&aacute;ch sạn, nhận ph&ograve;ng v&agrave; nghỉ ngơi.</p>\n\n<h3><strong>12h00:</strong></h3>\n\n<p>Đo&agrave;n d&ugrave;ng bữa trưa tại nh&agrave; h&agrave;ng với c&aacute;c m&oacute;n đặc sản địa phương.</p>\n\n<h3><strong>Chiều:</strong></h3>\n\n<p>Qu&yacute; kh&aacute;ch tự do nghỉ ngơi, vui chơi v&agrave; tắm biển tại <strong>b&atilde;i biển Minh Ch&acirc;u</strong> &ndash; một trong những b&atilde;i biển đẹp nhất miền Bắc với c&aacute;t trắng mịn v&agrave; l&agrave;n nước trong xanh.</p>\n\n<p><img src=\"https://th.bing.com/th?id=OIP.RuegoS7PIOlbzNVNxG3M9gHaFj&amp;w=200&amp;h=149&amp;rs=1&amp;qlt=80&amp;o=6&amp;dpr=1.3&amp;pid=3.1\" style=\"height:371px; width:500px\" /></p>\n\n<p>📍 <strong>B&atilde;i biển Minh Ch&acirc;u</strong></p>\n\n<h3><strong>18h30:</strong></h3>\n\n<p>Đo&agrave;n d&ugrave;ng bữa tối tại nh&agrave; h&agrave;ng. Sau đ&oacute;, Qu&yacute; kh&aacute;ch c&oacute; thể <strong>tự do kh&aacute;m ph&aacute; Minh Ch&acirc;u về đ&ecirc;m</strong> hoặc đăng k&yacute; tour <strong>c&acirc;u mực đ&ecirc;m</strong> (chi ph&iacute; tự t&uacute;c).</p>\n\n<p><img alt=\"Image result for Bãi biển Minh Châu. Size: 176 x 185. Source: gotrangtri.vn\" src=\"https://www.bing.com/th?id=OIP.i264Ld-1EAOg22YIH9A03AHaFD&amp;w=176&amp;h=185&amp;c=8&amp;rs=1&amp;qlt=90&amp;o=6&amp;dpr=1.3&amp;pid=3.1&amp;rm=2\" style=\"height:526px; width:500px\" /></p>\n\n<h2>&nbsp;</h2>\n\n<h2><strong>NG&Agrave;Y 2 | KH&Aacute;M PH&Aacute; ĐẢO MINH CH&Acirc;U &ndash; QUAN LẠN (Ăn s&aacute;ng, trưa, tối)</strong></h2>\n\n<h3><strong>07h00:</strong></h3>\n\n<p>Qu&yacute; kh&aacute;ch d&ugrave;ng bữa s&aacute;ng tại kh&aacute;ch sạn.</p>\n\n<h3><strong>08h00:</strong></h3>\n\n<p>Xe đưa đo&agrave;n tham quan v&agrave; chụp ảnh tại c&aacute;c điểm đến nổi bật:</p>\n\n<ul>\n	<li><strong>D&ograve;ng s&ocirc;ng c&aacute;t trắng &amp; B&atilde;i tắm Biển Ngọc</strong> &ndash; Nơi sở hữu khung cảnh thi&ecirc;n nhi&ecirc;n hoang sơ, độc đ&aacute;o c&ugrave;ng ghềnh đ&aacute; tự nhi&ecirc;n kỳ vĩ.</li>\n	<li><strong>Đồi V&ocirc; Cực &amp; Eo Gi&oacute; &ndash; Quan Lạn</strong> &ndash; Những địa điểm check-in nổi tiếng với cảnh sắc ngoạn mục, l&agrave; thi&ecirc;n đường &quot;sống ảo&quot; d&agrave;nh cho du kh&aacute;ch.</li>\n	<li><strong>Cụm di t&iacute;ch Đ&igrave;nh, Ch&ugrave;a, Miếu Quan Lạn</strong> &ndash; Kh&aacute;m ph&aacute; đời sống văn h&oacute;a v&agrave; phong tục tập qu&aacute;n của người d&acirc;n tr&ecirc;n đảo.</li>\n</ul>\n\n<p>📍 <strong>Eo Gi&oacute; &ndash; Quan Lạn</strong></p>\n\n<p><img alt=\"Eo Gió Quan Lạn Quảng Ninh - điểm checkin ít người biết - HaloTravel\" src=\"https://halotravel.vn/wp-content/uploads/2021/03/eo-gio-quan-lan3-e1614868384455.jpg\" /></p>\n\n<h3><strong>11h30:</strong></h3>\n\n<p>Qu&yacute; kh&aacute;ch thưởng thức bữa trưa tại nh&agrave; h&agrave;ng, sau đ&oacute; về kh&aacute;ch sạn nghỉ ngơi.</p>\n\n<h3><strong>Chiều:</strong></h3>\n\n<p>Tự do vui chơi v&agrave; tắm biển tại <strong>b&atilde;i biển Minh Ch&acirc;u</strong> &ndash; nơi c&oacute; kh&ocirc;ng kh&iacute; trong l&agrave;nh, s&oacute;ng biển nhẹ nh&agrave;ng v&agrave; cảnh quan tuyệt đẹp.</p>\n\n<h3><strong>18h45:</strong></h3>\n\n<p>Qu&yacute; kh&aacute;ch d&ugrave;ng bữa tối tại <strong>nh&agrave; h&agrave;ng Biển Ngọc</strong>. Sau bữa tối, tự do kh&aacute;m ph&aacute; <strong>phố đi bộ Minh Ch&acirc;u</strong> hoặc nghỉ ngơi.</p>\n\n<h2>&nbsp;</h2>\n\n<h2><strong>NG&Agrave;Y 3 | MINH CH&Acirc;U &ndash; V&Acirc;N ĐỒN &ndash; H&Agrave; NỘI (Ăn s&aacute;ng, trưa)</strong></h2>\n\n<h3><strong>07h00:</strong></h3>\n\n<p>Qu&yacute; kh&aacute;ch d&ugrave;ng bữa s&aacute;ng, sau đ&oacute; tự do nghỉ ngơi v&agrave; kh&aacute;m ph&aacute; đảo.</p>\n\n<p>📍 <strong>Con đường t&igrave;nh y&ecirc;u Minh Ch&acirc;u</strong> &ndash; Điểm dạo bộ l&yacute; tưởng v&agrave; l&agrave; nơi ngắm b&igrave;nh minh tuyệt đẹp.</p>\n\n<p><img alt=\"Khám phá vẻ đẹp con đường tình yêu Cô Tô\" src=\"https://sinhtour.vn/wp-content/uploads/2023/04/cong-duong-tinh-yeu-co-to-1.png.webp\" /></p>\n\n<h3><strong>10h30:</strong></h3>\n\n<p>L&agrave;m thủ tục trả ph&ograve;ng kh&aacute;ch sạn, d&ugrave;ng bữa trưa tại nh&agrave; h&agrave;ng.</p>\n\n<h3><strong>12h30:</strong></h3>\n\n<p>Đo&agrave;n di chuyển ra <strong>Bến cảng Minh Ch&acirc;u</strong>, l&ecirc;n t&agrave;u cao tốc khởi h&agrave;nh về <strong>Cảng Ao Ti&ecirc;n &ndash; V&acirc;n Đồn</strong>.</p>\n\n<h3><strong>13h50:</strong></h3>\n\n<p>T&agrave;u cập bến, xe đ&oacute;n Qu&yacute; kh&aacute;ch trở về H&agrave; Nội. Tr&ecirc;n đường, đo&agrave;n dừng ch&acirc;n mua sắm đặc sản địa phương.</p>\n\n<h3><strong>17h30:</strong></h3>\n\n<p>Về đến H&agrave; Nội, hướng dẫn vi&ecirc;n chia tay v&agrave; hẹn gặp lại Qu&yacute; kh&aacute;ch trong những h&agrave;nh tr&igrave;nh tiếp theo! 🚀</p>\n\n<hr />\n<h2>&nbsp;</h2>\n\n<h2><strong>🎁 DỊCH VỤ BAO GỒM:</strong></h2>\n\n<p>✔️ Xe du lịch đời mới, m&aacute;y lạnh theo lịch tr&igrave;nh.<br />\n✔️ T&agrave;u cao tốc khứ hồi V&acirc;n Đồn &ndash; Minh Ch&acirc;u.<br />\n✔️ Kh&aacute;ch sạn ti&ecirc;u chuẩn từ 2-3 sao.<br />\n✔️ 06 bữa ăn theo chương tr&igrave;nh (3 bữa trưa, 2 bữa tối, 2 bữa s&aacute;ng).<br />\n✔️ Hướng dẫn vi&ecirc;n chuy&ecirc;n nghiệp, nhiệt t&igrave;nh.<br />\n✔️ Bảo hiểm du lịch &amp; nước uống theo h&agrave;nh tr&igrave;nh.</p>\n\n<h2><strong>❌ DỊCH VỤ KH&Ocirc;NG BAO GỒM:</strong></h2>\n\n<p>⛔ Thuế VAT 10%.<br />\n⛔ Chi ph&iacute; c&aacute; nh&acirc;n ngo&agrave;i chương tr&igrave;nh (đồ uống, mua sắm, v&eacute; tham quan ri&ecirc;ng lẻ).<br />\n⛔ C&aacute;c hoạt động tự t&uacute;c như c&acirc;u mực đ&ecirc;m, c&agrave;o ngao, thu&ecirc; xe đạp đ&ocirc;i.</p>\n\n<p>📞 <strong>Hotline hỗ trợ: 0399 999 999</strong></p>\n\n<p>🌟 <strong>H&atilde;y đồng h&agrave;nh c&ugrave;ng ch&uacute;ng t&ocirc;i để c&oacute; một chuyến đi đ&aacute;ng nhớ tại Minh Ch&acirc;u &ndash; Quan Lạn!</strong> 🌟</p>\n', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854278/saoviet/tbq7qpjabc3uqoxpke8q.jpg', '<p><strong><em>&nbsp; &nbsp; &nbsp;Đảo Quan Lạn</em></strong><em>&nbsp;thuộc Quảng Ninh l&agrave; một v&ugrave;ng đất được thi&ecirc;n nhi&ecirc;n h&agrave;o ph&oacute;ng ban tặng nhiều lợi thế. Nơi đ&acirc;y kh&ocirc;ng chỉ hội tụ đầy đủ những yếu tố của 1 danh thắng đẹp m&agrave; c&ograve;n lưu giữ trọn vẹn những gi&aacute; trị lịch sử, truyền thống l&acirc;u đời.</em><br />\n<em><em>Đến với&nbsp;</em><strong>du lịch Quan Lạn,</strong><em>&nbsp;du kh&aacute;ch c&oacute; thể tự do đi dạo, ngắm nh&igrave;n b&atilde;i biển c&aacute;t trắng trải d&agrave;i với mặt nước lấp l&aacute;nh như được gi&aacute;t v&agrave;ng, hay tắm biển, đi chinh phục những con s&oacute;ng v&agrave; thưởng thức những m&oacute;n ăn bổ dưỡng m&agrave; chỉ nơi đ&acirc;y mới c&oacute; được như S&aacute; S&ugrave;ng, ghẹ xanh,...</em></em></p>\n', 'Du lịch Minh Châu - Quan Lạn', 1800000, '2025-03-02 14:11:46.106355', 3);
INSERT INTO `tour` (`id`, `category_id`, `description`, `image`, `introduce`, `name`, `price`, `time_created`, `orders`) VALUES
('T25005', 4, '<p>&nbsp;</p>\n\n<h1>🌿 <strong>TOUR TREKKING CHINH PHỤC FANSIPAN</strong> 🌿</h1>\n\n<p>✨ <em>H&agrave;nh tr&igrave;nh kh&aacute;m ph&aacute; N&oacute;c nh&agrave; Đ&ocirc;ng Dương</em> ✨<br />\n📍 <em>Thời gian: 2 ng&agrave;y 1 đ&ecirc;m</em><br />\n📍 <em>Địa điểm: Sapa &ndash; Fansipan</em><br />\n📍 <em>Phương tiện: Trekking &ndash; Leo n&uacute;i</em></p>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2><strong>🚩 NG&Agrave;Y 1 | SAPA &ndash; CH&Acirc;N N&Uacute;I FANSIPAN</strong></h2>\n\n<h3><strong>🌅 06:00 | TẬP TRUNG &amp; KHỞI H&Agrave;NH</strong></h3>\n\n<p>📍 Tập trung tại <strong>thị trấn Sapa</strong>, kiểm tra trang thiết bị, h&agrave;nh l&yacute;.<br />\n📍 Hướng dẫn vi&ecirc;n phổ biến lộ tr&igrave;nh &amp; lưu &yacute; an to&agrave;n.</p>\n\n<h3><strong>🥾 07:00 | BẮT ĐẦU TREKKING</strong></h3>\n\n<p>📍 Xuất ph&aacute;t từ trung t&acirc;m Sapa, trekking qua những cung đường m&ograve;n ngoạn mục.<br />\n📍 Kh&aacute;m ph&aacute; <strong>bản l&agrave;ng của người H&rsquo;M&ocirc;ng, Dao</strong>, t&igrave;m hiểu n&eacute;t văn h&oacute;a độc đ&aacute;o.</p>\n\n<h3><strong>🏡 09:00 | GH&Eacute; THĂM BẢN L&Agrave;NG</strong></h3>\n\n<p>📍 Nghỉ ngơi, tr&ograve; chuyện c&ugrave;ng người d&acirc;n địa phương.<br />\n📍 Thưởng thức <strong>tr&agrave; thảo mộc</strong> v&agrave; kh&aacute;m ph&aacute; đời sống miền sơn cước.</p>\n\n<h3><strong>🍱 12:00 | DỪNG CH&Acirc;N ĂN TRƯA</strong></h3>\n\n<p>📍 Thưởng thức bữa trưa nhẹ, tiếp tục h&agrave;nh tr&igrave;nh hướng về <strong>ch&acirc;n n&uacute;i Fansipan</strong>.</p>\n\n<h3><strong>🌲 14:00 | BƯỚC V&Agrave;O RỪNG NGUY&Ecirc;N SINH</strong></h3>\n\n<p>📍 Vượt qua những con dốc cao, xuy&ecirc;n qua c&aacute;nh rừng nguy&ecirc;n sinh rậm rạp.<br />\n📍 Ngắm nh&igrave;n những d&ograve;ng <strong>th&aacute;c nước trắng x&oacute;a</strong>, lắng nghe &acirc;m thanh thi&ecirc;n nhi&ecirc;n hoang d&atilde;.</p>\n\n<h3><strong>🏕 17:00 | ĐẾN TRẠM NGHỈ Đ&Ecirc;M</strong></h3>\n\n<p>📍 Nghỉ ngơi tại <strong>lều trại hoặc nh&agrave; s&agrave;n</strong>, thư gi&atilde;n sau một ng&agrave;y trekking.<br />\n📍 Thưởng thức <strong>bữa tối ấm c&uacute;ng</strong>, giao lưu, chia sẻ trải nghiệm.</p>\n\n<h3><strong>🌌 20:00 | NGHỈ Đ&Ecirc;M GIỮA ĐẠI NG&Agrave;N</strong></h3>\n\n<p>📍 Thư gi&atilde;n, tận hưởng kh&ocirc;ng gian y&ecirc;n b&igrave;nh của n&uacute;i rừng T&acirc;y Bắc.<br />\n📍 Nghỉ ngơi, chuẩn bị năng lượng cho ng&agrave;y chinh phục đỉnh Fansipan.</p>\n\n<p><img alt=\"sapa_15\" src=\"https://cuongdulich.com/assets/posts/1571821299-sapa_15.jpg\" /></p>\n\n<h2>&nbsp;</h2>\n\n<h2><strong>🚩 NG&Agrave;Y 2 | CHINH PHỤC ĐỈNH FANSIPAN</strong></h2>\n\n<h3><strong>🌞 06:00 | THỨC DẬY &amp; ĂN S&Aacute;NG</strong></h3>\n\n<p>📍 Kiểm tra trang bị, khởi động nhẹ trước khi tiếp tục h&agrave;nh tr&igrave;nh.</p>\n\n<h3><strong>🧗&zwj;♂️ 07:00 | TIẾN VỀ ĐỈNH FANSIPAN</strong></h3>\n\n<p>📍 Chinh phục những cung đường đầy thử th&aacute;ch, vượt qua <strong>v&aacute;ch đ&aacute; cheo leo</strong>.<br />\n📍 Băng qua <strong>rừng tr&uacute;c, thảm thực vật hoang sơ</strong>, tận hưởng kh&ocirc;ng kh&iacute; m&aacute;t lạnh.</p>\n\n<h3><strong>🏔 10:00 | GẦN CHẠM TỚI &quot;N&Oacute;C NH&Agrave; Đ&Ocirc;NG DƯƠNG&quot;</strong></h3>\n\n<p>📍 Những con dốc dựng đứng đ&ograve;i hỏi sự bền bỉ, ki&ecirc;n tr&igrave;.<br />\n📍 Cảm nhận sự thay đổi của kh&iacute; hậu khi độ cao tăng dần.</p>\n\n<h3><strong>🥪 12:00 | ĂN TRƯA TR&Ecirc;N ĐƯỜNG</strong></h3>\n\n<p>📍 Nghỉ ngơi, thưởng thức bữa trưa d&atilde; chiến giữa thi&ecirc;n nhi&ecirc;n h&ugrave;ng vĩ.</p>\n\n<h3><strong>⛰ 14:00 | CHINH PHỤC ĐỈNH FANSIPAN (3.143M)</strong></h3>\n\n<p>🎉 <strong>Chạm tay v&agrave;o đỉnh Fansipan &ndash; N&oacute;c nh&agrave; Đ&ocirc;ng Dương!</strong><br />\n📍 Chụp ảnh check-in, tận hưởng <strong>to&agrave;n cảnh n&uacute;i rừng T&acirc;y Bắc từ tr&ecirc;n cao</strong>.</p>\n\n<h3><strong>🚶&zwj;♂️ 15:00 | XUỐNG N&Uacute;I</strong></h3>\n\n<p>📍 Trở về theo lộ tr&igrave;nh an to&agrave;n, tận hưởng nốt vẻ đẹp của cung đường trekking.</p>\n\n<h3><strong>🏡 17:00 | VỀ LẠI SAPA &ndash; KẾT TH&Uacute;C H&Agrave;NH TR&Igrave;NH</strong></h3>\n\n<p>📍 Chia tay đo&agrave;n, kết th&uacute;c h&agrave;nh tr&igrave;nh đ&aacute;ng nhớ!<br />\n📍 Hẹn gặp lại trong những chuyến trekking tiếp theo!</p>\n\n<p><img src=\"data:image/jpeg;base64,\" /></p>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2><strong>🎒 CHUẨN BỊ H&Agrave;NH TRANG</strong></h2>\n\n<p>✔ <strong>Trang phục:</strong> Gi&agrave;y trekking, quần &aacute;o giữ nhiệt, &aacute;o kho&aacute;c gi&oacute;, mũ len, găng tay.<br />\n✔ <strong>Trang bị:</strong> Ba l&ocirc; gọn nhẹ, đ&egrave;n pin, &aacute;o mưa, b&igrave;nh nước c&aacute; nh&acirc;n.<br />\n✔ <strong>Đồ ăn nhẹ:</strong> Thanh năng lượng, chocolate, tr&aacute;i c&acirc;y kh&ocirc;.<br />\n✔ <strong>Sức khỏe:</strong> Đảm bảo thể lực tốt, tập luyện trước chuyến đi để th&iacute;ch nghi với địa h&igrave;nh.<br />\n✔ <strong>Thời tiết:</strong> Kiểm tra dự b&aacute;o thời tiết trước h&agrave;nh tr&igrave;nh.</p>\n\n<p>📞 <strong>Hotline hỗ trợ: 0399 999 999</strong></p>\n\n<hr />\n<p>🔥 <strong>ĐẶT TOUR NGAY &ndash; SẴN S&Agrave;NG CHINH PHỤC FANSIPAN!</strong> 🔥</p>\n\n<p>🚀 <strong>Trải nghiệm thi&ecirc;n nhi&ecirc;n kỳ vĩ &amp; thử th&aacute;ch ch&iacute;nh m&igrave;nh!</strong> 🚀</p>\n\n<h3>&nbsp;</h3>\n', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854398/saoviet/ampy1axj9dwwkoajk9pu.png', '<p>&nbsp; &nbsp; &nbsp;<strong>Fansipan</strong> l&agrave; đỉnh n&uacute;i cao nhất trong d&atilde;y n&uacute;i <strong><em>Ho&agrave;ng Li&ecirc;n Sơn</em></strong>, nằm ở bi&ecirc;n giới tỉnh L&agrave;o Cai v&agrave; tỉnh Lai Ch&acirc;u. C&aacute;ch trung t&acirc;m thị x&atilde; Sa Pa khoảng 9&nbsp;km về ph&iacute;a t&acirc;y nam. Chiều cao&nbsp;của đỉnh n&uacute;i đo đạc v&agrave;o năm 1909 l&agrave; 3143 m. Đ&acirc;y cũng l&agrave; điểm cao nhất của ba nước Đ&ocirc;ng Dương (Việt Nam, L&agrave;o, Campuchia) n&ecirc;n Fansipan c&ograve;n được mệnh danh l&agrave; &quot;<em>N&oacute;c nh&agrave; Đ&ocirc;ng Dương</em>&quot;.</p>\n', 'Leo núi Fansipan (Lào Cai)', 1950000, '2025-03-02 14:24:09.862634', 0);
INSERT INTO `tour` (`id`, `category_id`, `description`, `image`, `introduce`, `name`, `price`, `time_created`, `orders`) VALUES
('T25006', 4, '<h1>🌿 <strong>TOUR KH&Aacute;M PH&Aacute; SƠN ĐO&Ograve;NG - KỲ QUAN HANG ĐỘNG LỚN NHẤT THẾ GIỚI</strong> 🌿</h1>\n\n<p>✨ <em>H&agrave;nh tr&igrave;nh chinh phục hang động kỳ vĩ nhất h&agrave;nh tinh</em> ✨<br />\n📍 <em>Thời gian: 2 ng&agrave;y 1 đ&ecirc;m</em><br />\n📍 <em>Địa điểm: Phong Nha - Kẻ B&agrave;ng</em><br />\n📍 <em>Phương tiện: Trekking - Leo n&uacute;i - Kh&aacute;m ph&aacute; hang động</em></p>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2><strong>🚩 NG&Agrave;Y 1 | PHONG NHA &ndash; CỬA HANG SƠN ĐO&Ograve;NG</strong></h2>\n\n<h3><strong>🌅 07:00 | TẬP TRUNG &amp; CHUẨN BỊ H&Agrave;NH TR&Igrave;NH</strong></h3>\n\n<p>📍 Tập trung tại <strong>Phong Nha</strong>, kiểm tra trang thiết bị, h&agrave;nh l&yacute;.<br />\n📍 Hướng dẫn vi&ecirc;n phổ biến lộ tr&igrave;nh &amp; c&aacute;c quy tắc an to&agrave;n trong hang.</p>\n\n<h3><strong>🥾 08:00 | BẮT ĐẦU TREKKING QUA RỪNG NGUY&Ecirc;N SINH</strong></h3>\n\n<p>📍 Di chuyển v&agrave;o khu vực rừng Phong Nha &ndash; Kẻ B&agrave;ng.<br />\n📍 Băng qua những con suối, con dốc v&agrave; hệ sinh th&aacute;i đa dạng.<br />\n📍 Cảm nhận kh&ocirc;ng kh&iacute; m&aacute;t l&agrave;nh giữa thi&ecirc;n nhi&ecirc;n hoang sơ.</p>\n\n<h3><strong>🍱 12:00 | DỪNG CH&Acirc;N NGHỈ TRƯA</strong></h3>\n\n<p>📍 Dừng lại tại điểm nghỉ ch&acirc;n, thưởng thức bữa trưa d&atilde; chiến.<br />\n📍 Lấy lại năng lượng, chuẩn bị vượt qua những chặng đường tiếp theo.</p>\n\n<h3><strong>🛶 14:00 | VƯỢT S&Ocirc;NG SUỐI &amp; ĐỊA H&Igrave;NH Đ&Aacute; V&Ocirc;I</strong></h3>\n\n<p>📍 Băng qua c&aacute;c con suối ngầm, leo qua những v&aacute;ch đ&aacute; kỳ vĩ.<br />\n📍 Chi&ecirc;m ngưỡng vẻ đẹp nguy&ecirc;n sơ của n&uacute;i rừng Quảng B&igrave;nh.</p>\n\n<h3><strong>🏕 16:00 | ĐẾN CỬA HANG SƠN ĐO&Ograve;NG</strong></h3>\n\n<p>📍 Chạm tới cửa hang khổng lồ &ndash; nơi bắt đầu h&agrave;nh tr&igrave;nh kỳ diệu.<br />\n📍 Th&aacute;m hiểm những khu vực đầu ti&ecirc;n b&ecirc;n trong hang.</p>\n\n<h3><strong>🍽 19:00 | ĂN TỐI &amp; NGHỈ NGƠI GIỮA L&Ograve;NG ĐỘNG THI&Ecirc;N NHI&Ecirc;N</strong></h3>\n\n<p>📍 Thưởng thức bữa tối giữa <strong>thế giới ngầm b&iacute; ẩn</strong> của Sơn Đo&ograve;ng.<br />\n📍 Nghỉ đ&ecirc;m trong <strong>hang động lớn nhất thế giới</strong>, tận hưởng cảm gi&aacute;c h&ograve;a m&igrave;nh với thi&ecirc;n nhi&ecirc;n.</p>\n\n<p><img alt=\"Image result for CỬA HANG SƠN ĐOÒNG\" src=\"https://th.bing.com/th/id/OIP.rJObaMKeu0zoSynqf_KXfQHaET?w=277&amp;h=180&amp;c=7&amp;r=0&amp;o=5&amp;dpr=1.3&amp;pid=1.7\" style=\"height:325px; width:500px\" /></p>\n\n<p>&nbsp;</p>\n\n<h2><strong>🚩 NG&Agrave;Y 2 | CHINH PHỤC SƠN ĐO&Ograve;NG - H&Agrave;NH TR&Igrave;NH KỲ VĨ</strong></h2>\n\n<h3><strong>🌞 06:00 | THỨC DẬY &amp; ĂN S&Aacute;NG</strong></h3>\n\n<p>📍 Kiểm tra trang thiết bị, khởi động nhẹ để tiếp tục h&agrave;nh tr&igrave;nh v&agrave;o s&acirc;u trong hang.</p>\n\n<h3><strong>🕵️&zwj;♂️ 07:00 | KH&Aacute;M PH&Aacute; KỲ QUAN SƠN ĐO&Ograve;NG</strong></h3>\n\n<p>📍 Chinh phục <strong>hệ thống thạch nhũ khổng lồ</strong>, cao h&agrave;ng chục m&eacute;t.<br />\n📍 Kh&aacute;m ph&aacute; <strong>rừng nguy&ecirc;n sinh nằm b&ecirc;n trong hang</strong>, nơi c&oacute; hệ sinh th&aacute;i độc đ&aacute;o.<br />\n📍 Ngỡ ng&agrave;ng trước cảnh tượng <strong>&aacute;nh s&aacute;ng xuy&ecirc;n qua hố sụt</strong>, tạo n&ecirc;n vẻ đẹp kỳ ảo.</p>\n\n<h3><strong>🍽 12:00 | ĂN TRƯA TRONG HANG</strong></h3>\n\n<p>📍 Dừng ch&acirc;n tại một khu vực rộng lớn trong hang để ăn trưa.</p>\n\n<h3><strong>🌍 14:00 | KH&Aacute;M PH&Aacute; NHỮNG KHU VỰC CHƯA TỪNG ĐẶT CH&Acirc;N</strong></h3>\n\n<p>📍 Chi&ecirc;m ngưỡng <strong>những hang động khổng lồ với kh&ocirc;ng gian rộng lớn</strong>.<br />\n📍 Tận hưởng sự kỳ diệu của <strong>hệ sinh th&aacute;i hoang sơ v&agrave; độc nhất v&ocirc; nhị</strong>.</p>\n\n<h3><strong>🚶&zwj;♂️ 17:00 | QUAY TRỞ LẠI ĐIỂM XUẤT PH&Aacute;T</strong></h3>\n\n<p>📍 Kết th&uacute;c h&agrave;nh tr&igrave;nh kh&aacute;m ph&aacute;, di chuyển về lại cửa hang.</p>\n\n<h3><strong>🏡 19:00 | VỀ LẠI PHONG NHA &ndash; KẾT TH&Uacute;C TOUR</strong></h3>\n\n<p>📍 Xe đưa đo&agrave;n về lại <strong>Phong Nha</strong>, kết th&uacute;c chuyến đi đầy trải nghiệm.<br />\n📍 Tạm biệt đo&agrave;n, hẹn gặp lại trong những h&agrave;nh tr&igrave;nh kh&aacute;m ph&aacute; tiếp theo!</p>\n\n<p><img src=\"data:image/jpeg;base64,\" style=\"height:533px; width:800px\" /></p>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2><strong>🎒 CHUẨN BỊ H&Agrave;NH TRANG</strong></h2>\n\n<p>✔ <strong>Trang phục:</strong> Gi&agrave;y trekking, quần &aacute;o giữ nhiệt, &aacute;o kho&aacute;c gi&oacute;, quần d&agrave;i chống nước.<br />\n✔ <strong>Trang bị:</strong> Ba l&ocirc; gọn nhẹ, đ&egrave;n pin đội đầu, &aacute;o mưa, t&uacute;i chống nước.<br />\n✔ <strong>Đồ ăn nhẹ:</strong> Thanh năng lượng, chocolate, tr&aacute;i c&acirc;y kh&ocirc;.<br />\n✔ <strong>Sức khỏe:</strong> Đảm bảo thể lực tốt, tập luyện trước chuyến đi để th&iacute;ch nghi với địa h&igrave;nh.<br />\n✔ <strong>Thời tiết:</strong> Kiểm tra dự b&aacute;o thời tiết trước h&agrave;nh tr&igrave;nh.</p>\n\n<p>📞 <strong>Hotline hỗ trợ: 0399 999 999</strong></p>\n\n<hr />\n<p>🔥 <strong>ĐẶT TOUR NGAY &ndash; KH&Aacute;M PH&Aacute; KỲ QUAN HANG ĐỘNG TUYỆT ĐẸP NHẤT THẾ GIỚI!</strong> 🔥</p>\n\n<p>🚀 <strong>Chinh phục Sơn Đo&ograve;ng &ndash; H&agrave;nh tr&igrave;nh kh&ocirc;ng d&agrave;nh cho người yếu tim!</strong> 🚀</p>\n\n<h3>&nbsp;</h3>\n', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1740854487/saoviet/tqafpyalgv5x3xt9ss3y.jpg', '<p><strong>&nbsp; &nbsp; &nbsp;Hang Sơn Đo&ograve;ng</strong>&nbsp;l&agrave; một hang động tự nhi&ecirc;n tại x&atilde; T&acirc;n Trạch, huyện Bố Trạch, tỉnh Quảng B&igrave;nh, Việt Nam. Hang Sơn Đo&ograve;ng được coi l&agrave; hang động tự nhi&ecirc;n lớn nhất thế giới đ&atilde; biết. Hang n&agrave;y nằm trong quần thể hang động Phong Nha-Kẻ B&agrave;ng. Hang Sơn Đo&ograve;ng l&agrave; một phần của hệ thống ngầm nối với hơn 150 động kh&aacute;c ở Việt Nam gần bi&ecirc;n giới với L&agrave;o.&nbsp;Thời b&aacute;o New York xếp hạng hang Sơn Đo&ograve;ng v&agrave;o vị tr&iacute; thứ 8 trong 52 địa danh trong danh s&aacute;ch những nơi n&ecirc;n đến năm 2014.</p>\n', 'Chinh phục Hang Sơn Đoòng (Quảng Bình)', 2500000, '2025-03-02 14:30:10.575950', 0);
INSERT INTO `tour` (`id`, `category_id`, `description`, `image`, `introduce`, `name`, `price`, `time_created`, `orders`) VALUES
('T25007', 1, '<h1>✨ <strong>H&Agrave;NH TR&Igrave;NH KH&Aacute;M PH&Aacute; QUY NHƠN &ndash; PH&Uacute; Y&Ecirc;N</strong> ✨</h1>\n\n<p>📍 <em>Thời gian: 4 ng&agrave;y 3 đ&ecirc;m</em><br />\n📍 <em>Khởi h&agrave;nh: H&agrave; Nội</em><br />\n📍 <em>Phương tiện: M&aacute;y bay + &Ocirc; t&ocirc;</em></p>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2><strong>🚩 NG&Agrave;Y 1 | H&Agrave; NỘI &ndash; QUY NHƠN</strong> <em>(Ăn trưa, tối)</em></h2>\n\n<h3><strong>✈️ 08:00 | KHỞI H&Agrave;NH ĐẾN QUY NHƠN</strong></h3>\n\n<p>📍 Xe v&agrave; hướng dẫn vi&ecirc;n đ&oacute;n Qu&yacute; kh&aacute;ch tại <strong>C&ocirc;ng vi&ecirc;n Thống Nhất</strong> (đường Trần Nh&acirc;n T&ocirc;ng).<br />\n📍 Di chuyển ra <strong>s&acirc;n bay Nội B&agrave;i</strong>, l&agrave;m thủ tục l&ecirc;n chuyến bay <strong>VN1623</strong> đến Quy Nhơn.</p>\n\n<h3><strong>🍽 13:00 | ĐẾN PH&Ugrave; C&Aacute;T &ndash; D&Ugrave;NG BỮA TRƯA</strong></h3>\n\n<p>📍 Hạ c&aacute;nh tại <strong>s&acirc;n bay Ph&ugrave; C&aacute;t</strong>, xe đưa đo&agrave;n về nh&agrave; h&agrave;ng d&ugrave;ng bữa trưa với <strong>đặc sản B&igrave;nh Định</strong>.</p>\n\n<h3><strong>🏛 14:30 | THAM QUAN DI T&Iacute;CH T&Acirc;Y SƠN</strong></h3>\n\n<p>📍 <strong>Nh&agrave; thờ Quang Trung &ndash; Điện thờ T&acirc;y Sơn Tam Kiệt</strong>: Chi&ecirc;m ngưỡng <strong>9 pho tượng d&aacute;t v&agrave;ng</strong>, t&igrave;m hiểu về phong tr&agrave;o T&acirc;y Sơn.<br />\n📍 <strong>Giếng Xưa &ndash; C&acirc;y Me Cổ Thụ</strong>: Cảm nhận kh&ocirc;ng kh&iacute; lịch sử nơi vua Quang Trung từng sinh sống.<br />\n📍 <strong>Xem trống trận &amp; V&otilde; thuật T&acirc;y Sơn</strong> &ndash; m&agrave;n biểu diễn v&otilde; cổ truyền đặc sắc của B&igrave;nh Định.</p>\n\n<h3><strong>🌅 16:00 | THAM QUAN GHỀNH R&Aacute;NG TI&Ecirc;N SA</strong></h3>\n\n<p>📍 <strong>Đồi Thi Nh&acirc;n</strong> &ndash; viếng mộ thi sĩ <strong>H&agrave;n Mặc Tử</strong>, nghe kể về cuộc đời v&agrave; thơ ca của &ocirc;ng.<br />\n📍 <strong>Dốc Mộng Cầm</strong> &ndash; nơi lưu dấu những vần thơ bất hủ.<br />\n📍 <strong>Ghềnh R&aacute;ng Ti&ecirc;n Sa</strong> &ndash; khung cảnh thi&ecirc;n nhi&ecirc;n h&ugrave;ng vĩ, b&atilde;i biển trong xanh.</p>\n\n<h3><strong>🏖 18:00 | NHẬN PH&Ograve;NG &ndash; NGHỈ NGƠI &ndash; TỰ DO TẮM BIỂN</strong></h3>\n\n<p>📍 Về kh&aacute;ch sạn, nhận ph&ograve;ng, nghỉ ngơi.<br />\n📍 Tự do tắm biển Quy Nhơn, thư gi&atilde;n tr&ecirc;n bờ c&aacute;t mịn m&agrave;ng.</p>\n\n<h3><strong>🍽 19:00 | ĂN TỐI &ndash; TỰ DO KH&Aacute;M PH&Aacute; QUY NHƠN</strong></h3>\n\n<p>📍 Thưởng thức <strong>ẩm thực địa phương</strong> tại nh&agrave; h&agrave;ng.<br />\n📍 Tự do kh&aacute;m ph&aacute; phố biển Quy Nhơn về đ&ecirc;m.</p>\n\n<p><img src=\"https://vcdn1-dulich.vnecdn.net/2022/06/17/4-QN-1583461845-1111-159316411-8526-8690-1655448391.jpg?w=0&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=f9TV9HVJkJrQrySM8d4u4A\" style=\"height:311px; width:500px\" /></p>\n\n<h2><strong>🚩 NG&Agrave;Y 2 | QUY NHƠN &ndash; TH&Aacute;P Đ&Ocirc;I &ndash; B&Aacute;N ĐẢO PHƯƠNG MAI &ndash; EO GI&Oacute;</strong> <em>(Ăn s&aacute;ng, trưa, tối tự t&uacute;c)</em></h2>\n\n<h3><strong>🌞 07:00 | ĂN S&Aacute;NG &ndash; KHỞI H&Agrave;NH THAM QUAN</strong></h3>\n\n<p>📍 Xe đ&oacute;n đo&agrave;n đi tham quan <strong>Th&aacute;p Đ&ocirc;i</strong> &ndash; di t&iacute;ch kiến tr&uacute;c Champa cổ k&iacute;nh.</p>\n\n<h3><strong>🌉 09:00 | THAM QUAN B&Aacute;N ĐẢO PHƯƠNG MAI</strong></h3>\n\n<p>📍 <strong>Chi&ecirc;m ngưỡng Cầu Thị Nại</strong> &ndash; c&acirc;y cầu vượt biển d&agrave;i nhất Việt Nam.<br />\n📍 <strong>Tắm biển tại B&atilde;i Dứa</strong> &ndash; h&ograve;a m&igrave;nh v&agrave;o l&agrave;n nước trong xanh.<br />\n📍 <strong>Lặn ngắm san h&ocirc;</strong> (chi ph&iacute; tự t&uacute;c) &ndash; kh&aacute;m ph&aacute; hệ sinh th&aacute;i biển phong ph&uacute; với hơn <strong>400 lo&agrave;i san h&ocirc; rực rỡ</strong>.</p>\n\n<h3><strong>🍽 12:00 | THƯỞNG THỨC ẨM THỰC BIỂN</strong></h3>\n\n<p>📍 D&ugrave;ng bữa trưa với <strong>hơn 8 m&oacute;n hải sản đặc sắc</strong> tại nh&agrave; h&agrave;ng ven biển.<br />\n📍 Nghỉ ngơi tại ph&ograve;ng nghỉ của nh&agrave; h&agrave;ng.</p>\n\n<h3><strong>🌅 15:00 | THAM QUAN EO GI&Oacute; &ndash; TỊNH X&Aacute; NGỌC H&Ograve;A</strong></h3>\n\n<p>📍 <strong>Eo Gi&oacute;</strong> &ndash; nơi c&oacute; <strong>ho&agrave;ng h&ocirc;n đẹp nhất Việt Nam</strong>, check-in khung cảnh biển xanh biếc.<br />\n📍 <strong>Chi&ecirc;m b&aacute;i Tịnh X&aacute; Ngọc H&ograve;a</strong> &ndash; tượng Phật đ&ocirc;i <strong>cao nhất Việt Nam</strong>.</p>\n\n<h3><strong>🌙 19:00 | TỰ DO KH&Aacute;M PH&Aacute; QUY NHƠN</strong> <em>(Tối tự t&uacute;c)</em></h3>\n\n<p>📍 Xe đưa đo&agrave;n về lại th&agrave;nh phố, tự do kh&aacute;m ph&aacute; ẩm thực v&agrave; phố biển Quy Nhơn về đ&ecirc;m.<br />\n📍 Nghỉ đ&ecirc;m tại kh&aacute;ch sạn Quy Nhơn.</p>\n\n<p><img src=\"https://i1-dulich.vnecdn.net/2022/06/17/eogio-chimom-4705-1593164115-1-6736-5082-1655448397.jpg?w=0&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=cn5aRoYGDxku2K2zk8qm-w\" style=\"height:399px; width:600px\" /></p>\n\n<h2><strong>🚩 NG&Agrave;Y 3 | QUY NHƠN &ndash; PH&Uacute; Y&Ecirc;N &ndash; G&Agrave;NH Đ&Aacute; ĐĨA &ndash; B&Atilde;I X&Eacute;P</strong> <em>(Ăn s&aacute;ng, trưa, tối)</em></h2>\n\n<h3><strong>🌞 07:00 | ĂN S&Aacute;NG &ndash; TRẢ PH&Ograve;NG &ndash; KHỞI H&Agrave;NH ĐI PH&Uacute; Y&Ecirc;N</strong></h3>\n\n<p>📍 L&ecirc;n đường kh&aacute;m ph&aacute; <strong>Ph&uacute; Y&ecirc;n</strong>, v&ugrave;ng đất hoang sơ tuyệt đẹp.</p>\n\n<h3><strong>🗿 10:00 | THAM QUAN G&Agrave;NH Đ&Aacute; ĐĨA</strong></h3>\n\n<p>📍 Chi&ecirc;m ngưỡng <strong>Di t&iacute;ch Quốc gia G&agrave;nh Đ&aacute; Đĩa</strong> &ndash; những khối đ&aacute; xếp tầng kỳ vĩ như tổ ong khổng lồ.</p>\n\n<h3><strong>🍽 12:00 | ĂN TRƯA TẠI ĐẦM &Ocirc; LOAN</strong></h3>\n\n<p>📍 Thưởng thức <strong>hải sản tươi ngon</strong> tại v&ugrave;ng đầm ph&aacute; nổi tiếng của Ph&uacute; Y&ecirc;n.</p>\n\n<h3><strong>📸 14:00 | CHECK-IN C&Aacute;C ĐỊA ĐIỂM TUYỆT ĐẸP</strong></h3>\n\n<p>📍 <strong>G&agrave;nh &Ocirc;ng &ndash; B&atilde;i X&eacute;p</strong>: địa điểm quay phim <em>&quot;T&ocirc;i Thấy Hoa V&agrave;ng Tr&ecirc;n Cỏ Xanh&quot;</em>.<br />\n📍 <strong>Vịnh Vũng R&ocirc;</strong>: bến t&agrave;u kh&ocirc;ng số huyền thoại.<br />\n📍 <strong>Hải Đăng Mũi Điện</strong>: cực Đ&ocirc;ng của Việt Nam, nơi đ&oacute;n b&igrave;nh minh sớm nhất cả nước.</p>\n\n<h3><strong>🌙 19:00 | ĂN TỐI &ndash; NGHỈ Đ&Ecirc;M TẠI PH&Uacute; Y&Ecirc;N</strong></h3>\n\n<p>📍 D&ugrave;ng bữa tối tại kh&aacute;ch sạn, tự do kh&aacute;m ph&aacute; biển Tuy H&ograve;a về đ&ecirc;m.</p>\n\n<p><img src=\"https://i1-dulich.vnecdn.net/2022/06/17/Ride-iyle-1-4555-1593164111-56-7007-2380-1655448395.png?w=0&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=n4gszbBV8qB1dM-5jDaAAg\" style=\"height:387px; width:500px\" /></p>\n\n<h2><strong>🚩 NG&Agrave;Y 4 | PH&Uacute; Y&Ecirc;N &ndash; H&Agrave; NỘI</strong> <em>(Ăn s&aacute;ng, ăn nhẹ trưa)</em></h2>\n\n<h3><strong>🌞 07:00 | ĂN S&Aacute;NG &ndash; CHECK-IN C&Aacute;C ĐỊA DANH BIỂU TƯỢNG</strong></h3>\n\n<p>📍 <strong>Th&aacute;p Nhạn</strong> &ndash; di t&iacute;ch kiến tr&uacute;c Chăm cổ k&iacute;nh.<br />\n📍 <strong>Th&aacute;p Nghinh Phong</strong> &ndash; biểu tượng hiện đại của Tuy H&ograve;a, lấy cảm hứng từ Ghềnh Đ&aacute; Đĩa.</p>\n\n<h3><strong>🍽 12:00 | ĂN NHẸ &ndash; DI CHUYỂN RA S&Acirc;N BAY</strong></h3>\n\n<p>📍 Thưởng thức bữa trưa nhẹ trước khi ra s&acirc;n bay <strong>Tuy H&ograve;a</strong>.</p>\n\n<h3><strong>✈️ 14:10 | BAY VỀ H&Agrave; NỘI</strong></h3>\n\n<p>📍 Đ&aacute;p chuyến bay <strong>VN1650</strong> về H&agrave; Nội.<br />\n📍 Xe đ&oacute;n đo&agrave;n tại <strong>s&acirc;n bay Nội B&agrave;i</strong>, đưa về điểm hẹn ban đầu.<br />\n📍 <strong>Kết th&uacute;c h&agrave;nh tr&igrave;nh &ndash; Hẹn gặp lại!</strong></p>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2><strong>🎒 CHUẨN BỊ H&Agrave;NH TRANG</strong></h2>\n\n<p>✔ <strong>Trang phục:</strong> Đồ thoải m&aacute;i, gi&agrave;y thể thao, đồ bơi, &aacute;o kho&aacute;c nhẹ.<br />\n✔ <strong>Đồ d&ugrave;ng c&aacute; nh&acirc;n:</strong> Mũ, k&iacute;nh r&acirc;m, kem chống nắng, thuốc c&aacute; nh&acirc;n.<br />\n✔ <strong>Thiết bị:</strong> M&aacute;y ảnh, điện thoại, sạc dự ph&ograve;ng.</p>\n\n<p>📞 <strong>HOTLINE ĐẶT TOUR: 0399 999 999</strong></p>\n\n<p>🔥 <strong>ĐẶT TOUR NGAY &ndash; KH&Aacute;M PH&Aacute; QUY NHƠN &amp; PH&Uacute; Y&Ecirc;N TUYỆT ĐẸP!</strong> 🔥</p>\n', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1741111366/saoviet/adhj42nfezffszpkpwbp.jpg', '<p><em><strong>&nbsp; &nbsp; &nbsp;Quy Nhơn</strong> &ndash; Th&agrave;nh phố trung t&acirc;m của Tỉnh B&igrave;nh Định với bờ biển d&agrave;i, chạy quanh th&agrave;nh phố, được đ&aacute;nh gi&aacute; l&agrave; một trong những b&atilde;i biển đẹp nhất Miền Trung. Với th&agrave;nh Đồ B&agrave;n &ndash; Kinh đ&ocirc; cũ của đất nước Champa vẫn c&ograve;n đ&oacute; những n&eacute;t vết t&iacute;ch cổ k&iacute;nh, r&ecirc;u phong. Th&aacute;p Đ&ocirc;i, cụm kiến tr&uacute;c Th&aacute;p Chăm đặc sắc độc đ&aacute;o bậc nhất B&igrave;nh Đ&igrave;nh, nằm ẩn m&igrave;nh trong 1 th&agrave;nh phố năng động hiếu kh&aacute;ch. Đến Tuy H&ograve;a, qu&yacute; kh&aacute;ch nhất định phải gh&eacute; đến G&agrave;nh Đ&aacute; Đĩa &ndash; Thắng cảnh độc nhất v&ocirc; nhị của Việt Nam.</em></p>\n', 'Tour Du lịch Quy Nhơn - Phú Yên', 3200000, '2025-03-05 01:20:34.555247', 0),
('T25008', 1, '<h1>✨ <strong>H&Agrave;NH TR&Igrave;NH KH&Aacute;M PH&Aacute; NHA TRANG</strong>&nbsp;🌊</h1>\n\n<p>📍 <em>Thời gian: 3 ng&agrave;y 2 đ&ecirc;m</em><br />\n📍 <em>Khởi h&agrave;nh: H&agrave; Nội</em><br />\n📍 <em>Phương tiện: M&aacute;y bay + &Ocirc; t&ocirc;</em></p>\n\n<hr />\n<p>&nbsp;</p>\n\n<h3><strong>✈️ NG&Agrave;Y 1 | H&Agrave; NỘI &ndash; NHA TRANG &ndash; TẮM B&Ugrave;N KHO&Aacute;NG (Ăn trưa, tối)</strong></h3>\n\n<p><strong>⏰ 06h30</strong>: Xe v&agrave; Hướng dẫn vi&ecirc;n (HDV) đ&oacute;n Qu&yacute; kh&aacute;ch tại <strong>Cổng C&ocirc;ng Vi&ecirc;n Thống Nhất</strong> &ndash; Đường Trần Nh&acirc;n T&ocirc;ng &ndash; Quận Hai B&agrave; Trưng &ndash; TP. H&agrave; Nội. Khởi h&agrave;nh đến s&acirc;n bay <strong>Nội B&agrave;i</strong>, đ&aacute;p chuyến bay ✈️ <strong>VN1553</strong> đi Nha Trang l&uacute;c <strong>09h50</strong>.</p>\n\n<p><strong>⏰ 11h50</strong>: Đến s&acirc;n bay <strong>Cam Ranh</strong>, xe v&agrave; HDV địa phương đ&oacute;n đo&agrave;n đi ăn trưa tại nh&agrave; h&agrave;ng. Sau đ&oacute;, đo&agrave;n về trung t&acirc;m <strong>TP. Nha Trang</strong> nhận ph&ograve;ng kh&aacute;ch sạn nghỉ ngơi. 🏨</p>\n\n<p><strong>🌅 Buổi chiều:</strong> Đo&agrave;n tham quan:</p>\n\n<ul>\n	<li><strong>🏛️ Th&aacute;p B&agrave; Ponagar</strong>: Một trong những c&ocirc;ng tr&igrave;nh cổ k&iacute;nh của người Chăm nằm cạnh <strong>s&ocirc;ng C&aacute;i</strong>. Tại đ&acirc;y, qu&yacute; kh&aacute;ch c&oacute; thể chi&ecirc;m ngưỡng kiến tr&uacute;c độc đ&aacute;o, thưởng thức những điệu m&uacute;a Chăm truyền thống v&agrave; t&igrave;m hiểu nghề l&agrave;m gốm, dệt vải cổ truyền.</li>\n	<li><strong>🛁 Tắm b&ugrave;n kho&aacute;ng I-resort</strong> (Chi ph&iacute; tự t&uacute;c): Trải nghiệm liệu tr&igrave;nh &ocirc;n truyền thủy liệu ph&aacute;p gi&uacute;p thư gi&atilde;n, tắm b&ugrave;n, tắm kho&aacute;ng n&oacute;ng, jacuzzi...</li>\n</ul>\n\n<p><strong>🍽️ 19h00</strong>: Đo&agrave;n d&ugrave;ng bữa tối tại nh&agrave; h&agrave;ng. Buổi tối, qu&yacute; kh&aacute;ch c&oacute; thể tự do dạo bước b&ecirc;n <strong>phố biển</strong>, kh&aacute;m ph&aacute; <strong>ẩm thực đường phố Nha Trang</strong>. 🌊🍢</p>\n\n<p><strong>🏨 Nghỉ đ&ecirc;m tại kh&aacute;ch sạn Nha Trang.</strong></p>\n\n<p><img alt=\"Máy bay đi Nha Trang\" src=\"https://static.vinwonders.com/2022/11/du-lich-nha-trang-2.jpg\" style=\"height:281px; width:500px\" /></p>\n\n<h3>🚤 <strong>NG&Agrave;Y 2 | KH&Aacute;M PH&Aacute; BIỂN ĐẢO NHA TRANG (Ăn s&aacute;ng, trưa, tối tự t&uacute;c)</strong></h3>\n\n<p><strong>🍽️ S&aacute;ng:</strong> Qu&yacute; kh&aacute;ch ăn s&aacute;ng tại kh&aacute;ch sạn.</p>\n\n<p><strong>⏰ 07h30</strong>: Xe đưa đo&agrave;n đến <strong>Cảng Cầu Đ&aacute;</strong>, bắt đầu h&agrave;nh tr&igrave;nh kh&aacute;m ph&aacute; <strong>Vịnh Nha Trang</strong> &ndash; một trong <strong>29 vịnh đẹp nhất thế giới</strong>.</p>\n\n<ul>\n	<li><strong>🐠 L&agrave;ng Ch&agrave;i</strong>: Tham quan hệ thống nu&ocirc;i trồng hải sản với v&ocirc; số loại hải sản tươi ngon như <strong>t&ocirc;m h&ugrave;m, b&agrave;o ngư, mực l&aacute;, tu h&agrave;i, s&ograve; biển</strong>...</li>\n	<li><strong>🏖️ B&atilde;i Tranh</strong>: Một trong những b&atilde;i biển nổi tiếng nhất tại đảo H&ograve;n Miễu. Qu&yacute; kh&aacute;ch c&oacute; thể <strong>tắm biển</strong>, <strong>thư gi&atilde;n tr&ecirc;n ghế d&agrave;i</strong>, <strong>check-in với c&acirc;y cầu đầy m&agrave;u sắc</strong> 🌈.</li>\n	<li><strong>🏝️ H&ograve;n Sẻ Tre</strong>: Đo&agrave;n d&ugrave;ng bữa trưa tại nh&agrave; h&agrave;ng. Qu&yacute; kh&aacute;ch tự do nghỉ ngơi tr&ecirc;n ghế b&ecirc;n bờ biển, trải nghiệm kh&ocirc;ng gian kiến tr&uacute;c tre nứa <strong>mộc mạc, gần gũi thi&ecirc;n nhi&ecirc;n</strong>.</li>\n</ul>\n\n<p><strong>🎯 Trải nghiệm đặc sắc (Chi ph&iacute; tự t&uacute;c):</strong></p>\n\n<ul>\n	<li>🛶 Ch&egrave;o thuyền <strong>Kayak</strong> quanh đảo</li>\n	<li>🏊 Bơi ngắm <strong>san h&ocirc;</strong> với dụng cụ k&iacute;nh lặn</li>\n	<li>🤿 <strong>Lặn biển b&igrave;nh dưỡng kh&iacute;</strong>, đi bộ dưới đ&aacute;y biển</li>\n	<li>🌊 <strong>D&ugrave; bay, phao chuối, m&ocirc; t&ocirc; nước</strong>...</li>\n</ul>\n\n<p><strong>🎡 16h00:</strong> Cano đưa kh&aacute;ch đến <strong>Vinpearl Land &ndash; H&ograve;n Ngọc Việt</strong> (chi ph&iacute; tự t&uacute;c). Qu&yacute; kh&aacute;ch tự do kh&aacute;m ph&aacute; c&aacute;c tr&ograve; chơi hấp dẫn như:</p>\n\n<ul>\n	<li>🎢 <strong>Quay nh&agrave;o lộn, t&agrave;u lượn si&ecirc;u tốc</strong></li>\n	<li>🎥 <strong>Xem phim 4D, kh&aacute;m ph&aacute; thủy cung</strong></li>\n	<li>🌊 <strong>C&ocirc;ng vi&ecirc;n nước, c&ocirc;ng vi&ecirc;n giải tr&iacute; hiện đại</strong></li>\n</ul>\n\n<p><strong>⏰ 18h00</strong>: Qu&yacute; kh&aacute;ch tự t&uacute;c ăn tối tại <strong>VinWonders Nha Trang</strong> v&agrave; thưởng thức chương tr&igrave;nh biểu diễn <strong>nhạc nước</strong> đặc sắc.</p>\n\n<p><strong>⏰ 20h30</strong>: L&ecirc;n <strong>c&aacute;p treo</strong> v&agrave; xe đ&oacute;n về kh&aacute;ch sạn nghỉ ngơi.</p>\n\n<p><strong>🏨 Nghỉ đ&ecirc;m tại kh&aacute;ch sạn Nha Trang.</strong></p>\n\n<p><img alt=\"Tàu, cano khám phá Nha Trang\" src=\"https://static.vinwonders.com/2022/11/du-lich-nha-trang-4.jpg\" style=\"height:354px; margin-left:50px; margin-right:50px; width:712px\" /><img alt=\"Tháp bà Ponagar\" src=\"https://static.vinwonders.com/2022/11/du-lich-nha-trang-Thap-Ba-Ponagar.jpg\" style=\"height:354px; width:500px\" /></p>\n\n<h3><strong>🏛️ NG&Agrave;Y 3 | NHA TRANG &ndash; H&Agrave; NỘI (Ăn s&aacute;ng, trưa)</strong></h3>\n\n<p><strong>🍽️ S&aacute;ng:</strong> Qu&yacute; kh&aacute;ch d&ugrave;ng bữa s&aacute;ng tại kh&aacute;ch sạn, sau đ&oacute; l&agrave;m <strong>thủ tục trả ph&ograve;ng</strong>.</p>\n\n<p><strong>⏰ 08h00:</strong> Xe đưa đo&agrave;n tham quan:</p>\n\n<ul>\n	<li><strong>⛪ Nh&agrave; thờ Ch&aacute;nh T&ograve;a (Nh&agrave; thờ N&uacute;i)</strong>: Nằm tr&ecirc;n một ngọn đồi, với kiến tr&uacute;c độc đ&aacute;o từ xi măng tạo n&ecirc;n vẻ đẹp cổ k&iacute;nh.</li>\n	<li><strong>🛕 Ch&ugrave;a Long Sơn</strong>: Một trong 20 ng&ocirc;i ch&ugrave;a lớn tại Nha Trang, nổi bật với <strong>tượng Kim Th&acirc;n Phật Tổ</strong> cao 24m tr&ecirc;n đồi Thủy Trại.</li>\n</ul>\n\n<p><strong>🛍️ Tự do mua sắm</strong> đặc sản Nha Trang l&agrave;m qu&agrave;.</p>\n\n<p><strong>⏰ 11h00:</strong> Đo&agrave;n ăn trưa tại nh&agrave; h&agrave;ng.</p>\n\n<p><strong>⏰ 13h00:</strong> Xe đưa đo&agrave;n ra <strong>s&acirc;n bay Cam Ranh</strong>, đ&aacute;p chuyến bay ✈️ <strong>VN1558 l&uacute;c 15h40</strong> về H&agrave; Nội.</p>\n\n<p><strong>⏰ 18h00:</strong> Về đến s&acirc;n bay <strong>Nội B&agrave;i</strong>, xe v&agrave; HDV đưa đo&agrave;n về điểm đ&oacute;n ban đầu.</p>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2><strong>🎒 CHUẨN BỊ H&Agrave;NH TRANG</strong></h2>\n\n<p>✔ <strong>Trang phục:</strong> Đồ thoải m&aacute;i, gi&agrave;y thể thao, đồ bơi, &aacute;o kho&aacute;c nhẹ.<br />\n✔ <strong>Đồ d&ugrave;ng c&aacute; nh&acirc;n:</strong> Mũ, k&iacute;nh r&acirc;m, kem chống nắng, thuốc c&aacute; nh&acirc;n.<br />\n✔ <strong>Thiết bị:</strong> M&aacute;y ảnh, điện thoại, sạc dự ph&ograve;ng.</p>\n\n<p>📞 <strong>HOTLINE ĐẶT TOUR: 0399 999 999</strong></p>\n\n<p>🔥 <strong>ĐẶT TOUR NGAY &ndash; KH&Aacute;M PH&Aacute; NHA TRANG TUYỆT ĐẸP!</strong> 🔥</p>\n', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1741114400/saoviet/rhbtczaap0futc5fhmpe.jpg', '<p><strong><em>&nbsp; &nbsp; &nbsp;Nha Trang,</em></strong><em>&nbsp;th&agrave;nh phố biển với c&aacute;t trắng, quanh năm s&oacute;ng vỗ r&igrave; r&agrave;o, được v&iacute; như Địa Trung Hải của Việt Nam. Đến Nha Trang, du kh&aacute;ch kh&ocirc;ng chỉ được tận hưởng những ng&agrave;y nghỉ biển tuyệt vời b&ecirc;n bờ biển trải d&agrave;i, bầu trời xanh ngắt&hellip; m&agrave; du kh&aacute;ch c&ograve;n được trải nghiệm những dịch vụ vui chơi giải tr&iacute; đẳng cấp h&agrave;ng đầu Việt Nam.&nbsp;</em></p>\n', 'Du lịch Nha Trang', 5000000, '2025-03-05 01:53:19.164376', 0);
INSERT INTO `tour` (`id`, `category_id`, `description`, `image`, `introduce`, `name`, `price`, `time_created`, `orders`) VALUES
('T25009', 2, '<h1><strong>🏞 TOUR MAI CH&Acirc;U 1 NG&Agrave;Y - KH&Aacute;M PH&Aacute; BẢN L&Aacute;C</strong></h1>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>🕖 07h00 | Xuất ph&aacute;t từ H&agrave; Nội</strong></h3>\n\n<p>🚐 Xe v&agrave; hướng dẫn vi&ecirc;n (HDV) đ&oacute;n qu&yacute; kh&aacute;ch tại điểm hẹn, điểm danh qu&acirc;n số v&agrave; khởi h&agrave;nh đi <strong>Mai Ch&acirc;u</strong>.<br />\n📢 Tr&ecirc;n xe, HDV giới thiệu về lịch sử, văn h&oacute;a v&agrave; những n&eacute;t độc đ&aacute;o của v&ugrave;ng đất T&acirc;y Bắc.</p>\n\n<h3><strong>🕙 10h00 | Kh&aacute;m ph&aacute; Bản L&aacute;c</strong></h3>\n\n<p>🏡 Đến <strong>Mai Ch&acirc;u</strong>, qu&yacute; kh&aacute;ch tham quan <strong>Bản L&aacute;c</strong>, t&igrave;m hiểu đời sống v&agrave; văn h&oacute;a người Th&aacute;i qua c&aacute;c hoạt động:<br />\n🧶 <strong>Dệt vải</strong> truyền thống<br />\n💃 <strong>M&uacute;a x&ograve;e Th&aacute;i</strong><br />\n🏠 <strong>Tham quan nh&agrave; s&agrave;n cổ</strong></p>\n\n<p><img alt=\"Ấn tượng vẻ đẹp tiềm ẩn của Bản Lác Mai Châu - Xelinhan.vn\" src=\"data:image/jpeg;base64,\" style=\"height:333px; width:500px\" /></p>\n\n<h3><strong>🍽 12h00 | Thưởng thức đặc sản Mai Ch&acirc;u</strong></h3>\n\n<p>🥢 Qu&yacute; kh&aacute;ch thưởng thức <strong>bữa trưa tại nh&agrave; h&agrave;ng địa phương</strong>, với c&aacute;c m&oacute;n ăn đặc sản v&ugrave;ng T&acirc;y Bắc:<br />\n🍚 <strong>Cơm lam</strong> - Gạo nếp dẻo thơm nướng trong ống tre<br />\n🍢 <strong>Thịt nướng l&aacute; mắc mật</strong> - Hương vị n&uacute;i rừng<br />\n🥗 <strong>Nộm hoa chuối</strong></p>\n\n<h3><strong>🎉 14h00 | Tham gia Team Building vui nhộn</strong></h3>\n\n<p>🏆 Qu&yacute; kh&aacute;ch tham gia chương tr&igrave;nh <strong>Team Building</strong> do Tour tổ chức với nhiều <strong>tr&ograve; chơi d&acirc;n gian &amp; hoạt động tập thể</strong>:<br />\n🎭 <strong>Bịt mắt bắt d&ecirc;</strong><br />\n🛶 <strong>Đi c&agrave; kheo</strong><br />\n🏹 <strong>N&eacute;m c&ograve;n - Tr&ograve; chơi truyền thống d&acirc;n tộc Th&aacute;i</strong></p>\n\n<p><img alt=\"Tour MAI CHÂU Giá Rẻ Review Kinh Nghiệm Du Lịch 2024 - Tour.Pro.Vn\" src=\"data:image/jpeg;base64,\" style=\"height:361px; width:500px\" /></p>\n\n<h3><strong>🚗 16h00 | Trở về H&agrave; Nội - Mua sắm đặc sản</strong></h3>\n\n<p>🛍 Xe đưa đo&agrave;n về lại H&agrave; Nội. Tr&ecirc;n đường, dừng ch&acirc;n tại điểm nghỉ để qu&yacute; kh&aacute;ch <strong>mua đặc sản Mai Ch&acirc;u</strong> về l&agrave;m qu&agrave;:<br />\n🌰 <strong>Hạt dổi - Gia vị đặc trưng T&acirc;y Bắc</strong><br />\n🍯 <strong>Mật ong rừng</strong><br />\n🥓 <strong>Thịt tr&acirc;u g&aacute;c bếp</strong></p>\n\n<h3><strong>🏡 19h00 | Kết th&uacute;c h&agrave;nh tr&igrave;nh</strong></h3>\n\n<p>🚐 Xe đưa đo&agrave;n về điểm đ&oacute;n ban đầu. HDV gửi lời cảm ơn v&agrave; <strong>hẹn gặp lại qu&yacute; kh&aacute;ch trong c&aacute;c h&agrave;nh tr&igrave;nh tiếp theo!</strong> 🌟</p>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2><strong>🎒 CHUẨN BỊ H&Agrave;NH TRANG</strong></h2>\n\n<p>✔ <strong>Trang phục:</strong> Đồ thoải m&aacute;i, gi&agrave;y thể thao, đồ bơi, &aacute;o kho&aacute;c nhẹ.<br />\n✔ <strong>Đồ d&ugrave;ng c&aacute; nh&acirc;n:</strong> Mũ, k&iacute;nh r&acirc;m, kem chống nắng, thuốc c&aacute; nh&acirc;n.<br />\n✔ <strong>Thiết bị:</strong> M&aacute;y ảnh, điện thoại, sạc dự ph&ograve;ng.</p>\n\n<p>📞 <strong>HOTLINE ĐẶT TOUR: 0399 999 999</strong></p>\n', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1741112730/saoviet/mg3hpg3pmro8tlbpayal.jpg', '<p><strong>&nbsp; &nbsp; &nbsp;Mai Ch&acirc;u</strong>, một thung lũng xanh m&aacute;t thuộc tỉnh H&ograve;a B&igrave;nh, l&agrave; nơi cư tr&uacute; của c&aacute;c d&acirc;n tộc Th&aacute;i, Mường. Với khung cảnh thi&ecirc;n nhi&ecirc;n thơ mộng, những nếp nh&agrave; s&agrave;n truyền thống v&agrave; l&ograve;ng hiếu kh&aacute;ch của người d&acirc;n, Mai Ch&acirc;u trở th&agrave;nh điểm đến l&yacute; tưởng cho du kh&aacute;ch muốn kh&aacute;m ph&aacute; văn h&oacute;a bản địa v&agrave; thư gi&atilde;n giữa thi&ecirc;n nhi&ecirc;n.</p>\n', 'Tour Văn Hóa Mai Châu - Hòa Bình', 500000, '2025-03-05 01:28:56.206433', 0);
INSERT INTO `tour` (`id`, `category_id`, `description`, `image`, `introduce`, `name`, `price`, `time_created`, `orders`) VALUES
('T25010', 4, '<h1><strong>🌊 TOUR LẶN BIỂN - KH&Aacute;M PH&Aacute; VỊNH NHA TRANG 🤿</strong></h1>\n\n<hr />\n<h3>&nbsp;</h3>\n\n<h3><strong>🕖 07:00 | Tập trung &amp; chuẩn bị</strong></h3>\n\n<p>📍 <strong>Địa điểm:</strong> Cảng Nha Trang<br />\n🛠 Qu&yacute; kh&aacute;ch tập trung tại cảng, nhận trang thiết bị lặn v&agrave; tham gia <strong>buổi hướng dẫn an to&agrave;n</strong> từ c&aacute;c huấn luyện vi&ecirc;n chuy&ecirc;n nghiệp.</p>\n\n<h3><strong>🕗 08:00 | Khởi h&agrave;nh ra biển</strong></h3>\n\n<p>🚤 L&ecirc;n thuyền bắt đầu h&agrave;nh tr&igrave;nh kh&aacute;m ph&aacute; <strong>vịnh Nha Trang</strong>, một trong 29 vịnh đẹp nhất thế giới.<br />\n🌊 Tr&ecirc;n đường đi, qu&yacute; kh&aacute;ch c&oacute; thể ngắm cảnh biển xanh trong v&agrave; tận hưởng kh&ocirc;ng kh&iacute; trong l&agrave;nh.</p>\n\n<p><img alt=\"Lặn biển Nha Trang\" src=\"https://statics.vinpearl.com/lan-bien-nha-trang-02_1635674540.jpg\" style=\"height:330px; width:500px\" /></p>\n\n<h3><strong>🕘 09:00 | Đến khu vực lặn - Xuống nước</strong></h3>\n\n<p>🤿 Qu&yacute; kh&aacute;ch đến <strong>điểm lặn đầu ti&ecirc;n</strong>, bắt đầu trải nghiệm lặn biển với sự hướng dẫn tận t&igrave;nh của huấn luyện vi&ecirc;n.<br />\n🐡 L&agrave;m quen với m&ocirc;i trường dưới nước, kiểm tra thiết bị v&agrave; thực h&agrave;nh kỹ thuật lặn.</p>\n\n<h3><strong>🕙 10:00 | Kh&aacute;m ph&aacute; đ&aacute;y biển &amp; rạn san h&ocirc;</strong></h3>\n\n<p>🐠 <strong>Lặn xuống độ s&acirc;u th&iacute;ch hợp</strong> để chi&ecirc;m ngưỡng những rạn <strong>san h&ocirc; rực rỡ</strong> v&agrave; hệ sinh th&aacute;i biển phong ph&uacute;.<br />\n📸 Qu&yacute; kh&aacute;ch c&oacute; thể <strong>chụp ảnh dưới nước</strong> để lưu giữ những khoảnh khắc đ&aacute;ng nhớ.</p>\n\n<p><img alt=\"tour lặn biển nha trang\" src=\"https://bizweb.dktcdn.net/100/422/449/files/lan-bien-hon-mun2-1.jpg?v=1620204206977\" style=\"height:333px; width:500px\" /></p>\n\n<h3><strong>🍽 12:00 | Nghỉ ngơi &amp; ăn trưa tr&ecirc;n thuyền</strong></h3>\n\n<p>🥪 Thưởng thức <strong>bữa trưa nhẹ</strong> với hải sản tươi ngon &amp; c&aacute;c m&oacute;n ăn đặc trưng v&ugrave;ng biển.<br />\n🌴 Nghỉ ngơi tr&ecirc;n thuyền, tận hưởng l&agrave;n gi&oacute; biển m&aacute;t l&agrave;nh.</p>\n\n<h3><strong>🕐 13:00 | Lặn biển lần 2 - Chinh phục v&ugrave;ng biển mới</strong></h3>\n\n<p>🏝 Tiếp tục <strong>chuyến lặn tại khu vực kh&aacute;c</strong> trong vịnh Nha Trang.<br />\n🦑 Quan s&aacute;t th&ecirc;m nhiều lo&agrave;i sinh vật biển độc đ&aacute;o, tận hưởng cảm gi&aacute;c bồng bềnh giữa đại dương.</p>\n\n<p><img alt=\"Lặn biển Nha Trang\" src=\"https://statics.vinpearl.com/lan-bien-nha-trang-04_1635674626.jpg\" style=\"height:500px; width:500px\" /></p>\n\n<h3><strong>🕒 15:00 | Thư gi&atilde;n &amp; hoạt động giải tr&iacute; tr&ecirc;n biển</strong></h3>\n\n<p>🚣&zwj;♂️ <strong>Tham gia ch&egrave;o thuyền kayak</strong> tr&ecirc;n mặt biển trong xanh.<br />\n🌊 Tự do <strong>bơi lội &amp; tắm nắng</strong>, h&ograve;a m&igrave;nh v&agrave;o thi&ecirc;n nhi&ecirc;n.</p>\n\n<h3><strong>🕓 16:00 | Kết th&uacute;c chuyến đi</strong></h3>\n\n<p>🚤 Qu&yacute; kh&aacute;ch l&ecirc;n thuyền <strong>quay trở lại cảng Nha Trang</strong>, kết th&uacute;c chuyến đi đầy trải nghiệm.<br />\n📍 <strong>Trả kh&aacute;ch tại điểm tập trung ban đầu</strong>, hướng dẫn vi&ecirc;n cảm ơn v&agrave; hẹn gặp lại trong những h&agrave;nh tr&igrave;nh tiếp theo!</p>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2><strong>🎒 CHUẨN BỊ H&Agrave;NH TRANG</strong></h2>\n\n<p>✔ <strong>Trang phục:</strong> Đồ thoải m&aacute;i, gi&agrave;y thể thao, đồ bơi, &aacute;o kho&aacute;c nhẹ.<br />\n✔ <strong>Đồ d&ugrave;ng c&aacute; nh&acirc;n:</strong> Mũ, k&iacute;nh r&acirc;m, kem chống nắng, thuốc c&aacute; nh&acirc;n.<br />\n✔ <strong>Thiết bị:</strong> M&aacute;y ảnh, điện thoại, sạc dự ph&ograve;ng.</p>\n\n<p>📞 <strong>HOTLINE ĐẶT TOUR: 0399 999 999</strong></p>\n', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1741114549/saoviet/ab7ezp9qauvnh17klmvp.jpg', '<p>&nbsp; &nbsp; &nbsp;Đến với b&atilde;i biển <strong><em>Nha Trang</em></strong> kh&ocirc;ng chỉ được đắm m&igrave;nh trong khung cảnh thi&ecirc;n nhi&ecirc;n h&ugrave;ng vĩ, tuyệt mĩ v&agrave; l&agrave;n nước biển trong xanh thơ mộng, kh&aacute;ch thăm quan c&ograve;n được trải nghiệm rất nhiều những dịch vụ ho&agrave;n hảo khi tới với nơi n&agrave;y. B&atilde;i biển <strong><em>Nha Trang</em></strong> đ&atilde; v&agrave; đang trở th&agrave;nh một trong những điểm tham quan v&agrave; trải nghiệm ấn tượng nhất trong h&agrave;nh tr&igrave;nh kh&aacute;m ph&aacute; Nha Trang của bạn.</p>\n', 'Lặn biển Nha Trang', 1000000, '2025-03-05 01:55:48.617856', 0),
('T25011', 1, '<h1><strong>🌴 TOUR KH&Aacute;M PH&Aacute; PH&Uacute; QUỐC 4N3Đ 🌊</strong></h1>\n\n<p><em>(Bao gồm ăn s&aacute;ng, trưa, tối theo lịch tr&igrave;nh)</em></p>\n\n<hr />\n<h2>&nbsp;</h2>\n\n<h2><strong>🛫 NG&Agrave;Y 1 | H&Agrave; NỘI ✈ PH&Uacute; QUỐC &ndash; KH&Aacute;M PH&Aacute; Đ&Ocirc;NG ĐẢO</strong></h2>\n\n<h3><strong>🕖 S&aacute;ng:</strong></h3>\n\n<ul>\n	<li>Xe &amp; HDV đ&oacute;n qu&yacute; kh&aacute;ch tại điểm hẹn, di chuyển ra <strong>s&acirc;n bay Nội B&agrave;i</strong>.</li>\n	<li>HDV hỗ trợ l&agrave;m thủ tục l&ecirc;n chuyến bay <strong>VJ459 l&uacute;c 07h05</strong> đi Ph&uacute; Quốc.</li>\n</ul>\n\n<h3><strong>🕘 09:05 | Đến Ph&uacute; Quốc &ndash; Tham quan Đ&ocirc;ng Đảo</strong></h3>\n\n<ul>\n	<li><strong>Suối Tranh</strong> &ndash; Thắng cảnh thi&ecirc;n nhi&ecirc;n tuyệt đẹp (<em>m&ugrave;a nước từ th&aacute;ng 5 đến th&aacute;ng 10</em>).</li>\n	<li><strong>L&agrave;ng ch&agrave;i H&agrave;m Ninh</strong> &ndash; Đi dạo cầu cảng, thưởng thức hải sản tươi sống (<em>chi ph&iacute; tự t&uacute;c</em>).</li>\n</ul>\n\n<h3><strong>🍽 12:00 | Ăn trưa &amp; nhận ph&ograve;ng kh&aacute;ch sạn</strong></h3>\n\n<ul>\n	<li>D&ugrave;ng bữa trưa tại nh&agrave; h&agrave;ng địa phương.</li>\n	<li>Nhận ph&ograve;ng kh&aacute;ch sạn, nghỉ ngơi (<em>check-in sau 14h00</em>).</li>\n</ul>\n\n<h3><strong>🌅 Chiều: Tham quan tiếp c&aacute;c điểm nổi bật</strong></h3>\n\n<ul>\n	<li><strong>Vườn ti&ecirc;u Ph&uacute; Quốc</strong> &ndash; Trải nghiệm vườn ti&ecirc;u đặc sản nổi tiếng.</li>\n	<li><strong>Nh&agrave; th&ugrave;ng nước mắm</strong> &ndash; T&igrave;m hiểu quy tr&igrave;nh sản xuất nước mắm trứ danh.</li>\n	<li><strong>Cơ sở rượu Sim</strong> &ndash; Thưởng thức loại rượu đặc biệt từ tr&aacute;i Sim rừng.</li>\n	<li><strong>Dinh Cậu &ndash; Dinh B&agrave;</strong> &ndash; Địa danh linh thi&ecirc;ng, nơi ngắm ho&agrave;ng h&ocirc;n đẹp nhất Ph&uacute; Quốc.</li>\n</ul>\n\n<h3><strong>🌙 Tối: Ăn tối &amp; kh&aacute;m ph&aacute; chợ đ&ecirc;m</strong></h3>\n\n<ul>\n	<li>Ăn tối tại nh&agrave; h&agrave;ng.</li>\n	<li>Tự do tham quan <strong>Chợ đ&ecirc;m Ph&uacute; Quốc</strong>, trải nghiệm đặc sản địa phương.</li>\n	<li>Nghỉ đ&ecirc;m tại kh&aacute;ch sạn.</li>\n</ul>\n\n<p><img alt=\"Cho-dem-Phu-Quoc-1571651260-4319-1590903\" src=\"https://i1-dulich.vnecdn.net/2022/04/08/Cho-dem-Phu-Quoc-1571651260-43-6167-2175-1649405357.jpg?w=0&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=AuZhGyITgbhy0hyuwsDQVQ\" style=\"height:333px; width:500px\" /></p>\n\n<h2><strong>🐠 NG&Agrave;Y 2 | NAM ĐẢO &ndash; C&Acirc;U C&Aacute; &amp; LẶN NGẮM SAN H&Ocirc;</strong></h2>\n\n<h3><strong>🌄 S&aacute;ng: Tham quan &amp; trải nghiệm biển đảo</strong></h3>\n\n<ul>\n	<li><strong>Tham quan cơ sở nu&ocirc;i cấy ngọc trai</strong> &ndash; Chi&ecirc;m ngưỡng những vi&ecirc;n ngọc trai tinh xảo.</li>\n	<li><strong>L&ecirc;n t&agrave;u ra khơi</strong> &ndash; Tham gia hoạt động <strong>c&acirc;u c&aacute; biển</strong> &amp; <strong>lặn ngắm san h&ocirc;</strong> (<em>được trang bị &aacute;o phao, mồi c&acirc;u, k&iacute;nh bơi</em>).</li>\n</ul>\n\n<h3><strong>🍽 12:00 | Ăn trưa tr&ecirc;n t&agrave;u &amp; kh&aacute;m ph&aacute; B&atilde;i Sao</strong></h3>\n\n<ul>\n	<li>D&ugrave;ng bữa trưa tr&ecirc;n t&agrave;u.</li>\n	<li><strong>Tắm biển tại B&atilde;i Sao</strong> &ndash; Một trong những b&atilde;i biển đẹp nhất Ph&uacute; Quốc.</li>\n	<li><strong>Tham quan Nh&agrave; t&ugrave; Ph&uacute; Quốc</strong> &ndash; Di t&iacute;ch lịch sử quan trọng.</li>\n	<li><strong>Viếng Ch&ugrave;a Hộ Quốc</strong> &ndash; Ng&ocirc;i ch&ugrave;a lớn với tầm nh&igrave;n hướng biển tuyệt đẹp.</li>\n</ul>\n\n<h3><strong>🌙 Tối: Ăn tối &amp; nghỉ đ&ecirc;m tại kh&aacute;ch sạn</strong></h3>\n\n<p><img alt=\"170a994a0df5f7abaee4-6409-1590903610.jpg\" src=\"https://i1-dulich.vnecdn.net/2022/04/08/170a994a0df5f7abaee4-6409-1590-6109-7838-1649405362.jpg?w=0&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=gf2ccPEVJybQ-YSraqbGLQ\" style=\"height:300px; margin-left:50px; margin-right:50px; width:500px\" /><img src=\"https://i1-dulich.vnecdn.net/2022/04/08/3243dd4b49f4b3aaeae5-8843-1590-5624-7436-1649405363.jpg?w=0&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=3_e9IEtSSLqWuLH0CnhHVw\" style=\"height:300px; width:500px\" /></p>\n\n<h2><strong>🎡 NG&Agrave;Y 3 | VINPEARL LAND &ndash; SAFARI &ndash; C&Aacute;P TREO H&Ograve;N THƠM</strong></h2>\n\n<h3><strong>🌅 S&aacute;ng: Lựa chọn trải nghiệm theo sở th&iacute;ch</strong></h3>\n\n<p>Qu&yacute; kh&aacute;ch c&oacute; thể chọn một trong ba hoạt động sau:<br />\n1️⃣ <strong>VinWonders Ph&uacute; Quốc</strong> &ndash; C&ocirc;ng vi&ecirc;n giải tr&iacute; lớn nhất Việt Nam với:</p>\n\n<ul>\n	<li>Tr&ograve; chơi cảm gi&aacute;c mạnh (<em>th&aacute;p rơi tự do, đu quay lộn đầu...</em>).</li>\n	<li>C&ocirc;ng vi&ecirc;n nước &amp; thủy cung hiện đại.</li>\n	<li>Show diễn đặc sắc như <strong>N&agrave;ng ti&ecirc;n c&aacute;, nhạc nước, cho c&aacute; mập ăn</strong>.</li>\n</ul>\n\n<p>2️⃣ <strong>Vinpearl Safari</strong> &ndash; Vườn th&uacute; b&aacute;n hoang d&atilde; lớn nhất Việt Nam:</p>\n\n<ul>\n	<li>Trải nghiệm xe chuy&ecirc;n dụng tham quan c&aacute;c lo&agrave;i động vật qu&yacute; hiếm.</li>\n	<li>Gặp gỡ <strong>hổ Bengal, t&ecirc; gi&aacute;c trắng, hồng hạc</strong>,...</li>\n</ul>\n\n<p>3️⃣ <strong>C&aacute;p treo H&ograve;n Thơm</strong> &ndash; Tuyến c&aacute;p treo vượt biển d&agrave;i nhất thế giới (<em>7.899,9m</em>):</p>\n\n<ul>\n	<li>Tận hưởng cảnh biển từ tr&ecirc;n cao.</li>\n	<li>Tham gia c&aacute;c hoạt động giải tr&iacute; &amp; tắm biển tại H&ograve;n Thơm.</li>\n</ul>\n\n<h3><strong>🍽 12:00 | Ăn trưa tự t&uacute;c &amp; tiếp tục vui chơi</strong></h3>\n\n<ul>\n	<li>Tự do thưởng thức đặc sản tại c&aacute;c khu vui chơi.</li>\n	<li>Chiều quay về kh&aacute;ch sạn nghỉ ngơi.</li>\n</ul>\n\n<h3><strong>🌙 Tối: Ăn tối &amp; nghỉ đ&ecirc;m tại kh&aacute;ch sạn</strong></h3>\n\n<p><img src=\"https://i1-dulich.vnecdn.net/2022/04/08/VINPEARL-SAFARI-PHU-QUOC-94-45-3469-6265-1649405353.jpg?w=0&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=eDiQA74mNZmYe2h7v5seIA\" style=\"height:300px; width:500px\" /></p>\n\n<h2><strong>✈ NG&Agrave;Y 4 | TẠM BIỆT PH&Uacute; QUỐC</strong></h2>\n\n<h3><strong>🌅 S&aacute;ng: Tự do mua sắm &amp; chuẩn bị về H&agrave; Nội</strong></h3>\n\n<ul>\n	<li>Ăn s&aacute;ng tại kh&aacute;ch sạn.</li>\n	<li><strong>Mua sắm tại chợ Dương Đ&ocirc;ng</strong> &ndash; Đặc sản kh&ocirc; &amp; qu&agrave; lưu niệm.</li>\n	<li><strong>10:30 | Trả ph&ograve;ng kh&aacute;ch sạn &amp; ăn trưa tại nh&agrave; h&agrave;ng.</strong></li>\n</ul>\n\n<h3><strong>🛫 14:00 | Ra s&acirc;n bay về H&agrave; Nội</strong></h3>\n\n<ul>\n	<li>HDV đưa đo&agrave;n ra <strong>s&acirc;n bay Ph&uacute; Quốc</strong>, l&agrave;m thủ tục l&ecirc;n chuyến bay <strong>VJ456 l&uacute;c 16h55</strong> về Nội B&agrave;i.</li>\n	<li><strong>Về đến H&agrave; Nội</strong>, xe đ&oacute;n &amp; đưa qu&yacute; kh&aacute;ch về điểm hẹn ban đầu.</li>\n</ul>\n\n<p>🎉 <strong>Kết th&uacute;c tour &ndash; Hẹn gặp lại trong những h&agrave;nh tr&igrave;nh tiếp theo!</strong> 🎉</p>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2><strong>🎒 CHUẨN BỊ H&Agrave;NH TRANG</strong></h2>\n\n<p>✔ <strong>Trang phục:</strong> Đồ thoải m&aacute;i, gi&agrave;y thể thao, đồ bơi, &aacute;o kho&aacute;c nhẹ.<br />\n✔ <strong>Đồ d&ugrave;ng c&aacute; nh&acirc;n:</strong> Mũ, k&iacute;nh r&acirc;m, kem chống nắng, thuốc c&aacute; nh&acirc;n.<br />\n✔ <strong>Thiết bị:</strong> M&aacute;y ảnh, điện thoại, sạc dự ph&ograve;ng.</p>\n\n<p>📞 <strong>HOTLINE ĐẶT TOUR: 0399 999 999</strong></p>\n', 'https://res.cloudinary.com/doie0qiiq/image/upload/v1741114632/saoviet/nsnkathupquts8ofh0qb.jpg', '<p>&nbsp; &nbsp; &nbsp;<strong>Ph&uacute; Quốc</strong>, h&ograve;n đảo lớn nhất Việt Nam, nằm ở ph&iacute;a T&acirc;y Nam v&agrave; được mệnh danh l&agrave; &quot;<strong><em>Đảo Ngọc</em></strong>&quot; nhờ vẻ đẹp hoang sơ v&agrave; quyến rũ. Nổi tiếng với b&atilde;i biển xanh trong, c&aacute;t trắng mịn v&agrave; những rạn san h&ocirc; tuyệt đẹp, Ph&uacute; Quốc l&agrave; điểm đến l&yacute; tưởng cho những ai y&ecirc;u thi&ecirc;n nhi&ecirc;n v&agrave; muốn tận hưởng kh&ocirc;ng kh&iacute; y&ecirc;n b&igrave;nh. Ngo&agrave;i ra, h&ograve;n đảo c&ograve;n hấp dẫn du kh&aacute;ch bởi đặc sản nổi tiếng như nước mắm, hồ ti&ecirc;u, v&agrave; những khu chợ hải sản sầm uất. Với sự ph&aacute;t triển của du lịch, Ph&uacute; Quốc ng&agrave;y c&agrave;ng khẳng định vị thế của m&igrave;nh tr&ecirc;n bản đồ du lịch quốc tế.</p>\n', 'Tour du lịch Phú Quốc', 7200000, '2025-03-05 01:57:11.895261', 0);

